oFF.AuGdsConfigurationTool = function() {};
oFF.AuGdsConfigurationTool.prototype = new oFF.XObject();
oFF.AuGdsConfigurationTool.prototype._ff_c = "AuGdsConfigurationTool";

oFF.AuGdsConfigurationTool.create = function()
{
	var cfgInstance = new oFF.AuGdsConfigurationTool();
	cfgInstance.setupConfigurationTool(null);
	return cfgInstance;
};
oFF.AuGdsConfigurationTool.createWithConfigurationString = function(configurationString)
{
	var cfgInstance = new oFF.AuGdsConfigurationTool();
	cfgInstance.setupConfigurationTool(configurationString);
	return cfgInstance;
};
oFF.AuGdsConfigurationTool.prototype.m_currentConfiguration = null;
oFF.AuGdsConfigurationTool.prototype.releaseObject = function()
{
	this.m_currentConfiguration = oFF.XObjectExt.release(this.m_currentConfiguration);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsConfigurationTool.prototype.setupConfigurationTool = function(existingConfigStr)
{
	oFF.XObject.prototype.setup.call( this );
	if (oFF.XStringUtils.isNotNullAndNotEmpty(existingConfigStr))
	{
		var parser = oFF.JsonParserFactory.newInstance();
		var tmpElement = parser.parse(existingConfigStr);
		if (oFF.notNull(tmpElement) && tmpElement.isStructure())
		{
			this.m_currentConfiguration = tmpElement;
		}
		parser = oFF.XObjectExt.release(parser);
	}
	if (oFF.isNull(this.m_currentConfiguration))
	{
		this.m_currentConfiguration = oFF.PrFactory.createStructure();
	}
};
oFF.AuGdsConfigurationTool.prototype.getConfig = function()
{
	return this.m_currentConfiguration;
};
oFF.AuGdsConfigurationTool.prototype.getConfigForDocumentType = function(docType)
{
	var docStruct = null;
	if (oFF.notNull(docType))
	{
		var docName = docType.getName();
		docStruct = this.m_currentConfiguration.getStructureByKey(docName);
		if (oFF.isNull(docStruct))
		{
			docStruct = this.m_currentConfiguration.putNewStructure(docName);
		}
	}
	return docStruct;
};
oFF.AuGdsConfigurationTool.prototype.getConfigurationString = function()
{
	var tmpSerializer = oFF.PrSerializerFactory.newSerializer(false, false, 0);
	var stringifiedConfig = tmpSerializer.serialize(this.m_currentConfiguration);
	oFF.XObjectExt.release(tmpSerializer);
	return stringifiedConfig;
};

