oFF.AuGdsDocPanelControllerBase = function() {};
oFF.AuGdsDocPanelControllerBase.prototype = new oFF.XObject();
oFF.AuGdsDocPanelControllerBase.prototype._ff_c = "AuGdsDocPanelControllerBase";

oFF.AuGdsDocPanelControllerBase.prototype.m_contentLayout = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_isPanelContainerOpen = false;
oFF.AuGdsDocPanelControllerBase.prototype.m_panelContainerMaxWidth = 0;
oFF.AuGdsDocPanelControllerBase.prototype.m_panelContainerMinWidth = 0;
oFF.AuGdsDocPanelControllerBase.prototype.m_debugPanelsList = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_panelMap = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_supportedPanelTypes = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_panelStateChangeConsumer = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_document = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_panelContainer = null;
oFF.AuGdsDocPanelControllerBase.prototype.m_openPanelTypes = null;
oFF.AuGdsDocPanelControllerBase.prototype.initialize = function(document, contentLayout)
{
	this.m_document = document;
	this.m_contentLayout = contentLayout;
	this.m_panelMap = oFF.XSimpleMap.create();
	this.m_debugPanelsList = oFF.XList.create();
	this.m_debugPanelsList.add(oFF.AuGdsPanelType.PROFILER);
	this.m_debugPanelsList.add(oFF.AuGdsPanelType.SERIALIZATION);
	if (document.getFeatureManager().isSacIntegration())
	{
		this.m_debugPanelsList.add(oFF.AuGdsPanelType.FILTER);
	}
	this.m_panelContainer = contentLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	this.m_panelContainer.setTag("GDS_PANEL_CONTAINER");
	this.m_panelContainer.setDirection(oFF.UiFlexDirection.ROW);
	this.m_panelContainer.useMaxHeight();
	this.m_panelContainer.setOverflow(oFF.UiOverflow.VISIBLE);
	this.m_panelContainer.setMaxWidth(oFF.UiCssLength.create("40%"));
	if (document.getFeatureManager().areAdvancedFeaturesEnabled())
	{
		this.m_panelContainer.setBorderStyle(oFF.UiBorderStyle.SOLID);
		this.m_panelContainer.setBorderWidth(oFF.UiCssBoxEdges.create("0px 1px 0px 0px"));
		this.m_panelContainer.setBorderColor(oFF.UiTheme.getCurrentTheme().getLightGrayColor());
	}
	this.m_supportedPanelTypes = oFF.AuGdsPanelType.getAllTypesSupportedByDocType(this.m_document.getDocumentType());
	this.m_openPanelTypes = oFF.XList.create();
};
oFF.AuGdsDocPanelControllerBase.prototype.setContentLayout = function(newContentLayout)
{
	this.m_contentLayout = newContentLayout;
};
oFF.AuGdsDocPanelControllerBase.prototype.showPanelContainer = function()
{
	this.m_isPanelContainerOpen = false;
	this.togglePanelContainerVisibility();
};
oFF.AuGdsDocPanelControllerBase.prototype.hidePanelContainer = function()
{
	if (oFF.notNull(this.m_panelContainer))
	{
		this.m_panelContainer.clearItems();
		this.togglePanelContainerVisibility();
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.shouldOpenPanel = function(panelType)
{
	return this.getPanelAutoOpenState(panelType) && !this.isPanelTypeInContainer(panelType);
};
oFF.AuGdsDocPanelControllerBase.prototype.updatePanel = function(panelType)
{
	var panel = this.getPanel(panelType);
	if (oFF.notNull(panel))
	{
		panel.updatePanelUi();
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.isPanelTypeInContainer = function(panelType)
{
	var panel = this.getPanel(panelType);
	return this.isPanelInContainer(panel);
};
oFF.AuGdsDocPanelControllerBase.prototype.executeOnPanelsOfType = function(consumer)
{
	var customPanelTypes = this.m_document.getPanelManager().getAllCustomPanelsForDocumentType(this.m_document.getDocumentType());
	var iterator = this.m_panelMap.getKeysAsIterator();
	while (iterator.hasNext())
	{
		var panelType = iterator.next();
		if (!customPanelTypes.contains(panelType))
		{
			var panel = this.m_panelMap.getByKey(panelType);
			if (oFF.notNull(panel))
			{
				consumer(panel);
			}
		}
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.togglePanel = function(panelType)
{
	if (this.isDebugPanelTypeInNonDebugMode(panelType) || !this.getSupportedPanelTypes(false).contains(panelType))
	{
		return false;
	}
	var autoOpenPanel;
	var panel = this.getPanel(panelType);
	if (oFF.isNull(panel))
	{
		panel = this.createPanel(panelType);
	}
	if (panel.getView().getParent() !== null)
	{
		autoOpenPanel = this.removePanelFromContainer(panel.getView(), panelType);
	}
	else
	{
		autoOpenPanel = this.addPanelToContainer(panel.getView(), panelType);
	}
	this.togglePanelContainerVisibility();
	this.setAutoOpenState(panelType, autoOpenPanel);
	this.afterPanelToggle(autoOpenPanel);
	this.notifyPanelStateChange();
	return autoOpenPanel;
};
oFF.AuGdsDocPanelControllerBase.prototype.registerOnPanelStateChange = function(m_panelStateChangeConsumer)
{
	this.m_panelStateChangeConsumer = m_panelStateChangeConsumer;
};
oFF.AuGdsDocPanelControllerBase.prototype.releaseObject = function()
{
	oFF.XCollectionUtils.releaseEntriesFromCollection(this.m_supportedPanelTypes);
	this.m_supportedPanelTypes = oFF.XObjectExt.release(this.m_supportedPanelTypes);
	oFF.XCollectionUtils.releaseEntriesFromCollection(this.m_panelMap);
	this.m_panelMap = oFF.XObjectExt.release(this.m_panelMap);
	this.m_document = null;
	this.m_contentLayout = null;
	this.m_panelContainer = oFF.XObjectExt.release(this.m_panelContainer);
	oFF.XCollectionUtils.releaseEntriesFromCollection(this.m_debugPanelsList);
	this.m_debugPanelsList = oFF.XObjectExt.release(this.m_debugPanelsList);
	this.m_openPanelTypes = oFF.XObjectExt.release(this.m_openPanelTypes);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsDocPanelControllerBase.prototype.createPanel = function(panelType)
{
	var panel = panelType.getFactory().newPanel(this.m_document);
	if (oFF.notNull(panel))
	{
		panel.setPanelResizeProcedure( function(){
			this.adjustPanelContainerWidth();
		}.bind(this));
		this.m_panelMap.put(panelType, panel);
	}
	return panel;
};
oFF.AuGdsDocPanelControllerBase.prototype.isDebugPanelTypeInNonDebugMode = function(panelType)
{
	var qbDocument = this.m_document;
	return oFF.notNull(qbDocument) && this.m_debugPanelsList.contains(panelType) && !qbDocument.isDebugModeOrSupportUserRole();
};
oFF.AuGdsDocPanelControllerBase.prototype.getOpenStateKey = function(panelType)
{
	return oFF.XStringUtils.concatenate2(panelType.getName(), "_OpenState");
};
oFF.AuGdsDocPanelControllerBase.prototype.addToOpenPanelTypes = function(panelType)
{
	this.m_openPanelTypes.add(panelType);
};
oFF.AuGdsDocPanelControllerBase.prototype.removeFromOpenPanelTypes = function(panelType)
{
	this.m_openPanelTypes.removeElement(panelType);
};
oFF.AuGdsDocPanelControllerBase.prototype.clearOpenPanelTypes = function()
{
	this.m_openPanelTypes.clear();
};
oFF.AuGdsDocPanelControllerBase.prototype.getSupportedPanelTypes = function(forceUpdate)
{
	if (forceUpdate)
	{
		this.m_supportedPanelTypes = oFF.AuGdsPanelType.getAllTypesSupportedByDocType(this.m_document.getDocumentType());
	}
	return this.m_supportedPanelTypes;
};
oFF.AuGdsDocPanelControllerBase.prototype.setSupportedPanelTypes = function(panelTypes)
{
	this.m_supportedPanelTypes = panelTypes;
};
oFF.AuGdsDocPanelControllerBase.prototype.addToSupportedPanelTypes = function(panelType)
{
	var panelTypes = oFF.XList.create();
	panelTypes.addAll(this.m_supportedPanelTypes);
	if (!panelTypes.contains(panelType))
	{
		panelTypes.add(panelType);
		this.setSupportedPanelTypes(panelTypes.getValuesAsReadOnlyList());
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.getPanel = function(panelType)
{
	return this.m_panelMap.getByKey(panelType);
};
oFF.AuGdsDocPanelControllerBase.prototype.isPanelInContainer = function(panel)
{
	if (oFF.notNull(panel) && panel.getView() !== null)
	{
		return panel.getView().getParent() === this.m_panelContainer;
	}
	return false;
};
oFF.AuGdsDocPanelControllerBase.prototype.calculatePanelContainerWidths = function()
{
	this.m_panelContainerMinWidth = 0;
	this.m_panelContainerMaxWidth = 0;
	if (oFF.notNull(this.m_supportedPanelTypes))
	{
		var iterator = this.m_supportedPanelTypes.getIterator();
		while (iterator.hasNext())
		{
			var panelType = iterator.next();
			if (this.isPanelTypeInContainer(panelType))
			{
				var panel = this.getPanel(panelType);
				this.m_panelContainerMinWidth = this.m_panelContainerMinWidth + panel.getMinWidth();
				this.m_panelContainerMaxWidth = this.m_panelContainerMaxWidth + panel.getMaxWidth();
			}
		}
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.adjustPanelContainerWidth = function()
{
	if (this.m_document.getFeatureManager().areAdvancedFeaturesEnabled())
	{
		this.calculatePanelContainerWidths();
		this.m_panelContainer.setMinWidth(oFF.UiCssLength.create(oFF.XStringUtils.concatenate2(oFF.XInteger.convertToString(this.m_panelContainerMinWidth), "px")));
		this.m_panelContainer.setMaxWidth(oFF.UiCssLength.create(oFF.XStringUtils.concatenate2(oFF.XInteger.convertToString(this.m_panelContainerMaxWidth), "px")));
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.togglePanelContainerVisibility = function()
{
	if (oFF.notNull(this.m_panelContainer) && this.m_document.getFeatureManager().areAdvancedFeaturesEnabled())
	{
		if (oFF.notNull(this.m_contentLayout))
		{
			this.adjustPanelContainerWidth();
			if (this.m_panelContainer.getItemCount() === 0)
			{
				this.m_contentLayout.removeItem(this.m_panelContainer);
				this.m_isPanelContainerOpen = false;
			}
			else if (!this.m_isPanelContainerOpen)
			{
				this.m_contentLayout.addItem(this.m_panelContainer);
				this.m_isPanelContainerOpen = true;
			}
		}
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.notifyPanelStateChange = function()
{
	if (oFF.notNull(this.m_panelStateChangeConsumer))
	{
		var uiState = oFF.PrStructure.create();
		var uiStateList = uiState.putNewList(oFF.AuGdsQbConstants.QD_UI_STATE_OPEN_PANELS);
		oFF.XCollectionUtils.forEach(this.m_openPanelTypes,  function(panelType){
			uiStateList.addString(panelType.getName());
		}.bind(this));
		this.m_panelStateChangeConsumer(uiState);
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.setAutoOpenState = function(panelType, openState)
{
	var openStateKey = this.getOpenStateKey(panelType);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(openStateKey))
	{
		this.m_document.getProcess().getLocalStorage().putBoolean(openStateKey, openState);
	}
};
oFF.AuGdsDocPanelControllerBase.prototype.resetAutoOpenState = function(panelType)
{
	var openStateKey = this.getOpenStateKey(panelType);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(openStateKey))
	{
		this.m_document.getProcess().getLocalStorage().removeKey(openStateKey);
	}
};

oFF.AuGdsDocumentFactory = {

	create:function(controller, docType, docFile, docJson, argJson)
	{
			var newDocument = null;
		if (docType === oFF.AuGdsDocumentType.QUERY_BUILDER)
		{
			newDocument = oFF.AuGdsQueryBuilderDocument.create(controller, docFile, docJson, argJson, controller);
		}
		else if (docType === oFF.AuGdsDocumentType.SPREADSHEET)
		{
			newDocument = oFF.AuGdsSpreadsheetDocument.create(controller, docFile, docJson, argJson, controller);
		}
		else if (docType === oFF.AuGdsDocumentType.QUASAR)
		{
			newDocument = oFF.AuGdsQuasarDocument.create(controller, docFile, docJson, argJson, controller);
		}
		return newDocument;
	}
};

oFF.AuGdsQuasarConstants = {

	GDF_QSA_DOC_VERSION:"0.1",
	GDF_QSA_FILE_CONTENT_KEY:"content"
};

