oFF.AuGdsQbDimensionView.getAllChildrenRecursive = function(children)
{
	var all = oFF.XList.create();
	for (var i = 0; i < children.size(); i++)
	{
		var child = children.get(i);
		all.add(child);
		var grandChildren = oFF.AuGdsQbDimensionView.getAllChildrenRecursive(child.getDirectChildren());
		all.addAll(grandChildren);
	}
	return all;
};
