oFF.AuGdsQbDesignerUtils = {

	setFilterForDimension:function(dim, allMembers, includedMembers)
	{
			var includeList = oFF.XListOfString.create();
		var excludeList = oFF.XListOfString.create();
		if (allMembers.size() !== includedMembers.size())
		{
			var lessThanHalfIncluded = includedMembers.size() <= allMembers.size() / 2;
			if (includedMembers.size() !== 0 && lessThanHalfIncluded && !dim.isHierarchyActive())
			{
				oFF.XCollectionUtils.forEach(includedMembers,  function(v){
					v.setResultVisibility(oFF.ResultVisibility.VISIBLE);
					includeList.add(v.getName());
				}.bind(this));
			}
			else
			{
				for (var i = 0; i < allMembers.size(); i++)
				{
					var member = allMembers.get(i).getDimensionMember();
					if (!includedMembers.contains(member))
					{
						excludeList.add(member.getName());
					}
				}
			}
		}
		oFF.AuGdsQbDesignerUtils.createFilterFromLists(dim, includeList, excludeList);
	},
	createFilterFromLists:function(dim, includeList, excludeList)
	{
			dim.getQueryManager().queueEventing();
		var dynamicFilter = dim.getQueryModel().getFilter().getDynamicFilter();
		var cartesianProduct = dynamicFilter.getCartesianProduct();
		if (oFF.isNull(cartesianProduct))
		{
			cartesianProduct = oFF.QFactory.createFilterCartesianProduct(dynamicFilter);
			dynamicFilter.setCartesianProduct(cartesianProduct);
		}
		cartesianProduct.removeByDimensionName(dim.getName());
		var cartesianList = cartesianProduct.getCartesianListWithDefault(dim);
		cartesianList.setHierarchyInfo(dim.getHierarchyName(), dim.getHierarchyDueDate(), dim.getHierarchyVersion());
		for (var i = 0; i < includeList.size(); i++)
		{
			var includeElement = cartesianList.addNewCartesianElement();
			includeElement.setComparisonOperator(oFF.ComparisonOperator.EQUAL);
			includeElement.getLow().setDimensionMember(dim.getDimensionMember(includeList.get(i)));
		}
		for (var j = 0; j < excludeList.size(); j++)
		{
			var excludeElement = cartesianList.addNewCartesianElement();
			excludeElement.setComparisonOperator(oFF.ComparisonOperator.EQUAL);
			excludeElement.setSetSign(oFF.SetSign.EXCLUDING);
			excludeElement.getLow().setDimensionMember(dim.getDimensionMember(excludeList.get(j)));
		}
		dim.getQueryManager().resumeEventing();
	},
	getVisibleByFilter:function(dimension)
	{
			var cartProd = dimension.getQueryModel().getFilter().getDynamicFilter().getCartesianProduct();
		var cartList = oFF.notNull(cartProd) ? cartProd.getCartesianList(dimension) : null;
		var positiveList = oFF.XListOfString.create();
		var negativeList = oFF.XListOfString.create();
		if (oFF.XCollectionUtils.hasElements(cartList))
		{
			for (var i = 0; i < cartList.size(); i++)
			{
				var element = cartList.getCartesianElement(i);
				var setSign = element.getSetSign();
				var comparisonOperator = element.getComparisonOperator();
				var value = element.getLow().getValue();
				if (oFF.notNull(value))
				{
					if (setSign === oFF.SetSign.INCLUDING && comparisonOperator === oFF.ComparisonOperator.EQUAL || setSign === oFF.SetSign.EXCLUDING && comparisonOperator === oFF.ComparisonOperator.NOT_EQUAL)
					{
						positiveList.add(value.getStringRepresentation());
					}
					else if (setSign === oFF.SetSign.EXCLUDING && comparisonOperator === oFF.ComparisonOperator.EQUAL || setSign === oFF.SetSign.INCLUDING && comparisonOperator === oFF.ComparisonOperator.NOT_EQUAL)
					{
						negativeList.add(value.getStringRepresentation());
					}
				}
			}
		}
		return oFF.XPair.create(positiveList, negativeList);
	},
	isVisibleByFilter:function(member, posNegPair)
	{
			var memberName = member.getName();
		var resultVisibility = member.getResultVisibility() === null || member.getResultVisibility() === oFF.ResultVisibility.VISIBLE;
		var posList = posNegPair.getFirstObject();
		var negList = posNegPair.getSecondObject();
		return resultVisibility && !oFF.XCollectionUtils.hasElements(posList) && !oFF.XCollectionUtils.hasElements(negList) || posList.contains(memberName) && !negList.contains(memberName) || !oFF.XCollectionUtils.hasElements(posList) && oFF.XCollectionUtils.hasElements(negList) && !negList.contains(memberName);
	},
	supportsMemberSort:function(dimension)
	{
			var capabilities = dimension.getModelCapabilities();
		return capabilities.supportsCustomSort() || capabilities.supportsCustomMeasureSortOrder() && dimension.isMeasureStructure() || capabilities.supportsCustomMemberKeySortOrder() && !dimension.isMeasureStructure() || capabilities.supportsCustomSortingExtended() && dimension.isStructure();
	},
	setMemberOrder:function(dimension, structureLayout)
	{
			var order = oFF.XStream.of(structureLayout).collect(oFF.XStreamCollector.toListOfString( function(input){
			return input.getName();
		}.bind(this)));
		var sortingManager = dimension.getQueryModel().getSortingManager();
		sortingManager.getSortingOperations().clear();
		sortingManager.applyCustomSort(dimension, dimension.getKeyField(), order, oFF.XSortDirection.ASCENDING, oFF.CustomSortPosition.TOP, true);
	},
	getMemberOrder:function(dimension)
	{
			var members = dimension.getAllStructureMembers();
		var sorting = oFF.AuGdsQbDesignerUtils.tryGetSortingForDimension(dimension);
		if (oFF.isNull(sorting))
		{
			return oFF.XCollectionUtils.createListCopy(members);
		}
		var sortingType = sorting.getSortingType();
		var direction = sorting.getDirection();
		var customSort = sorting.getCustomSort();
		if (oFF.XCollectionUtils.hasElements(customSort))
		{
			return oFF.XStream.ofString(customSort).map( function(name){
				return members.getByKey(name.toString());
			}.bind(this)).collect(oFF.XStreamCollector.toListOfNameObject());
		}
		var orderedMembers = oFF.XListOfNameObject.create();
		orderedMembers.addAll(members);
		orderedMembers.sortByComparator(oFF.XComparatorLambda.create( function(first, second){
			var dir = direction === oFF.XSortDirection.DESCENDING ? -1 : 1;
			var order = 0;
			if (sortingType === oFF.SortType.MEMBER_KEY)
			{
				order = oFF.XString.compare(first.getName(), second.getName());
			}
			else if (sortingType === oFF.SortType.MEMBER_TEXT)
			{
				order = oFF.XString.compare(first.getText(), second.getText());
			}
			else if (sortingType === oFF.SortType.FIELD)
			{
				var field = sorting.getField();
				var firstValue = first.getFieldValue(field);
				var secondValue = second.getFieldValue(field);
				order = oFF.XString.compare(firstValue.getValue().getStringRepresentation(), secondValue.getValue().getStringRepresentation());
			}
			return oFF.XIntegerValue.create(order * dir);
		}.bind(this)));
		return orderedMembers;
	},
	tryGetSortingForDimension:function(dim)
	{
			var sortingManager = dim.getQueryModel().getSortingManager();
		var sorting = sortingManager.getDimensionSorting(dim, false);
		if (oFF.isNull(sorting))
		{
			sorting = oFF.XCollectionUtils.findFirst(sortingManager.getSortingOperations(),  function(op){
				if (op.getSortingType().isTypeOf(oFF.SortType.FIELD))
				{
					var field = op.getField();
					return oFF.XString.isEqual(field.getDimension().getName(), dim.getName());
				}
				return false;
			}.bind(this));
		}
		return sorting;
	},
	getOppositeAxis:function(axisType)
	{
			return axisType === oFF.AxisType.ROWS ? oFF.AxisType.COLUMNS : oFF.AxisType.ROWS;
	},
	canBeAggregated:function(dimension)
	{
			if (!dimension.canBeAggregated())
		{
			var visibleByFilter = oFF.AuGdsQbDesignerUtils.getVisibleByFilter(dimension);
			var includeList = visibleByFilter.getFirstObject();
			return includeList.size() === 1;
		}
		return true;
	},
	openSingleMemberFilterDialog:function(application, title, dimension, onDone)
	{
			var entryPoint = oFF.FdEntryPoint.createEntryPoint(application, title);
		var config = entryPoint.getConfiguration();
		config.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT_LEFT);
		config.setSelectionRequired(true);
		entryPoint.openWithDynamicFilter(dimension, null, onDone, null);
	}
};

