oFF.AuGdsQbSacInsightHandler = function() {};
oFF.AuGdsQbSacInsightHandler.prototype = new oFF.XObject();
oFF.AuGdsQbSacInsightHandler.prototype._ff_c = "AuGdsQbSacInsightHandler";

oFF.AuGdsQbSacInsightHandler.create = function()
{
	var formatter = new oFF.AuGdsQbSacInsightHandler();
	return formatter;
};
oFF.AuGdsQbSacInsightHandler.isValidInsight = function(file, fileContent)
{
	if (oFF.notNull(file))
	{
		if (file.getAttributes() !== null && !file.getAttributes().isEmpty())
		{
			var resourceSubtype = file.getAttributes().getStringByKeyExt(oFF.FileAttributeType.NODE_SUB_TYPE.getName(), "");
			if (!oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.INSIGHT, resourceSubtype))
			{
				return false;
			}
		}
	}
	if (oFF.isNull(fileContent))
	{
		return false;
	}
	var isValid = false;
	var hasName = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.NAME) || fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.TITLE);
	var hasDescription = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.DESCRIPTION);
	var hasContent = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
	if (hasName && hasDescription && hasContent)
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var hasSourceTool = content.containsKey(oFF.AuGdsQbSacContentlibConstants.SOURCETOOL);
		var hasMetadata = content.containsKey(oFF.AuGdsQbSacContentlibConstants.METADATA);
		var hasEntities = content.containsKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
		if (hasSourceTool && hasMetadata && hasEntities)
		{
			var entities = content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
			isValid = entities.size() > 0;
		}
	}
	return isValid;
};
oFF.AuGdsQbSacInsightHandler.addFileAttributes = function(file, resourceInfo)
{
	if (oFF.isNull(resourceInfo))
	{
		throw oFF.XException.createIllegalStateException(oFF.AuGdsQbSacContentlibConstants.ILLEGAL_STATE);
	}
	file.getAttributes().putString(oFF.FileAttributeType.DISPLAY_NAME.getName(), resourceInfo.getName() !== null ? resourceInfo.getName() : file.getName());
	file.getAttributes().putString(oFF.FileAttributeType.DESCRIPTION.getName(), resourceInfo.getDescription() !== null ? resourceInfo.getDescription() : "");
	file.getAttributes().putString(oFF.FileAttributeType.NODE_TYPE.getName(), oFF.AuGdsQbSacContentlibConstants.STORY);
	file.getAttributes().putString(oFF.FileAttributeType.NODE_SUB_TYPE.getName(), oFF.AuGdsQbSacContentlibConstants.INSIGHT);
};
oFF.AuGdsQbSacInsightHandler.appendModelDataset = function(insightContentJson, docContent)
{
	var dataset = oFF.PrFactory.createStructure();
	dataset.putString("type", oFF.AuGdsQbSacContentlibConstants.DATASET);
	var data = dataset.putNewStructure("data");
	data.putBoolean("forcePrompt", docContent.getFileStructure().getBooleanByKey("forcePrompt"));
	if (docContent.getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY) !== null)
	{
		var modelJson = docContent.getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY);
		var instance = oFF.AuGdsQbSacInsightHandler.create();
		var datasetId = instance.buildDatasetId(modelJson);
		dataset.putString("id", datasetId);
		data.putString("id", datasetId);
		data.putString("isRemote", modelJson.getStringByKey("isRemote"));
		data.putString("packageName", modelJson.getStringByKey("packageName"));
		data.putString("modelId", modelJson.getStringByKey("name"));
		if (!oFF.XString.isEqual(insightContentJson.getStringByKey(oFF.AuGdsQbSacContentlibConstants.MODELTYPE), oFF.AuGdsQbSacContentlibConstants.PERSISTED))
		{
			insightContentJson.remove(oFF.AuGdsQbSacContentlibConstants.MODELTYPE);
			insightContentJson.putString(oFF.AuGdsQbSacContentlibConstants.MODELTYPE, oFF.AuGdsQbSacContentlibConstants.PERSISTED);
		}
	}
	insightContentJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT).getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES).add(dataset);
	return insightContentJson;
};
oFF.AuGdsQbSacInsightHandler.loadModelDependencyToDocument = function(fileContent, docContent)
{
	if (oFF.notNull(fileContent))
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var entities = oFF.notNull(content) ? content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES) : null;
		if (oFF.notNull(entities))
		{
			for (var i = 0; i < entities.size(); i++)
			{
				var entity = entities.getStructureAt(i);
				if (oFF.XString.isEqual(entity.getStringByKey(oFF.AuGdsQbSacContentlibConstants.TYPE), oFF.AuGdsQbSacContentlibConstants.DATASET))
				{
					docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY, entity);
				}
			}
		}
	}
};
oFF.AuGdsQbSacInsightHandler.prototype.m_formatErrorConsumer = null;
oFF.AuGdsQbSacInsightHandler.prototype.formatToInsight = function(content, outputFile)
{
	var formattedContent = oFF.PrFactory.createStructure();
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.NAME, outputFile.getAttributes().getStringByKey(oFF.FileAttributeType.DISPLAY_NAME.getName()));
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.TITLE, outputFile.getAttributes().getStringByKey(oFF.FileAttributeType.DISPLAY_NAME.getName()));
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.MODELTYPE, oFF.AuGdsQbSacContentlibConstants.TRANSIENT);
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.DESCRIPTION, outputFile.getAttributes().getStringByKey(oFF.FileAttributeType.DESCRIPTION.getName()));
	var insightContent = formattedContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.CONTENT);
	var entities = insightContent.putNewList(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
	entities.add(content);
	var metadata = insightContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.METADATA);
	metadata.putString(oFF.AuGdsQbSacContentlibConstants.STRATEGY, oFF.AuGdsQbSacContentlibConstants.DRAGONFLY_STRATEGY);
	metadata.putString(oFF.AuGdsQbSacContentlibConstants.VERSION, oFF.AuGdsQbSacContentlibConstants.INSIGHT_VERSION);
	var sourceTool = insightContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.SOURCETOOL);
	sourceTool.putString(oFF.AuGdsQbSacContentlibConstants.NAME, oFF.AuGalaxyDataStudio.DEFAULT_PROGRAM_NAME);
	var sourceToolMetadata = sourceTool.putNewStructure(oFF.AuGdsQbSacContentlibConstants.METADATA);
	var toolmetadata = sourceToolMetadata.putNewStructure(oFF.AuGdsQbSacContentlibConstants.TOOLMETADATA);
	toolmetadata.putString(oFF.AuGdsQbSacContentlibConstants.DOCTYPE, oFF.AuGdsDocumentType.QUERY_BUILDER.getName());
	toolmetadata.putString(oFF.AuGdsQbSacContentlibConstants.VERSION, oFF.AuGdsQbConstants.GDF_QD_DOC_VERSION);
	var isValidInsight = oFF.AuGdsQbSacInsightHandler.isValidInsight(outputFile, formattedContent);
	if (!isValidInsight)
	{
		this.m_formatErrorConsumer(oFF.AuGdsQbSacContentlibConstants.EMPTY_SERIALIZED_STATE);
		return null;
	}
	return formattedContent;
};
oFF.AuGdsQbSacInsightHandler.prototype.formatToDragonflySerializedState = function(fileContent, file)
{
	var serializedState = null;
	if (oFF.notNull(fileContent))
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var entities = oFF.notNull(content) ? content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES) : null;
		serializedState = oFF.notNull(entities) ? entities.getStructureAt(0) : null;
		if (oFF.isNull(serializedState))
		{
			this.m_formatErrorConsumer(oFF.AuGdsQbSacContentlibConstants.EMPTY_SERIALIZED_STATE);
		}
		else
		{
			return serializedState;
		}
	}
	return serializedState;
};
oFF.AuGdsQbSacInsightHandler.prototype.setErrorConsumer = function(errorConsumer)
{
	this.m_formatErrorConsumer = errorConsumer;
};
oFF.AuGdsQbSacInsightHandler.prototype.setupHandler = function()
{
	this.setErrorConsumer( function(errorCode){
		throw oFF.XException.createIllegalStateException(errorCode);
	}.bind(this));
};
oFF.AuGdsQbSacInsightHandler.prototype.validate = function(fileJson, file)
{
	return oFF.AuGdsQbSacInsightHandler.isValidInsight(file, fileJson);
};
oFF.AuGdsQbSacInsightHandler.prototype.format = function(fileJson, file)
{
	return this.formatToInsight(fileJson, file);
};
oFF.AuGdsQbSacInsightHandler.prototype.extract = function(fileJson, file)
{
	return this.formatToDragonflySerializedState(fileJson, file);
};
oFF.AuGdsQbSacInsightHandler.prototype.buildDatasetId = function(modelJson)
{
	var datasetId = "";
	var modelType = "";
	var schemaName = "";
	var packageName = "";
	var querySource = "";
	if (oFF.XString.isEqual(modelJson.getStringByKey("mode"), "integrated"))
	{
		querySource = modelJson.getStringByKey("name");
		if (oFF.isNull(querySource))
		{
			var modelResourceId = modelJson.getStringByKey("id");
			querySource = oFF.notNull(modelResourceId) ? oFF.XStringTokenizer.splitString(modelResourceId, ":").get(1) : "";
		}
		packageName = modelJson.getStringByKey("packageName");
		schemaName = "_SYS_BIC";
		modelType = "view";
	}
	else
	{
		querySource = modelJson.getStringByKey("epmQuerySourceName");
		packageName = "";
		schemaName = modelJson.getStringByKey("schemaName");
		modelType = "planning";
	}
	var datasetIdLeft = oFF.XStringUtils.concatenate4(modelType, ":[", schemaName, "][");
	var datasetIdRight = oFF.XStringUtils.concatenate4(packageName, "][", querySource, "]");
	datasetId = oFF.XStringUtils.concatenate2(datasetIdLeft, datasetIdRight);
	return datasetId;
};

