oFF.AuGdsQbSacModelHandler.isValidModel = function(file, modelJson)
{
	if (oFF.notNull(file))
	{
		if (file.getAttributes() !== null && !file.getAttributes().isEmpty())
		{
			var resourceType = file.getAttributes().getStringByKeyExt(oFF.FileAttributeType.NODE_TYPE.getName(), "");
			if (!oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.MODEL, resourceType))
			{
				return false;
			}
		}
	}
	if (oFF.isNull(modelJson))
	{
		return false;
	}
	var modelContent = modelJson;
	if (modelJson.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		modelContent = modelJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA);
	}
	var hasId = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.ID);
	var hasName = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.NAME);
	var hasType = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.TYPE);
	var hasMode = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.MODE);
	var isValidStatus = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.STATUS) && oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.VALID, modelContent.getStringByKey(oFF.AuGdsQbSacContentlibConstants.STATUS));
	return hasId && hasName && hasType && hasMode && isValidStatus;
};
oFF.AuGdsQbSacModelHandler.getDataSourceFromModelJson = function(modelJson, file)
{
	if (oFF.notNull(modelJson) && modelJson.hasElements())
	{
		var modelContent = modelJson;
		if (modelJson.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
		{
			modelContent = modelJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA);
		}
		if (modelContent.containsKey(oFF.AuGdsQbSacModelHandler.DATA_SOURCE_KEY))
		{
			var dataSource = modelContent.getStructureByKey(oFF.AuGdsQbSacModelHandler.DATA_SOURCE_KEY);
			if (oFF.notNull(dataSource) && dataSource.hasElements())
			{
				var newDataSource = oFF.QFactory.createDataSource();
				newDataSource.setType(oFF.MetaObjectType.lookup(dataSource.getStringByKey(oFF.AuGdsQbSacModelHandler.DS_TYPE_KEY)));
				newDataSource.setSchemaName(dataSource.getStringByKey(oFF.AuGdsQbSacModelHandler.DS_SCHEMA_NAME_KEY));
				newDataSource.setPackageName(dataSource.getStringByKey(oFF.AuGdsQbSacModelHandler.DS_PACKAGE_NAME_KEY));
				newDataSource.setObjectName(dataSource.getStringByKey(oFF.AuGdsQbSacModelHandler.DS_OBJECT_NAME_KEY));
				newDataSource.setSystemName(dataSource.getStringByKeyExt(oFF.AuGdsQbSacModelHandler.DS_SYSTEM_KEY, oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME));
				oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary(newDataSource, file);
				return newDataSource;
			}
		}
		if (modelContent.containsKey(oFF.AuGdsQbSacModelHandler.SOURCES_KEY))
		{
			var sourcesList = modelContent.getListByKey(oFF.AuGdsQbSacModelHandler.SOURCES_KEY);
			if (oFF.notNull(sourcesList) && sourcesList.hasElements())
			{
				var sourceInfo = sourcesList.getStructureAt(0);
				if (oFF.notNull(sourceInfo) && sourceInfo.hasElements())
				{
					var newDataSource2 = oFF.QFactory.createDataSource();
					newDataSource2.setType(oFF.MetaObjectType.lookup(sourceInfo.getStringByKey(oFF.AuGdsQbSacModelHandler.OBJECT_TYPE_KEY)));
					newDataSource2.setSchemaName(sourceInfo.getStringByKey(oFF.AuGdsQbSacModelHandler.SCHEMA_NAME_KEY));
					newDataSource2.setPackageName(sourceInfo.getStringByKey(oFF.AuGdsQbSacModelHandler.PACKAGE_NAME_KEY));
					newDataSource2.setObjectName(sourceInfo.getStringByKey(oFF.AuGdsQbSacModelHandler.OBJECT_NAME_KEY));
					newDataSource2.setSystemName(sourceInfo.getStringByKeyExt(oFF.AuGdsQbSacModelHandler.CONNECTION_NAME_KEY, oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME));
					oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary(newDataSource2, file);
					return newDataSource2;
				}
			}
		}
	}
	return null;
};
oFF.AuGdsQbSacModelHandler.getInaRepoJsonFromModelJson = function(application, modelJson)
{
	var jsonToProcess = modelJson;
	if (!jsonToProcess.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		jsonToProcess = oFF.PrFactory.createStructure();
		jsonToProcess.put(oFF.AuGdsQbSacContentlibConstants.CDATA, modelJson);
	}
	var modellerResponse = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, jsonToProcess);
	var docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
	var extConverterResult = docConverter.convert(application, modellerResponse, oFF.QModelFormat.INA_REPOSITORY);
	var inaRepoData = extConverterResult.getData();
	if (oFF.notNull(inaRepoData))
	{
		var inaRepoJson = inaRepoData.getJsonContent();
		if (oFF.notNull(inaRepoJson) && inaRepoJson.isStructure())
		{
			return inaRepoJson.asStructure();
		}
	}
	return null;
};
oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary = function(dataSource, file)
{
	if (oFF.notNull(file))
	{
		var originSystem = null;
		if (file.getAttributes() !== null && file.getAttributes().containsKey(oFF.FileAttributeType.SYSTEM_NAME.getName()))
		{
			originSystem = file.getAttributes().getStringByKey(oFF.FileAttributeType.SYSTEM_NAME.getName());
		}
		if (oFF.XString.isEqual(dataSource.getSystemName(), oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME) && !oFF.XString.isEqual(originSystem, oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME))
		{
			dataSource.setSystemName(originSystem);
		}
	}
};
