oFF.AuGdsQbOrcaInteropHandler = {

	applyOrcaSfxMetadataToQueryManager:function(qbDocContent, queryManager)
	{
			var orcaInteropSettings = qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		if (oFF.isNull(orcaInteropSettings) || oFF.isNull(queryManager))
		{
			return;
		}
		var sfxMetadata = orcaInteropSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA);
		if (oFF.notNull(sfxMetadata))
		{
			var contentSFX = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, sfxMetadata);
			var docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
			var extConverterResult = docConverter.convert(queryManager.getApplication(), contentSFX, oFF.QModelFormat.INA_REPOSITORY);
			var inaRepoData = extConverterResult.getData();
			var originalIsBasicMeasureAggregationExportedInRepo = queryManager.getQueryModel().isBasicMeasureAggregationExportedInRepo();
			var originalIsBasicMeasureSettingsExportedInRepo = queryManager.getQueryModel().isBasicMeasureSettingsExportedInRepo();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(true);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(true);
			queryManager.getQueryModel().stopEventing();
			queryManager.getQueryModel().deserializeFromContent(inaRepoData);
			queryManager.getQueryModel().resumeEventing();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(originalIsBasicMeasureAggregationExportedInRepo);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(originalIsBasicMeasureSettingsExportedInRepo);
		}
	},
	applyOrcaSettingsToQueryManager:function(qbDocContent, queryManager)
	{
			var orcaInteropSettings = qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		if (oFF.isNull(orcaInteropSettings) || oFF.isNull(queryManager))
		{
			return;
		}
		var displayModes = orcaInteropSettings.getListByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_DISPLAY_MODE_LIST);
		oFF.XCollectionUtils.forEach(displayModes,  function(listElement){
			if (listElement.isStructure())
			{
				var displayMode = listElement;
				var dimensionName = displayMode.getStringByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_DIMENSION);
				var mode = displayMode.getStringByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_DISPLAY_MODE);
				var dimension = queryManager.getQueryModel().getDimensionByName(dimensionName);
				var mainAttributeModel;
				var mainAttribute = dimension.getMainAttribute();
				if (oFF.isNull(mainAttribute))
				{
					mainAttributeModel = oFF.FieldContainerPresentationHelper.createFromFieldContainer(dimension);
				}
				else
				{
					mainAttributeModel = oFF.FieldContainerPresentationHelper.createFromFieldContainer(mainAttribute);
				}
				if (!mainAttributeModel.isMayDisplayText())
				{
					mainAttributeModel.setDisplayAs(oFF.FieldContainerDisplay.KEY);
				}
				else if (oFF.XString.isEqual(mode, oFF.AuGdsQbOrcaInteropConstants.GDF_ORCA_DM_DESCRIPTION))
				{
					mainAttributeModel.setDisplayAs(oFF.FieldContainerDisplay.TEXT);
				}
				else if (oFF.XString.isEqual(mode, oFF.AuGdsQbOrcaInteropConstants.GDF_ORCA_DM_ID))
				{
					mainAttributeModel.setDisplayAs(oFF.FieldContainerDisplay.KEY);
				}
				else if (oFF.XString.isEqual(mode, oFF.AuGdsQbOrcaInteropConstants.GDF_ORCA_DM_DESCRIPTION_AND_ID))
				{
					mainAttributeModel.setDisplayAs(oFF.FieldContainerDisplay.TEXT_AND_KEY);
				}
				else if (oFF.XString.isEqual(mode, oFF.AuGdsQbOrcaInteropConstants.GDF_ORCA_DM_ID_AND_DESCRIPTION))
				{
					mainAttributeModel.setDisplayAs(oFF.FieldContainerDisplay.KEY_AND_TEXT);
				}
				dimension.getQueryModel().getConvenienceCommands().clearAllAttributeFields(dimensionName, mainAttributeModel.getComponentName(), oFF.QContextType.RESULT_SET);
				mainAttributeModel.applyToQueryModel(dimension.getQueryModel(), dimensionName);
				if (dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED)
				{
					mainAttributeModel.applyMainAttributeForFieldLayout(dimension);
				}
			}
		}.bind(this));
	}
};

