oFF.AuGdsQbUtils = {

	isDimension:function(modelComponent)
	{
			return oFF.notNull(modelComponent) && modelComponent.getOlapComponentType().isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION);
	},
	isAttribute:function(modelComponent)
	{
			return oFF.notNull(modelComponent) && modelComponent.getOlapComponentType().isTypeOf(oFF.OlapComponentType.ATTRIBUTE);
	},
	isMember:function(modelComponent)
	{
			return oFF.notNull(modelComponent) && modelComponent.getOlapComponentType().isTypeOf(oFF.MemberType.ABSTRACT_MEMBER);
	},
	isStructureLike:function(dimension)
	{
			return dimension.isStructure() || dimension.getDimensionType() === oFF.DimensionType.ACCOUNT;
	},
	shouldDimensionBeShown:function(dim, supportsDimensionGrouping)
	{
			if (dim.isTechnicalDimension())
		{
			return false;
		}
		if (dim.getVisibility() !== null && dim.getVisibility() !== oFF.DimensionVisibility.VISIBLE)
		{
			return false;
		}
		var dimName = dim.getName();
		if (oFF.XString.startsWith(dimName, "$$") && oFF.XString.endsWith(dimName, "$$"))
		{
			return false;
		}
		if (oFF.XString.startsWith(dimName, "_") && oFF.XString.endsWith(dimName, "_"))
		{
			return false;
		}
		if (dim.getDataSource().getType() === oFF.MetaObjectType.PLANNING)
		{
			var groupingDimensions = dim.getGroupingDimensions();
			for (var i = 0; i < groupingDimensions.size(); i++)
			{
				var groupingDim = groupingDimensions.get(i);
				if (!supportsDimensionGrouping && groupingDim.getDimensionType() === oFF.DimensionType.TIME)
				{
					return false;
				}
				if (groupingDim.getDimensionType() === oFF.DimensionType.VERSION_EPM)
				{
					return false;
				}
				if (groupingDim.getFlatKeyField() !== null && oFF.XString.isEqual(groupingDim.getFlatKeyField().getName(), dim.getName()))
				{
					return false;
				}
				if (groupingDim.getFlatTextField() !== null && oFF.XString.isEqual(groupingDim.getFlatTextField().getName(), dim.getName()))
				{
					return false;
				}
			}
		}
		else if (!supportsDimensionGrouping && dim.isGroupingDimension() && !oFF.AuGdsQbUtils.isStructureLike(dim))
		{
			return false;
		}
		return true;
	}
};

oFF.AuGdsQbViewFactory = {

	createByViewType:function(viewType, qbDoc)
	{
			var newView = null;
		if (oFF.notNull(viewType) && oFF.notNull(qbDoc))
		{
			if (viewType === oFF.AuGdsViewType.TABLE)
			{
				newView = oFF.AuGdsQbInteractiveTableView.create(qbDoc);
			}
			else if (viewType === oFF.AuGdsViewType.CHART)
			{
				newView = oFF.AuGdsQbChartView.create(qbDoc);
			}
			else if (viewType === oFF.AuGdsViewType.SPREADSHEET)
			{
				newView = oFF.AuGdsQbSpreadsheetView.createForQb(qbDoc);
			}
		}
		return newView;
	},
	createViewByViewData:function(viewData, qbDoc)
	{
			var newView = null;
		if (oFF.notNull(viewData) && oFF.notNull(qbDoc))
		{
			var viewTypeStr = viewData.getStringByKey(oFF.AuGdsQbConstants.QD_VIEW_DATA_VIEW_TYPE);
			var viewType = oFF.AuGdsViewType.lookup(viewTypeStr);
			if (oFF.notNull(viewType))
			{
				newView = oFF.AuGdsQbViewFactory.createByViewType(viewType, qbDoc);
				if (oFF.notNull(newView))
				{
					newView.setupFromSaveData(viewData);
				}
			}
		}
		return newView;
	}
};

