oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator = function() {};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype = new oFF.XObject();
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype._ff_c = "AuGdsQbDfInteractiveStandAloneContextMenuCreator";

oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.create = function(qbDocument)
{
	var instance = new oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator();
	instance.initialize(qbDocument);
	return instance;
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.m_qbDocument = null;
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.initialize = function(qbDocument)
{
	this.m_qbDocument = qbDocument;
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.releaseObject = function()
{
	this.m_qbDocument = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.getStandaloneDimensionMenu = function(menu, context, dimension, menuShow)
{
	var contextStructure = this.m_qbDocument.getBasicContextForMenu();
	this.addDimensionSubContext(dimension, contextStructure);
	this.m_qbDocument.getMenuManager().populateMenu(menu, contextStructure, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_BUILDER_CONTEXT_MENU,  function(md, success){
		if (success)
		{
			menuShow();
		}
	}.bind(this));
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.addDimensionSubContext = function(dimension, contextStructure)
{
	var subContext = contextStructure.addSubContext();
	subContext.setCustomObject(dimension);
	var dimensionType = dimension.getDimensionType();
	if (dimensionType === oFF.DimensionType.ACCOUNT)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_ACCOUNT);
	}
	else if (dimensionType === oFF.DimensionType.MEASURE_STRUCTURE)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_MEASURE);
	}
	else if (dimensionType === oFF.DimensionType.SECONDARY_STRUCTURE)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_SECONDARY);
	}
	else if (dimensionType === oFF.DimensionType.CALCULATED_DIMENSION)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_CALCULATED);
	}
	else if (dimensionType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_VERSION);
	}
	else if (dimension.isUniversalDisplayHierarchyDimension())
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_UDH);
	}
	else
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_BASE);
	}
	subContext.setName(dimension.getName());
	subContext.setText(dimension.getText());
	oFF.AuGdsQbSubContextFillerUtil.expandDimensionSubContexts(subContext, dimension, dimension.getQueryModel());
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.getStandaloneAxisMenu = function(menu, context, axis, menuShow)
{
	var contextStructure = this.m_qbDocument.getBasicContextForMenu();
	var subContext = contextStructure.addSubContext();
	subContext.setCustomObject(axis);
	if (oFF.XCollectionUtils.hasElements(axis))
	{
		for (var i = 0; i < axis.size(); i++)
		{
			this.addDimensionSubContext(axis.get(i), subContext);
		}
	}
	var axisType = axis.getType();
	subContext.setType(axisType === oFF.AxisType.ROWS ? oFF.AuGdsContextConstants.OLAP_AXIS_ROWS : oFF.AuGdsContextConstants.OLAP_AXIS_COLUMNS);
	subContext.setName(axis.getType().getName());
	this.m_qbDocument.getMenuManager().populateMenu(menu, contextStructure, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_BUILDER_CONTEXT_MENU,  function(md, success){
		if (success)
		{
			menuShow();
		}
	}.bind(this));
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.getStandaloneQueryMenu = function(menu, context, menuShow)
{
	var contextStructure = this.m_qbDocument.getBasicContextForMenu();
	this.m_qbDocument.getMenuManager().populateMenu(menu, contextStructure, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_BUILDER_CONTEXT_MENU,  function(md, success){
		if (success)
		{
			menuShow();
		}
	}.bind(this));
};
oFF.AuGdsQbDfInteractiveStandAloneContextMenuCreator.prototype.getStandaloneMeasureMenu = function(menu, context, measure, menuShow)
{
	var contextStructure = this.m_qbDocument.getBasicContextForMenu();
	var subContext = contextStructure.addSubContext();
	subContext.setCustomObject(measure);
	var dimension = measure.getDimension();
	if (dimension.getDimensionType() === oFF.DimensionType.MEASURE_STRUCTURE)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_SINGLE);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.SECONDARY_STRUCTURE)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_SINGLE);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.ACCOUNT)
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_SINGLE);
	}
	else
	{
		subContext.setType(oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_BASE);
	}
	this.m_qbDocument.getMenuManager().populateMenu(menu, contextStructure, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_BUILDER_CONTEXT_MENU,  function(md, success){
		if (success)
		{
			menuShow();
		}
	}.bind(this));
};

oFF.AuGdsFilterLineConfig = function() {};
oFF.AuGdsFilterLineConfig.prototype = new oFF.XObject();
oFF.AuGdsFilterLineConfig.prototype._ff_c = "AuGdsFilterLineConfig";

oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS = "filterTokens";
oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE = "showType";
oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE = "filterType";
oFF.AuGdsFilterLineConfig.create = function()
{
	var instance = new oFF.AuGdsFilterLineConfig();
	instance.setupInitialConfig();
	return instance;
};
oFF.AuGdsFilterLineConfig.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineConfig.prototype.releaseObject = function()
{
	this.m_filterLineConfig = oFF.XObjectExt.release(this.m_filterLineConfig);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineConfig.prototype.getFilterLineStructure = function()
{
	return this.m_filterLineConfig.getStructureByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS);
};
oFF.AuGdsFilterLineConfig.prototype.getStructureForDimension = function(dimensionName)
{
	var structure = this.getFilterLineStructure().getStructureByKey(dimensionName);
	if (oFF.isNull(structure))
	{
		structure = this.getFilterLineStructure().putNewStructure(dimensionName);
	}
	return structure;
};
oFF.AuGdsFilterLineConfig.prototype.setDisplayTypeForDimension = function(dimensionName, displayType)
{
	this.getStructureForDimension(dimensionName).put(oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE, oFF.PrFactory.createString(displayType));
};
oFF.AuGdsFilterLineConfig.prototype.getDisplayTypeForDimension = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE);
};
oFF.AuGdsFilterLineConfig.prototype.getDisplayTypeForDimensionWithFallback = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKeyExt(oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE, oFF.FdDimensionDisplayInfo.DESCRIPTION.getName());
};
oFF.AuGdsFilterLineConfig.prototype.setFilterTypeForDimension = function(dimensionName, filterType)
{
	this.getStructureForDimension(dimensionName).put(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE, oFF.PrFactory.createString(filterType));
};
oFF.AuGdsFilterLineConfig.prototype.getFilterTypeForDimension = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE);
};
oFF.AuGdsFilterLineConfig.prototype.getFilterTypeForDimensionWithFallback = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKeyExt(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE, oFF.FdFilterType.LIST.getName());
};
oFF.AuGdsFilterLineConfig.prototype.getConfig = function()
{
	return oFF.PrFactory.createStructureDeepCopy(this.m_filterLineConfig);
};
oFF.AuGdsFilterLineConfig.prototype.setConfig = function(config)
{
	if (oFF.notNull(config))
	{
		this.m_filterLineConfig = oFF.PrFactory.createStructureDeepCopy(config);
		if (oFF.isNull(this.m_filterLineConfig) || this.getFilterLineStructure() === null)
		{
			throw oFF.XException.createRuntimeException("FilterLine configuration is invalid!");
		}
	}
	else
	{
		this.setupInitialConfig();
	}
};
oFF.AuGdsFilterLineConfig.prototype.isDimensionConfigSet = function(dimensionName)
{
	return this.getFilterLineStructure().containsKey(dimensionName);
};
oFF.AuGdsFilterLineConfig.prototype.setupInitialConfig = function()
{
	this.m_filterLineConfig = oFF.PrFactory.createStructure();
	this.m_filterLineConfig.putNewStructure(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS);
};

oFF.AuGdsFilterLineDimensionDisplayTypeRetriever = function() {};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype = new oFF.XObject();
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype._ff_c = "AuGdsFilterLineDimensionDisplayTypeRetriever";

oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.create = function(dimension, filterLineConfig)
{
	var instance = new oFF.AuGdsFilterLineDimensionDisplayTypeRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_filterLineConfig = oFF.XObjectExt.assertNotNull(filterLineConfig);
	return instance;
};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.m_dimension = null;
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.releaseObject = function()
{
	this.m_dimension = null;
	this.m_filterLineConfig = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.getDisplayType = function()
{
	var result = oFF.FdDimensionDisplayInfo.DESCRIPTION;
	if (this.m_filterLineConfig.isDimensionConfigSet(this.m_dimension.getName()))
	{
		var showType = this.m_filterLineConfig.getDisplayTypeForDimensionWithFallback(this.m_dimension.getName());
		if (oFF.XString.isEqual(showType, oFF.FdDimensionDisplayInfo.ID.getName()))
		{
			result = oFF.FdDimensionDisplayInfo.ID;
		}
		else if (oFF.XString.isEqual(showType, oFF.FdDimensionDisplayInfo.ID_AND_DESCRIPTION.getName()))
		{
			result = oFF.FdDimensionDisplayInfo.ID_AND_DESCRIPTION;
		}
	}
	return result;
};

oFF.AuGdsFilterLineFdFilterTypeRetriever = function() {};
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype = new oFF.XObject();
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype._ff_c = "AuGdsFilterLineFdFilterTypeRetriever";

oFF.AuGdsFilterLineFdFilterTypeRetriever.create = function(dimension, filterLineConfig)
{
	var instance = new oFF.AuGdsFilterLineFdFilterTypeRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_filterLineConfig = oFF.XObjectExt.assertNotNull(filterLineConfig);
	return instance;
};
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype.m_dimension = null;
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype.releaseObject = function()
{
	this.m_dimension = null;
	this.m_filterLineConfig = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineFdFilterTypeRetriever.prototype.getFilterType = function()
{
	var result = oFF.FdFilterType.LIST;
	if (this.m_filterLineConfig.isDimensionConfigSet(this.m_dimension.getName()))
	{
		var filterType = this.m_filterLineConfig.getFilterTypeForDimension(this.m_dimension.getName());
		if (oFF.XString.isEqual(filterType, oFF.FdFilterType.LIST.getName()))
		{
			result = oFF.FdFilterType.LIST;
		}
		else if (oFF.XString.isEqual(filterType, oFF.FdFilterType.RANGE.getName()))
		{
			result = oFF.FdFilterType.RANGE;
		}
	}
	return result;
};

oFF.AuGdsDimensionMemberDetails = function() {};
