oFF.AuGdsIQFilterCartesianProductFiltered = function() {};
oFF.AuGdsIQFilterCartesianProductFiltered.prototype = new oFF.XObject();
oFF.AuGdsIQFilterCartesianProductFiltered.prototype._ff_c = "AuGdsIQFilterCartesianProductFiltered";

oFF.AuGdsIQFilterCartesianProductFiltered.create = function(cartesianProduct)
{
	var instance = new oFF.AuGdsIQFilterCartesianProductFiltered();
	oFF.XObjectExt.assertNotNull(cartesianProduct);
	instance.m_cartesianProductFiltered = oFF.AuGdsIQFilterCartesianProductFiltered.filter(cartesianProduct);
	return instance;
};
oFF.AuGdsIQFilterCartesianProductFiltered.filter = function(cartesianProduct)
{
	var result = oFF.XList.create();
	for (var i = 0; i < cartesianProduct.size(); i++)
	{
		var cartesianChild = cartesianProduct.getCartesianChild(i);
		if (!oFF.AuGdsIQFilterCartesianProductFiltered.isMeasureStructureFilter(cartesianChild) && !oFF.AuGdsIQFilterCartesianProductFiltered.hasNoDimensionMembers(cartesianChild))
		{
			result.add(cartesianChild);
		}
	}
	return result;
};
oFF.AuGdsIQFilterCartesianProductFiltered.isMeasureStructureFilter = function(cartesianChild)
{
	return cartesianChild.getDimension() !== null && cartesianChild.getDimension().isMeasureStructure();
};
oFF.AuGdsIQFilterCartesianProductFiltered.hasNoDimensionMembers = function(cartesianChild)
{
	return cartesianChild.size() === 0;
};
oFF.AuGdsIQFilterCartesianProductFiltered.prototype.m_cartesianProductFiltered = null;
oFF.AuGdsIQFilterCartesianProductFiltered.prototype.releaseObject = function()
{
	this.m_cartesianProductFiltered = oFF.XObjectExt.release(this.m_cartesianProductFiltered);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsIQFilterCartesianProductFiltered.prototype.getIterator = function()
{
	return oFF.XUniversalIterator.create(this.m_cartesianProductFiltered);
};

oFF.AuGdsFilterLineItem = function() {};
oFF.AuGdsFilterLineItem.prototype = new oFF.XObject();
oFF.AuGdsFilterLineItem.prototype._ff_c = "AuGdsFilterLineItem";

oFF.AuGdsFilterLineItem.FLI_TYPE_INVALID = -1;
oFF.AuGdsFilterLineItem.FLI_TYPE_DIMENSION = 0;
oFF.AuGdsFilterLineItem.FLI_TYPE_MEASURE = 1;
oFF.AuGdsFilterLineItem.create = function(dimension, measure, members, displayType, filterType)
{
	var instance = new oFF.AuGdsFilterLineItem();
	instance.setupInternal(dimension, measure, members, displayType, filterType);
	return instance;
};
oFF.AuGdsFilterLineItem.prototype.m_members = null;
oFF.AuGdsFilterLineItem.prototype.m_dimension = null;
oFF.AuGdsFilterLineItem.prototype.m_measure = null;
oFF.AuGdsFilterLineItem.prototype.m_displayType = null;
oFF.AuGdsFilterLineItem.prototype.m_filterType = null;
oFF.AuGdsFilterLineItem.prototype.m_fliType = 0;
oFF.AuGdsFilterLineItem.prototype.m_name = null;
oFF.AuGdsFilterLineItem.prototype.setupInternal = function(dimension, measure, members, displayType, filterType)
{
	if (oFF.isNull(dimension) && oFF.isNull(measure))
	{
		oFF.XException.createRuntimeException("a measure or a dimension must be present to create a filter line item");
	}
	this.m_dimension = dimension;
	this.m_measure = measure;
	this.m_fliType = oFF.AuGdsFilterLineItem.FLI_TYPE_INVALID;
	if (oFF.notNull(this.m_dimension))
	{
		this.m_fliType = oFF.AuGdsFilterLineItem.FLI_TYPE_DIMENSION;
	}
	else if (oFF.notNull(this.m_measure))
	{
		this.m_fliType = oFF.AuGdsFilterLineItem.FLI_TYPE_MEASURE;
	}
	if (this.isDimensionType())
	{
		this.m_displayType = oFF.XObjectExt.assertNotNull(displayType);
	}
	this.m_filterType = oFF.XObjectExt.assertNotNull(filterType);
	oFF.XObjectExt.assertNotNull(members);
	if (members.isEmpty())
	{
		oFF.XException.createIllegalArgumentException("filter line members must not be empty");
	}
	this.m_members = oFF.XList.create();
	this.m_members.addAll(members);
};
oFF.AuGdsFilterLineItem.prototype.releaseObject = function()
{
	this.m_members = oFF.XObjectExt.release(this.m_members);
	this.m_dimension = null;
	this.m_measure = null;
	this.m_displayType = null;
	this.m_filterType = null;
	this.m_name = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineItem.prototype.getMembers = function()
{
	return this.m_members.createListCopy();
};
oFF.AuGdsFilterLineItem.prototype.getDisplayType = function()
{
	return this.m_displayType;
};
oFF.AuGdsFilterLineItem.prototype.getFilterType = function()
{
	return this.m_filterType;
};
oFF.AuGdsFilterLineItem.prototype.isDimensionType = function()
{
	return this.m_fliType === oFF.AuGdsFilterLineItem.FLI_TYPE_DIMENSION;
};
oFF.AuGdsFilterLineItem.prototype.isMeasureType = function()
{
	return this.m_fliType === oFF.AuGdsFilterLineItem.FLI_TYPE_MEASURE;
};
oFF.AuGdsFilterLineItem.prototype.getName = function()
{
	if (oFF.isNull(this.m_name))
	{
		this.m_name = this.isDimensionType() ? this.m_dimension.getText() : this.m_measure.getText();
	}
	return this.m_name;
};
oFF.AuGdsFilterLineItem.prototype.getDimension = function()
{
	return this.m_dimension;
};
oFF.AuGdsFilterLineItem.prototype.getMeasure = function()
{
	return this.m_measure;
};
oFF.AuGdsFilterLineItem.prototype.getTitle = function()
{
	return oFF.XStringUtils.concatenate4(this.getName(), " (", oFF.XInteger.convertToString(this.m_members.size()), ")");
};
oFF.AuGdsFilterLineItem.prototype.getSubtitle = function()
{
	var result = "";
	for (var i = 0; i < this.m_members.size() - 1; i++)
	{
		result = oFF.XStringUtils.concatenate3(result, this.m_members.get(i).getDescription(this.m_displayType), ", ");
	}
	return oFF.XStringUtils.concatenate2(result, this.m_members.get(this.m_members.size() - 1).getDescription(this.m_displayType));
};
oFF.AuGdsFilterLineItem.prototype.getToolTip = function()
{
	return this.getSubtitle();
};
oFF.AuGdsFilterLineItem.prototype.isExcludeFilter = function()
{
	return oFF.XStream.of(this.m_members).anyMatch( function(m){
		return m.isExcludeFilter();
	}.bind(this));
};
oFF.AuGdsFilterLineItem.prototype.getMembersNeedingDescriptionRetrieval = function()
{
	if (this.isDimensionType() && this.getFilterType() === oFF.FdFilterType.RANGE)
	{
		return oFF.XList.create();
	}
	return oFF.XCollectionUtils.filter(this.getMembers(),  function(m){
		return m.needsDescriptionRetrieval();
	}.bind(this));
};

