oFF.AuGdsFilterLineItemUpdater.prototype.m_fli = null;
oFF.AuGdsFilterLineItemUpdater.prototype.releaseObject = function()
{
	this.m_fli = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineItemUpdater.prototype.updateDescriptions = function(memberDescriptions)
{
	var fliBuilder = oFF.AuGdsFilterLineItemBuilder.create();
	fliBuilder.setDimension(this.m_fli.getDimension());
	fliBuilder.setMeasure(this.m_fli.getMeasure());
	fliBuilder.setDisplayType(this.m_fli.getDisplayType());
	fliBuilder.setFilterType(this.m_fli.getFilterType());
	oFF.XCollectionUtils.forEach(this.m_fli.getMembers(),  function(currentMember){
		var lowKey = oFF.XStringValue.create(currentMember.getDimensionMemberDetailsLow().getKey());
		if (memberDescriptions.containsKey(lowKey))
		{
			var lowDetails = memberDescriptions.getByKey(lowKey);
			var highDetails = null;
			if (currentMember.getDimensionMemberDetailsHigh() !== null)
			{
				var highKey = oFF.XStringValue.create(currentMember.getDimensionMemberDetailsHigh().getKey());
				highDetails = memberDescriptions.containsKey(highKey) ? memberDescriptions.getByKey(highKey) : null;
			}
			var updatedMember = oFF.AuGdsFilterLineItemMember.create(currentMember.getSetSign(), currentMember.getComparisonOperator(), lowDetails, highDetails);
			fliBuilder.addMember(updatedMember);
		}
		else
		{
			fliBuilder.addMember(currentMember);
		}
	}.bind(this));
	return fliBuilder.build();
};

