oFF.AuGdsFilterLineItemUiElementBuilder.prototype.build = function()
{
	oFF.XObjectExt.assertNotNullExt(this.m_fli, "filter line item is null, this must be set");
	oFF.XObjectExt.assertNotNullExt(this.m_deletePressListener, "filter item delete button press listener is null, this must be set");
	this.m_gridListItem = this.m_genesis.newControl(oFF.UiType.GRID_LIST_ITEM);
	this.m_gridListItem.setHeight(oFF.UiCssLength.create("2.5rem"));
	this.m_gridListItem.addCssClass("ffGdsFilterToken");
	var container = this.m_genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	container.setWidth(oFF.UiCssLength.create("100%"));
	container.setHeight(oFF.UiCssLength.create("100%"));
	container.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	container.setJustifyContent(oFF.UiFlexJustifyContent.START);
	this.m_gridListItem.setContent(container);
	this.m_gridListItem.setCustomObject(this.m_fli);
	var textBox = container.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	textBox.setMargin(oFF.UiCssBoxEdges.create("0% 3% 0% 6%"));
	textBox.setDirection(oFF.UiFlexDirection.COLUMN);
	textBox.setWidth(oFF.UiCssLength.create("75%"));
	var titleLabel = textBox.addNewItemOfType(oFF.UiType.LABEL);
	titleLabel.setText(this.m_fli.getTitle());
	titleLabel.setTooltip(this.m_fli.getTitle());
	titleLabel.addCssClass("ffGdsFilterTokenTitle");
	titleLabel.setMargin(oFF.UiCssBoxEdges.create("0% 0% 0.125rem 0%"));
	var subtitleLabel = textBox.addNewItemOfType(oFF.UiType.LABEL);
	subtitleLabel.setText(this.m_fli.getSubtitle());
	subtitleLabel.setTooltip(this.m_fli.getToolTip());
	subtitleLabel.setFontSize(oFF.UiCssLength.create("0.7rem"));
	if (this.m_fli.isExcludeFilter())
	{
		var lineThrough = new oFF.UiCssTextDecoration();
		lineThrough.setLine(oFF.UiTextDecorationLine.LINE_THROUGH);
		subtitleLabel.setTextDecoration(lineThrough);
	}
	var buttonBox = container.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	buttonBox.setHeight(oFF.UiCssLength.create("100%"));
	buttonBox.setJustifyContent(oFF.UiFlexJustifyContent.END);
	buttonBox.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	this.m_deleteButton = buttonBox.addNewItemOfType(oFF.UiType.BUTTON);
	this.m_deleteButton.setButtonType(oFF.UiButtonType.TRANSPARENT);
	this.m_deleteButton.setIcon("decline");
	this.m_deleteButton.setTooltip(this.getLocalization().getText(oFF.AuGdsFilterLineI18n.DELETE_FILTER));
	this.m_deleteButton.setHeight(oFF.UiCssLength.create("100%"));
	this.m_deleteButton.setPadding(oFF.UiCssBoxEdges.create("0% 1.5% 0% 0%"));
	this.m_deleteButton.registerOnPress(this.m_deletePressListener);
	return oFF.AuGdsFilterLineItemUiElement.create(this.m_gridListItem, subtitleLabel);
};
