oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getEnablementForAxisMove = function(axisType)
{
	if (axisType === oFF.AxisType.FREE)
	{
		return  function(enFr){
			return (enFr.getAxisType() === oFF.AxisType.COLUMNS || enFr.getAxisType() === oFF.AxisType.ROWS) && enFr.supportsAxis(oFF.AxisType.FREE);
		}.bind(this);
	}
	else
	{
		return  function(enD){
			return enD.getAxisType() !== axisType && enD.supportsAxis(axisType);
		}.bind(this);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerMoveDimensionsToRows = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_MOVE_DIMENSION_TO_ROWS;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_MOVE_TO_ROWS_SHORT);
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "table-row";
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return oFF.XCollectionUtils.hasElements(oFF.AuGdsGenericContextResolveUtil.resolveDimensions(availableContext));
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enDims = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(enabledContext);
		return oFF.notNull(enDims) && oFF.XStream.of(enDims).anyMatch(this.getEnablementForAxisMove(oFF.AxisType.ROWS));
	}.bind(this));
	action.setTrigger( function(triggerContext){
		var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(triggerContext);
		var triggerDims = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(triggerContext);
		if (oFF.notNull(document) && oFF.notNull(queryModel) && oFF.XCollectionUtils.hasElements(triggerDims))
		{
			var cmd = queryModel.getConvenienceCommands();
			for (var i = 0; i < triggerDims.size(); i++)
			{
				var triggerDim = triggerDims.get(i);
				if (triggerDim.getAxisType() !== oFF.AxisType.ROWS && triggerDim.supportsAxis(oFF.AxisType.ROWS))
				{
					cmd.moveDimensionToAxis(triggerDim.getName(), oFF.AxisType.ROWS);
				}
			}
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_MOVE_DIMENSION_TO_ROWS, action);
};
