oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.moveDimensions = function(dimensionList, offset)
{
	var axis = dimensionList.get(0).getAxis();
	var dimension;
	var index = 0;
	var i;
	var cmd = axis.getConvenienceCommands();
	for (i = dimensionList.size() - 1; i >= 0; i--)
	{
		dimension = dimensionList.get(i);
		index = axis.getIndex(dimension);
		cmd.moveDimensionToFree(dimension.getName());
	}
	for (i = 0; i < dimensionList.size(); i++)
	{
		cmd.moveDimensionOnAxisTo(dimensionList.get(i).getName(), axis.getType(), index + offset + i);
	}
};
