oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerToggleFieldAction = function(registry, localizationProvider)
{
	var toggleResultSetField = oFF.CMEFactory.createToggleAction();
	toggleResultSetField.setNameProvider( function(nameContext){
		var nameField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(nameContext);
		var name = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_RESULT_SET_FIELD;
		if (oFF.notNull(nameField))
		{
			name = nameField.getName();
		}
		return name;
	}.bind(this));
	toggleResultSetField.setTextProvider( function(textContext){
		var textField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(textContext);
		var text = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_RESULT_SET_FIELD;
		if (oFF.notNull(textField))
		{
			text = textField.getText();
			if (oFF.XStringUtils.isNullOrEmpty(text))
			{
				text = textField.getName();
			}
		}
		return text;
	}.bind(this));
	toggleResultSetField.setProvider( function(providerContext){
		var providerField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(providerContext);
		var status = false;
		if (oFF.notNull(providerField))
		{
			var dimension = providerField.getDimension();
			status = dimension.getResultSetFields().contains(providerField);
		}
		return status;
	}.bind(this));
	toggleResultSetField.setConsumer( function(context, select){
		var consumerField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(context);
		var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(context);
		if (oFF.notNull(consumerField) && oFF.notNull(queryModel) && oFF.notNull(document))
		{
			var cDimension = consumerField.getDimension();
			var cmd = queryModel.getConvenienceCommands();
			if (select.getBoolean())
			{
				cmd.addField(cDimension.getDimensionType(), cDimension.getName(), consumerField.getPresentationType(), consumerField.getName(), oFF.QContextType.RESULT_SET);
			}
			else
			{
				cmd.removeField(cDimension.getDimensionType(), cDimension.getName(), consumerField.getPresentationType(), consumerField.getName(), oFF.QContextType.RESULT_SET);
			}
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_RESULT_SET_FIELD, toggleResultSetField);
};
