	action.setNameProvider( function(nameContext){
		var nameFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleFieldContainer(nameContext);
		return oFF.isNull(nameFieldContainer) || nameFieldContainer.getOlapComponentType().isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION) ? oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_PRESENTATION : oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_ATTRIBUTE_PRESENTATION;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.PRESENTATIONS);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleFieldContainer(availableContext) !== null;
	}.bind(this));
	var options = oFF.XList.create();
	options.add(noDisplay);
	options.add(key);
	options.add(text);
	options.add(keyAndText);
	options.add(textAndKey);
	action.setOptionsRetriever( function(retrieverContext){
		var retrieverOptions = oFF.XList.create();
		retrieverOptions.add(noDisplay);
		var retrieverFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleFieldContainer(retrieverContext);
		if (oFF.notNull(retrieverFieldContainer))
		{
			var retrieverPresentationHelper = this.getFieldContainerPresentationHelper(retrieverFieldContainer);
			var retrieverKeyViewsAvailable = oFF.XCollectionUtils.hasElements(retrieverPresentationHelper.getKeyViewsAvailable());
			var retrieverTextViewsAvailable = oFF.XCollectionUtils.hasElements(retrieverPresentationHelper.getTextViewsAvailable());
			if (retrieverKeyViewsAvailable)
			{
				retrieverOptions.add(key);
			}
			if (retrieverTextViewsAvailable)
			{
				retrieverOptions.add(text);
			}
			if (retrieverKeyViewsAvailable && retrieverTextViewsAvailable)
			{
				retrieverOptions.add(keyAndText);
				retrieverOptions.add(textAndKey);
			}
		}
		return retrieverOptions;
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var resultOption = noDisplay;
		var selectionFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleFieldContainer(selectionContext);
		if (oFF.notNull(selectionFieldContainer))
		{
			var selectionPresentationHelper = this.getFieldContainerPresentationHelper(selectionFieldContainer);
			var displayAs = selectionPresentationHelper.getDisplayAs();
			for (var i = 0; i < options.size(); i++)
			{
				var curOption = options.get(i);
				if (curOption.getCustomObject() === displayAs)
				{
					resultOption = curOption;
					break;
				}
			}
		}
		return resultOption;
	}.bind(this));
	action.setSelectionConsumer( function(selectContext, selectOption){
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(selectContext);
		var selectFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleFieldContainer(selectContext);
		var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(selectContext);
		if (oFF.notNull(selectFieldContainer) && oFF.notNull(document))
		{
			var selectPresentationHelper = this.getFieldContainerPresentationHelper(selectFieldContainer);
			selectPresentationHelper.setDisplayAs(selectOption.getCustomObject());
			var dimension = selectFieldContainer.getDimension();
			var dimensionName = dimension.getName();
			var fieldLayoutType = dimension.getFieldLayoutType();
			queryModel.getConvenienceCommands().clearAllAttributeFields(dimensionName, selectFieldContainer.getName(), oFF.QContextType.RESULT_SET);
			selectPresentationHelper.applyToQueryModel(queryModel, dimensionName);
			if (fieldLayoutType === oFF.FieldLayoutType.FIELD_BASED)
			{
				selectPresentationHelper.applyMainAttributeForFieldLayout(dimension);
			}
			document.updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_ATTRIBUTE_PRESENTATION, action);
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_PRESENTATION, action);
