oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerTotalsVisibilityToggle = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		var nameRsc = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureController(nameContext);
		var nameMcT = oFF.isNull(nameRsc) ? null : nameRsc.getOlapComponentType();
		if (oFF.notNull(nameMcT) && nameMcT.isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION))
		{
			return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_DIMENSION_TOTALS_VISIBILITY_TOGGLE;
		}
		else if (oFF.notNull(nameMcT) && nameMcT.isTypeOf(oFF.OlapComponentType.AXIS))
		{
			return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_AXIS_TOTALS_VISIBILITY_TOGGLE;
		}
		else
		{
			return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_QUERY_MODEL_TOTALS_VISIBILITY_TOGGLE;
		}
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.TOTALS);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var availabilityRsc = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureController(availableContext);
		return oFF.notNull(availabilityRsc) && availabilityRsc.getResultStructureController().supportsResultVisibility();
	}.bind(this));
	action.setProvider( function(providerContext){
		var checked = false;
		var providerRsc = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureController(providerContext);
		var providerMl = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureControllerModelLevel(providerContext);
		if (oFF.notNull(providerRsc))
		{
			var selectionVisibility = providerRsc.getConvenienceCommands().getUniqueResultVisibilityByElementAndAlignment(null, null, providerMl, providerRsc.getName());
			checked = selectionVisibility === oFF.ResultVisibility.ALWAYS || selectionVisibility === oFF.ResultVisibility.VISIBLE || selectionVisibility === oFF.ResultVisibility.CONDITIONAL;
		}
		return checked;
	}.bind(this));
	action.setConsumer( function(consumerContext, toggleValue){
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(consumerContext);
		var selectRsc = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureController(consumerContext);
		var selectMl = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureControllerModelLevel(consumerContext);
		if (oFF.notNull(selectRsc) && oFF.notNull(document))
		{
			selectRsc.getConvenienceCommands().setTotalsVisible(selectMl, selectRsc.getName(), toggleValue.getBoolean() ? oFF.ResultVisibility.VISIBLE : oFF.ResultVisibility.HIDDEN);
			document.updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_DIMENSION_TOTALS_VISIBILITY_TOGGLE, action);
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_AXIS_TOTALS_VISIBILITY_TOGGLE, action);
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.OLAP_QUERY_MODEL_TOTALS_VISIBILITY_TOGGLE, action);
};
