oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.doDimensionSort = function(queryModel, dimension, dimensionSortType, direction)
{
	var sortingManager = queryModel.getSortingManager();
	var cmd = queryModel.getConvenienceCommands();
	cmd.clearSort(oFF.SortType.ABSTRACT_DIMENSION_SORT, dimension.getName());
	var orthogonalAxisType = dimension.getAxisType().getOrthogonalAxisType();
	cmd.clearSort(oFF.SortType.MEASURE, null);
	if (oFF.notNull(orthogonalAxisType))
	{
		cmd.clearSort(oFF.SortType.COMPLEX, orthogonalAxisType.getName());
		cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, orthogonalAxisType.getName());
	}
	if (direction === oFF.XSortDirection.DEFAULT_VALUE)
	{
		if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.MEASURE_STRUCTURE) && queryModel.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
		{
			var dimensionSorting = sortingManager.getDimensionSorting(dimension, true);
			dimensionSorting.setSortByKey();
			dimensionSorting.setDirection(direction);
			dimensionSorting.setCustomSort(oFF.XStream.of(dimension.getStructureLayout()).collect(oFF.XStreamCollector.toListOfString( function(input){
				return input.getName();
			}.bind(this))));
		}
	}
	else
	{
		queryModel.getConvenienceCommands().sort(dimensionSortType, dimension.getDimensionType(), dimension.getName(), null, null, null, direction);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.supportsAnyDimensionSorting = function(queryModel, dimension)
{
	var caps = queryModel.getModelCapabilities();
	return caps.supportsDimensionSorting(dimension, oFF.SortType.ABSTRACT_DIMENSION_SORT) || caps.supportsDimensionSorting(dimension, oFF.SortType.MEMBER_TEXT) || caps.supportsDimensionSorting(dimension, oFF.SortType.MEMBER_KEY);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.canEmulateFieldSortByDimensionSort = function(queryModel, field)
{
	var dimension = field.getDimension();
	return field.getAttribute() === dimension.getMainAttribute() && queryModel.getModelCapabilities().supportsDimensionSorting(dimension, this.getDimensionSortTypeForPresentationType(field.getPresentationType()));
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getDimensionSortTypeForPresentationType = function(presentationType)
{
	return presentationType.isTypeOf(oFF.PresentationType.ABSTRACT_KEY) ? oFF.SortType.MEMBER_KEY : oFF.SortType.MEMBER_TEXT;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getSortPath = function(tuple)
{
	return oFF.XStream.of(tuple.getTupleElementAt(tuple.getElements().size() - 1).getDrillPath()).map( function(pathElement){
		return pathElement;
	}.bind(this)).collect(oFF.XStreamCollector.toList());
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getSortOptionBySortDirection = function(sortOptions, direction, defaultOption)
{
	return oFF.XStream.of(sortOptions).filter( function(i){
		return i.getCustomObject() === direction;
	}.bind(this)).findAny().orElse(defaultOption);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerZeroSuppressionAction = function(registry, localizationProvider)
{
	var allCellsAreNull = oFF.CMEFactory.createSelectionOption();
	allCellsAreNull.setNameProvider( function(acanName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_NULL;
	}.bind(this));
	allCellsAreNull.setCustomObject(oFF.ZeroSuppressionType.ALL_CELLS_ARE_NULL);
	allCellsAreNull.setTextProvider( function(acanText){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_ALL_CELLS_ARE_NULL);
	}.bind(this));
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_NULL, allCellsAreNull);
	var allCellsAreZero = oFF.CMEFactory.createSelectionOption();
	allCellsAreZero.setNameProvider( function(acazName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_ZERO;
	}.bind(this));
	allCellsAreZero.setCustomObject(oFF.ZeroSuppressionType.ALL_CELLS_ARE_ZERO);
	allCellsAreZero.setTextProvider( function(acazText){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_ALL_CELLS_ARE_ZERO);
	}.bind(this));
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_ZERO, allCellsAreZero);
	var totalIsZero = oFF.CMEFactory.createSelectionOption();
	totalIsZero.setNameProvider( function(tizName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOTALS_ARE_ZERO;
	}.bind(this));
	totalIsZero.setCustomObject(oFF.ZeroSuppressionType.TOTAL_IS_ZERO);
	totalIsZero.setTextProvider( function(tizText){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_TOTAL_IS_ZERO);
	}.bind(this));
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOTALS_ARE_ZERO, totalIsZero);
	var none = oFF.CMEFactory.createSelectionOption();
	none.setNameProvider( function(nonName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_NONE;
	}.bind(this));
	none.setCustomObject(oFF.ZeroSuppressionType.NONE);
	none.setTextProvider( function(nonText){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_NONE);
	}.bind(this));
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_NONE, totalIsZero);
	var action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var axis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(axis) && axis.supportsZeroSuppression();
	}.bind(this));
	var optionMapper =  function(zst){
		if (zst === oFF.ZeroSuppressionType.NONE)
		{
			return none;
		}
		else if (zst === oFF.ZeroSuppressionType.ALL_CELLS_ARE_ZERO)
		{
			return allCellsAreZero;
		}
		else if (zst === oFF.ZeroSuppressionType.ALL_CELLS_ARE_NULL)
		{
			return allCellsAreNull;
		}
		else if (zst === oFF.ZeroSuppressionType.TOTAL_IS_ZERO)
		{
			return totalIsZero;
		}
		else
		{
			return null;
		}
	}.bind(this);
	action.setOptionsRetriever( function(retrieverContext){
		var rAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(retrieverContext);
		return oFF.isNull(rAxis) ? null : oFF.XStream.of(rAxis.getAvailableZeroSuppressionTypes()).map(optionMapper).collect(oFF.XStreamCollector.toList());
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var sAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		var option = null;
		if (oFF.notNull(sAxis))
		{
			option = optionMapper(sAxis.getZeroSuppressionType());
		}
		return option;
	}.bind(this));
	action.setSelectionConsumer( function(selectContext, selectOption){
		var cAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(selectContext);
		if (oFF.notNull(cAxis))
		{
			cAxis.getConvenienceCommands().setAxisZeroSuppressionType(cAxis.getType(), selectOption.getCustomObject());
			document.updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerSuppressZeroToggle = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOGGLE;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var axis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(axis) && axis.supportsZeroSuppression();
	}.bind(this));
	action.setProvider( function(providerContext){
		var providerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(providerContext);
		return oFF.notNull(providerAxis) && providerAxis.supportsZeroSuppression() && providerAxis.getZeroSuppressionType() !== oFF.ZeroSuppressionType.NONE;
	}.bind(this));
	action.setConsumer( function(consumerContext, toggleValue){
		var consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(document))
		{
			consumerAxis.getConvenienceCommands().setAxisZeroSuppressionType(consumerAxis.getType(), consumerAxis.getZeroSuppressionType() === oFF.ZeroSuppressionType.NONE ? oFF.ZeroSuppressionType.ALL_CELLS_ARE_ZERO : oFF.ZeroSuppressionType.NONE);
			document.updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOGGLE, action);
};
