oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerActivateUniversalDisplayHierarchy = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_UDH;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.AXIS_DISPLAY_HIERARCHICALLY);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var availableAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(availableAxis) && availableAxis.getModelCapabilities().supportsUniversalDisplayHierarchies();
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enabledAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(enabledContext);
		return oFF.XCollectionUtils.hasElements(enabledAxis);
	}.bind(this));
	action.setProvider( function(providerContext){
		var providerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(providerContext);
		var pUdh = oFF.isNull(providerAxis) ? null : providerAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(providerAxis.getType());
		return oFF.notNull(pUdh) && pUdh.isActive();
	}.bind(this));
	action.setConsumer( function(consumerContext, toggleValue){
		var consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(document))
		{
			var cUdh = document.getQueryManager().getQueryModel().getUniversalDisplayHierarchies().getByAxisType(consumerAxis.getType());
			var consumerDrillLevel = oFF.notNull(cUdh) && consumerAxis.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? cUdh.getInitialDrillLevel() : 1;
			document.getQueryManager().getConvenienceCommands().setUniversalDisplayHierarchy(consumerAxis.getDimensionNames().createListOfStringCopy(), consumerDrillLevel, toggleValue.getBoolean());
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_UDH, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerBottomUpAxis = function(registry, localizationProvider)
{
	var parentsAbove = oFF.CMEFactory.createSelectionOption();
	parentsAbove.setNameProvider( function(aboveName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_ABOVE;
	}.bind(this));
	parentsAbove.setTextProvider( function(aboveText){
		var aboveAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(aboveText);
		if (oFF.notNull(aboveAxis) && aboveAxis.getType() === oFF.AxisType.COLUMNS)
		{
			return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_LEFT);
		}
		else
		{
			return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ABOVE);
		}
	}.bind(this));
	parentsAbove.setCustomObject(oFF.Alignment.CHILDREN_BELOW_PARENT);
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_ABOVE, parentsAbove);
	var parentsBelow = oFF.CMEFactory.createSelectionOption();
	parentsBelow.setNameProvider( function(belowName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_BELOW;
	}.bind(this));
	parentsBelow.setTextProvider( function(belowText){
		var belowAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(belowText);
		if (oFF.notNull(belowAxis) && belowAxis.getType() === oFF.AxisType.COLUMNS)
		{
			return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_RIGHT);
		}
		else
		{
			return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_BELOW);
		}
	}.bind(this));
	parentsBelow.setCustomObject(oFF.Alignment.CHILDREN_ABOVE_PARENT);
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_BELOW, parentsBelow);
	var dimenisonDefault = oFF.CMEFactory.createSelectionOption();
	dimenisonDefault.setNameProvider( function(defaultName){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_DEFAULT;
	}.bind(this));
	dimenisonDefault.setTextProvider( function(defaultText){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_DIMENSION_DEFAULT);
	}.bind(this));
	dimenisonDefault.setCustomObject(oFF.Alignment.DEFAULT_VALUE);
	registry.registerOption(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_DEFAULT, dimenisonDefault);
	var options = oFF.XList.create();
	options.add(parentsAbove);
	options.add(parentsBelow);
	options.add(dimenisonDefault);
	var action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ARRANGE);
	}.bind(this));
	action.setExplanationProvider( function(explanationContext){
		var explanationAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(explanationContext);
		var explanation = null;
		if (!this.supportsNodeAlignmentOnAxis(explanationAxis))
		{
			explanation = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_AXIS_NO_CHANGE_OF_NODE_ALIGNMENT_POSSIBLE);
		}
		return explanation;
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var availableAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		var support = false;
		if (oFF.notNull(availableAxis))
		{
			var modelCapabilitiesAv = availableAxis.getModelCapabilities();
			support = modelCapabilitiesAv.supportsExpandBottomUp() && (!modelCapabilitiesAv.supportsUniversalDisplayHierarchies() || availableAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(availableAxis.getType()) === null || !availableAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(availableAxis.getType()).isActive());
		}
		return support;
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		return this.supportsNodeAlignmentOnAxis(oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(enabledContext));
	}.bind(this));
	action.setOptionsRetriever( function(optionsContext){
		return options;
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var selectionAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		var selectedOption = dimenisonDefault;
		if (oFF.notNull(selectionAxis))
		{
			var selectedAlignment = selectionAxis.getEffectiveLowerLevelNodeAlignment();
			if (selectedAlignment === oFF.Alignment.CHILDREN_ABOVE_PARENT)
			{
				selectedOption = parentsBelow;
			}
			else if (selectedAlignment === oFF.Alignment.CHILDREN_BELOW_PARENT)
			{
				selectedOption = parentsAbove;
			}
		}
		return selectedOption;
	}.bind(this));
	action.setSelectionConsumer( function(consumerContext, selectionOption){
		var consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(document))
		{
			consumerAxis.setLowerLevelNodeAlignment(selectionOption.getCustomObject());
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.supportsNodeAlignmentOnAxis = function(axis)
{
	var caps = oFF.isNull(axis) ? null : axis.getModelCapabilities();
	return oFF.notNull(caps) && caps.supportsExpandBottomUp() && axis.getEffectiveLowerLevelNodeAlignment() !== oFF.Alignment.INHERIT_FROM_FIRST_DIMENSION_ON_AXIS && (!caps.supportsUniversalDisplayHierarchies() || axis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(axis.getType()) === null || !axis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(axis.getType()).isActive()) && oFF.XStream.of(axis).anyMatch( function(enDim){
		return enDim.isHierarchyActive();
	}.bind(this));
};
