oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerDimensionHierarchyLevelAction = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_INITIAL_DISPLAY_LEVEL);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var avDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(availableContext);
		return oFF.notNull(avDim) && avDim.supportsHierarchy();
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(enabledContext);
		return oFF.notNull(enDim) && enDim.supportsHierarchy() && enDim.isHierarchyActive() && oFF.XStringUtils.isNotNullAndNotEmpty(enDim.getHierarchyName());
	}.bind(this));
	action.setOptionsRetriever( function(retrieverContext){
		var reDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(retrieverContext);
		var maximumDrillLevel = 6;
		var options = oFF.XList.create();
		if (oFF.notNull(reDim))
		{
			var hierarchy = reDim.getLeveledHierarchy(reDim.getHierarchyName());
			if (oFF.notNull(hierarchy) && hierarchy.getHierarchyLevels().size() > 0)
			{
				maximumDrillLevel = oFF.XMath.min(hierarchy.getHierarchyLevels().size(), 30);
			}
			else if (reDim.getMaxDrillLevel() > -1)
			{
				maximumDrillLevel = reDim.getMaxDrillLevel() + 1;
			}
			for (var i = -2; i < maximumDrillLevel; i++)
			{
				var option = registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(i)));
				if (oFF.notNull(option))
				{
					options.add(option);
				}
			}
		}
		return options;
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var sDrillLevel = -1;
		var sDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(selectionContext);
		if (oFF.notNull(sDimension))
		{
			sDrillLevel = sDimension.getInitialDrillLevel() - (sDimension.isInitialDrillLevelZeroBased() ? 0 : 1);
		}
		return registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(sDrillLevel)));
	}.bind(this));
	action.setSelectionConsumer( function(selectContext, selectOption){
		var seDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(selectContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(selectContext);
		if (oFF.notNull(seDim) && oFF.notNull(document))
		{
			document.getQueryManager().getConvenienceCommands().setDimensionHierarchy(seDim.getName(), seDim.getHierarchyName(), true, oFF.XInteger.convertFromString(selectOption.getName(selectContext)) + (seDim.isInitialDrillLevelZeroBased() ? 0 : 1));
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerUdhDrillDimension = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION;
	}.bind(this));
	action.setTextProvider( function(textContext){
		var iterationDimensionText = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(textContext);
		return oFF.isNull(iterationDimensionText) ? null : iterationDimensionText.getText();
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var iterationDimensionAvailable = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(availableContext);
		var axisAv = oFF.isNull(iterationDimensionAvailable) ? null : iterationDimensionAvailable.getAxis();
		var queryModelAv = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(availableContext);
		var udhAv = oFF.isNull(queryModelAv) || !oFF.XCollectionUtils.hasElements(axisAv) ? null : !queryModelAv.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelAv.getUniversalDisplayHierarchies().getByAxisType(axisAv.getType());
		return oFF.notNull(udhAv) && udhAv.isActive();
	}.bind(this));
	action.setConsumer( function(triggerContext, bv){
		var iterationDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(triggerContext);
		var axisTrigger = oFF.isNull(iterationDimension) ? null : iterationDimension.getAxis();
		var queryModelTrigger = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
		var indexOffsetTrigger = oFF.notNull(queryModelTrigger) && queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		var udhTrigger = oFF.isNull(queryModelTrigger) || !oFF.XCollectionUtils.hasElements(axisTrigger) ? null : !queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelTrigger.getUniversalDisplayHierarchies().getByAxisType(axisTrigger.getType());
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(triggerContext);
		if (oFF.notNull(udhTrigger) && oFF.notNull(document) && oFF.notNull(iterationDimension))
		{
			var levelTrigger = udhTrigger.getDimensionNames().getIndex(iterationDimension.getName());
			udhTrigger.setInitialDrillLevel(levelTrigger + indexOffsetTrigger);
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	action.setProvider( function(providerContext){
		var iterationDimensionProvider = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(providerContext);
		var axisProvider = oFF.isNull(iterationDimensionProvider) ? null : iterationDimensionProvider.getAxis();
		var queryModelProvider = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(providerContext);
		var indexOffsetProvider = oFF.notNull(queryModelProvider) && queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		var udhProvider = oFF.isNull(queryModelProvider) || !oFF.XCollectionUtils.hasElements(axisProvider) ? null : !queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelProvider.getUniversalDisplayHierarchies().getByAxisType(axisProvider.getType());
		var result = false;
		if (oFF.notNull(udhProvider) && oFF.notNull(iterationDimensionProvider))
		{
			var levelProvider = udhProvider.getDimensionNames().getIndex(iterationDimensionProvider.getName());
			result = levelProvider + indexOffsetProvider === udhProvider.getInitialDrillLevel();
		}
		return result;
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerUdhLevelAction = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_LEVEL;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_INITIAL_DISPLAY_LEVEL);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var availableAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(availableAxis) && availableAxis.getModelCapabilities().supportsUniversalDisplayHierarchies();
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enabledAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(enabledContext);
		var enabled = false;
		if (oFF.notNull(enabledAxis))
		{
			var eUdh = enabledAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(enabledAxis.getType());
			enabled = oFF.notNull(eUdh) && eUdh.isActive();
		}
		return enabled;
	}.bind(this));
	action.setOptionsRetriever( function(retrieverContext){
		var options = oFF.XList.create();
		var optionsAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(retrieverContext);
		if (oFF.notNull(optionsAxis))
		{
			var oUdh = optionsAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(optionsAxis.getType());
			if (oFF.notNull(oUdh) && oUdh.isActive())
			{
				var maxLevel = oFF.XMath.min(oUdh.getDimensionNames().size(), 30);
				for (var i = -2; i < maxLevel; i++)
				{
					options.add(registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(i))));
				}
			}
		}
		return options;
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var selectionAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		var option = null;
		if (oFF.notNull(selectionAxis))
		{
			var sUdh = selectionAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(selectionAxis.getType());
			if (oFF.notNull(sUdh) && sUdh.isActive())
			{
				option = registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(sUdh.getInitialDrillLevel())));
			}
		}
		return option;
	}.bind(this));
	action.setSelectionConsumer( function(consumerContext, selectOption){
		var consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(document))
		{
			document.getQueryManager().getConvenienceCommands().setUniversalDisplayHierarchy(consumerAxis.getDimensionNames().createListOfStringCopy(), oFF.XInteger.convertFromString(selectOption.getName(consumerContext)), true);
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_LEVEL, action);
};
