oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerClearTupleFilter = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_CLEAR_TUPLE_FILTER;
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "clear-filter";
	}.bind(this));
	action.setTextProvider( function(textContext){
		var textExpression = oFF.AuGdsGenericContextResolveUtil.resolveTupleFilter(textContext);
		var returnText = null;
		if (oFF.notNull(textExpression))
		{
			var textSetSign = oFF.TupleFilterApplicationUtil.getSetSignForTupleFilterExpression(textExpression, false);
			var tupleDimenisons = oFF.TupleFilterApplicationUtil.getDimensionsForTupleFilterExpression(textExpression, false);
			var textPrefix = textSetSign === oFF.SetSign.EXCLUDING ? "! " : "";
			if (oFF.XCollectionUtils.hasElements(tupleDimenisons))
			{
				returnText = oFF.XStringUtils.concatenate2(textPrefix, oFF.XCollectionUtils.join(oFF.XStream.of(tupleDimenisons).collect(oFF.XStreamCollector.toListOfString( function(td){
					return td.getText();
				}.bind(this))), ", "));
			}
		}
		return returnText;
	}.bind(this));
	action.setTrigger( function(actionContext){
		var triggerQueryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(actionContext);
		var triggerExpression = oFF.AuGdsGenericContextResolveUtil.resolveTupleFilter(actionContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(actionContext);
		if (oFF.notNull(triggerExpression) && oFF.notNull(triggerQueryModel) && oFF.notNull(document))
		{
			var triggerSetSign = oFF.TupleFilterApplicationUtil.getSetSignForTupleFilterExpression(triggerExpression, false);
			var triggerDimensions = oFF.TupleFilterApplicationUtil.getDimensionsForTupleFilterExpression(triggerExpression, false);
			oFF.TupleFilterApplicationUtil.clearTupleFilter(triggerQueryModel, triggerDimensions, triggerSetSign, false);
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_CLEAR_TUPLE_FILTER, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerToggleCondition = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_CONDITION;
	}.bind(this));
	action.setTextProvider( function(textContext){
		var tCondition = oFF.AuGdsGenericContextResolveUtil.resolveCondition(textContext);
		var conditionText = null;
		if (oFF.notNull(tCondition))
		{
			conditionText = tCondition.getText();
			if (oFF.isNull(conditionText))
			{
				conditionText = tCondition.getDescription();
			}
			if (oFF.isNull(conditionText))
			{
				conditionText = tCondition.getName();
			}
			if (!tCondition.isApplicable())
			{
				conditionText = oFF.XStringUtils.concatenate3(conditionText, " ", localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.MSG_CONDITION_NOT_APPLICABLE_SUFFIX));
			}
		}
		return conditionText;
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return oFF.AuGdsGenericContextResolveUtil.resolveCondition(availableContext) !== null;
	}.bind(this));
	action.setProvider( function(providerContext){
		var providerCondition = oFF.AuGdsGenericContextResolveUtil.resolveCondition(providerContext);
		return oFF.notNull(providerCondition) && providerCondition.isActive();
	}.bind(this));
	action.setConsumer( function(toggleContext, active){
		var toggleCondition = oFF.AuGdsGenericContextResolveUtil.resolveCondition(toggleContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(toggleContext);
		if (oFF.notNull(toggleCondition) && oFF.notNull(document))
		{
			toggleCondition.getConvenienceCommands().setConditionActive(toggleCondition.getName(), active.getBoolean());
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_CONDITION, action);
};
