oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerDimensionDialogAction = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_DIALOG;
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(availableContext) !== null;
	}.bind(this));
	action.setTextProvider( function(textContext){
		var textDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(textContext);
		var text = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION);
		if (oFF.notNull(textDimension))
		{
			var textDimensionType = textDimension.getDimensionType();
			if (textDimensionType === oFF.DimensionType.ACCOUNT)
			{
				text = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_ACCOUNT);
			}
			else if (textDimensionType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				text = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_MEASURE_STRUCTURE);
			}
			else if (textDimensionType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				text = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_CALCULATED);
			}
			else if (textDimensionType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				text = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_SECONDARY_STRUCTURE);
			}
		}
		return oFF.XStringUtils.concatenate2(text, " ...");
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(enabledContext) !== null && oFF.AuGdsGenericContextResolveUtil.resolveDocument(enabledContext) !== null;
	}.bind(this));
	action.setTrigger( function(actionContext){
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(actionContext);
		var actionDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(actionContext);
		var wasHierarchyActive = oFF.notNull(actionDimension) && actionDimension.isHierarchyActive();
		if (oFF.notNull(actionDimension) && oFF.notNull(actionContext))
		{
			oFF.AuGdsQbDialogHelper.openDimensionDialog(document.getProcess(), actionDimension.getQueryManager(), actionDimension.getName(),  function(){
				if (actionDimension.isHierarchyActive() !== wasHierarchyActive)
				{
					oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(actionDimension);
				}
				document.getQueryController().updateQueryResultSet();
			}.bind(this));
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_DIALOG, action);
};
