oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerClearFilter = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_CLEAR_FILTER;
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "clear-filter";
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.FILTER_CLEAR);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(availableContext) !== null;
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enableDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(enabledContext);
		var enableQueryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(enabledContext);
		var cartesianProduct = oFF.isNull(enableQueryModel) || oFF.isNull(enableDimension) ? null : enableQueryModel.getFilter().getDynamicFilter().getCartesianProduct();
		return oFF.notNull(cartesianProduct) && oFF.XCollectionUtils.hasElements(cartesianProduct.getCartesianList(enableDimension)) && oFF.AuGdsGenericContextResolveUtil.resolveDocument(enabledContext) !== null;
	}.bind(this));
	action.setTrigger( function(actionContext){
		var actionDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(actionContext);
		var actionQueryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(actionContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(actionContext);
		if (oFF.notNull(actionDimension) && oFF.notNull(actionQueryModel) && oFF.notNull(document))
		{
			actionQueryModel.getFilter().getDynamicFilter().getCartesianProductWithDefault().removeByDimensionName(actionDimension.getName());
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_CLEAR_FILTER, action);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.createHierarchyDialogSimple = function(document, dimension)
{
	var selectHierarchyDlg = oFF.ProgramRunner.createRunner(document.getProcess(), oFF.OuSelectHierarchyDialog.DEFAULT_PROGRAM_NAME);
	var tmpArgs = selectHierarchyDlg.getCurrentStartConfig().getArguments();
	var wasHierarchyActive = dimension.isHierarchyActive();
	tmpArgs.putXObject(oFF.DfOuDialogProgram.PARAM_QUERY_MANAGER, dimension.getQueryModel().getQueryManager());
	tmpArgs.putXObject(oFF.DfOuDialogProgram.PARAM_OK_PROCEDURE, oFF.XProcedureHolder.create( function(){
		if (dimension.isHierarchyActive() !== wasHierarchyActive)
		{
			oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
		}
		document.updateQueryResultSet();
	}.bind(this)));
	tmpArgs.putXObject(oFF.OuSelectHierarchyDialog.PARAM_DIMENSION, dimension);
	selectHierarchyDlg.runProgram();
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.createHierarchyCatalogDialog = function(document, dimension)
{
	var entryPoint = oFF.FdEntryPoint.createEntryPoint(document.getApplication(), "Select Hierarchy");
	entryPoint.openWithDimensionHierarchies(dimension, oFF.AuGdsLambdaFdCloseListener.create( function(item){
		var newValue = oFF.XCollectionUtils.hasElements(item) ? item.get(0).getName() : null;
		var wasHierarchyActive = dimension.isHierarchyActive();
		document.getQueryManager().getConvenienceCommands().setDimensionHierarchy(dimension.getName(), newValue, true, dimension.getInitialDrillLevel());
		if (!wasHierarchyActive)
		{
			oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
		}
		document.getQueryController().updateQueryResultSet();
	}.bind(this), null));
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.removeDimensionFromAxis = function(cmd, dimension)
{
	if ((dimension.getAxisType() === oFF.AxisType.ROWS || dimension.getAxisType() === oFF.AxisType.COLUMNS) && dimension.supportsAxis(oFF.AxisType.FREE))
	{
		oFF.FieldContainerPresentationHelper.removeDisplayAttributesFromDimension(dimension);
		cmd.moveDimensionToAxis(dimension.getName(), oFF.AxisType.FREE);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.hasFilterableTuple = function(context, dimensions, enforceRealTuple)
{
	var result = false;
	var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	if (oFF.notNull(queryModel))
	{
		var modelCapabilities = queryModel.getModelCapabilities();
		var excludeStructureMembers = !modelCapabilities.supportsComplexFilter();
		var tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(context);
		result = oFF.TupleFilterApplicationUtil.hasRelevantTuples(tuples, dimensions, excludeStructureMembers, enforceRealTuple);
	}
	return result;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.addTupleFilter = function(context, dimensions, setSign)
{
	var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	if (oFF.notNull(queryModel))
	{
		var excludeStructureMembers = true;
		var tableView = oFF.AuGdsGenericContextResolveUtil.resolveTableView(context);
		var tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(context);
		if (oFF.notNull(tableView) && oFF.XCollectionUtils.hasElements(tuples))
		{
			oFF.TupleFilterApplicationUtil.setTupleFilter(queryModel, tuples, dimensions, setSign, true, excludeStructureMembers, false);
			tableView.updateQueryResultSet();
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.exchangeDimensionsBy = function(tDimensions, freeDimension)
{
	var cmd = freeDimension.getConvenienceCommands();
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		axis = dimension.getAxis();
		inserter = dimension.getIndexOnAxis();
		this.removeDimensionFromAxis(cmd, dimension);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.appendDimensionsAfter = function(tDimensions, freeDimension)
{
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		if (oFF.isNull(axis))
		{
			axis = dimension.getAxis();
		}
		else if (axis !== dimension.getAxis())
		{
			axis = null;
			break;
		}
		inserter = oFF.XMath.max(dimension.getIndexOnAxis(), inserter);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter + 1);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.prependDimensionsBefore = function(tDimensions, freeDimension)
{
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		if (oFF.isNull(axis))
		{
			axis = dimension.getAxis();
			inserter = axis.size();
		}
		else if (axis !== dimension.getAxis())
		{
			axis = null;
			break;
		}
		inserter = oFF.XMath.min(dimension.getIndexOnAxis(), inserter);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.tryMoveDimensionOnAxisTo = function(freeDimension, axis, inserter)
{
	var cmd = freeDimension.getConvenienceCommands();
	if (oFF.notNull(axis))
	{
		var axisType = axis.getType();
		if (axisType === oFF.AxisType.ROWS || axisType === oFF.AxisType.COLUMNS)
		{
			cmd.moveDimensionOnAxisTo(freeDimension.getName(), axisType, inserter);
		}
	}
};

