oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.registerDocumentChangeDataSource = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderBasicActionsRegistrator.DOCUMENT_CHANGE_DATASOURCE;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DOCUMENT_LOAD_DATASOURCE);
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "connected";
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return true;
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		return this.isDocumentAvailable(enabledContext);
	}.bind(this));
	action.setTrigger( function(triggerContext){
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(triggerContext);
		var queryManager = document.getQueryManager();
		var queryModel = oFF.isNull(queryManager) ? null : queryManager.getQueryModel();
		if (oFF.notNull(queryModel) && oFF.XStringUtils.isNotNullAndNotEmpty(queryModel.getDatasetId()))
		{
			document.presentModelPicker();
		}
		else
		{
			document.presentNewDataSourcePicker();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderBasicActionsRegistrator.DOCUMENT_CHANGE_DATASOURCE, action);
};
