oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.applyPanelPresentationType = function(consumerContext, selectionOption)
{
	var panelWithPresentation = oFF.AuGdsGenericContextResolveUtil.resolvePanelWithPresentation(consumerContext);
	if (oFF.notNull(panelWithPresentation))
	{
		panelWithPresentation.setPresentationType(selectionOption.getCustomObject());
	}
};
oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.getActivePanelPresentationType = function(registry, selectionContext)
{
	var panelWithPresentation = oFF.AuGdsGenericContextResolveUtil.resolvePanelWithPresentation(selectionContext);
	var option = registry.getOption(oFF.AuGdsQueryBuilderBasicActionsRegistrator.PANEL_PRESENTATION_DESCRIPTION);
	if (oFF.notNull(panelWithPresentation))
	{
		var presentationType = panelWithPresentation.getPresentationType();
		if (presentationType === oFF.AuGdsQbPresentation.ID)
		{
			option = registry.getOption(oFF.AuGdsQueryBuilderBasicActionsRegistrator.PANEL_PRESENTATION_ID);
		}
		else if (presentationType === oFF.AuGdsQbPresentation.DESCRIPTION)
		{
			option = registry.getOption(oFF.AuGdsQueryBuilderBasicActionsRegistrator.PANEL_PRESENTATION_DESCRIPTION);
		}
		else if (presentationType === oFF.AuGdsQbPresentation.ID_AND_DESCRIPTION)
		{
			option = registry.getOption(oFF.AuGdsQueryBuilderBasicActionsRegistrator.PANEL_PRESENTATION_ID_AND_DESCRIPTION);
		}
		else if (presentationType === oFF.AuGdsQbPresentation.DESCRIPTION_AND_ID)
		{
			option = registry.getOption(oFF.AuGdsQueryBuilderBasicActionsRegistrator.PANEL_PRESENTATION_DESCRIPTION_AND_ID);
		}
	}
	return option;
};
