oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.registerHideTuple = function(registry, localizationProvider)
{
	var hideTUple = oFF.CMEFactory.createTriggerAction();
	hideTUple.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderDevActionsRegistrator.ACTION_HIDE_TUPLE;
	}.bind(this));
	hideTUple.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.HIDE);
	}.bind(this));
	hideTUple.setAvailableProvider( function(availableContext){
		return oFF.XCollectionUtils.hasElements(oFF.AuGdsGenericContextResolveUtil.resolveDimensions(availableContext)) && oFF.AuGdsGenericContextResolveUtil.resolveSingleTuple(availableContext) !== null;
	}.bind(this));
	hideTUple.setTrigger( function(context){
		this.hideCells(context);
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderDevActionsRegistrator.ACTION_HIDE_TUPLE, hideTUple);
};
