oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.registerToggleExceptionSymbols = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderDevActionsRegistrator.FORMAT_EXCEPTIONS_SYMBOLS;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return "Exception Symobls";
	}.bind(this));
	action.setProvider( function(providerContext){
		var prTd = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(providerContext);
		return oFF.notNull(prTd) && prTd.hasDataPointStyleByName(oFF.AuGdsQueryBuilderDevActionsRegistrator.FORMATTING_STYLE_NAME_EXCEPTIONS_SYMBOL_NORMAL);
	}.bind(this));
	action.setConsumer( function(toggleContext, active){
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(toggleContext);
		var tgTd = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(toggleContext);
		if (oFF.notNull(tgTd) && oFF.notNull(document))
		{
			if (active.getBoolean())
			{
				this.activateExceptionSymbols(tgTd);
			}
			else
			{
				this.clearExceptionSymbols(tgTd);
			}
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderDevActionsRegistrator.FORMAT_EXCEPTIONS_SYMBOLS, action);
};
