oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.getExceptionSymbol = function(tableDefinition, styleName, alertSymbol, alertColor)
{
	var result = tableDefinition.getFormattingStyle(styleName);
	if (oFF.isNull(result))
	{
		result = tableDefinition.addNewFormattingStyle(styleName, null);
		result.setAlertSymbol(alertSymbol);
		result.setAlertColor(alertColor);
	}
	return result;
};
