oFF.AuGdsStandardToolbarItemFactory.prototype._ff_c = "AuGdsStandardToolbarItemFactory";

oFF.AuGdsStandardToolbarItemFactory.create = function()
{
	var instance = new oFF.AuGdsStandardToolbarItemFactory();
	return instance;
};
oFF.AuGdsStandardToolbarItemFactory.prototype.hasItemElements = function(topLevelItem)
{
	return oFF.XCollectionUtils.hasElements(topLevelItem.getItems());
};
oFF.AuGdsStandardToolbarItemFactory.prototype.getItemCount = function(menuItem)
{
	return menuItem.getItemCount();
};
oFF.AuGdsStandardToolbarItemFactory.prototype.createGroupItem = function(topLevelItem, isSectionStart, overflowPriority, name, text, icon, enabled, explanation, highlight, unhighlight)
{
	if (isSectionStart)
	{
		topLevelItem.addNewItemOfType(oFF.UiType.SEPARATOR);
	}
	var menuItem = topLevelItem.addNewItemOfType(oFF.UiType.BUTTON);
	menuItem.setName(name);
	menuItem.setTooltip(oFF.AuGdsToolbarMappingUtils.getToolbarItemTooltipText(text, explanation));
	menuItem.setText(oFF.AuGdsToolbarMappingUtils.getEffectiveToolbarItemText(icon, text));
	menuItem.setIcon(icon);
	menuItem.setEnabled(enabled);
	var menuToPopulate = menuItem.getUiManager().getGenesis().newControl(oFF.UiType.MENU);
	menuItem.registerOnPress(this.createSubMenuRenderListener(menuToPopulate));
	return menuToPopulate;
};
oFF.AuGdsStandardToolbarItemFactory.prototype.createTriggerItem = function(topLevelItem, isSectionStart, overflowPriority, name, text, icon, enabled, explanation, highlight, unhighlight, procedure)
{
	if (isSectionStart)
	{
		topLevelItem.addNewItemOfType(oFF.UiType.SEPARATOR);
	}
	var menuItem = topLevelItem.addNewItemOfType(oFF.UiType.BUTTON);
	menuItem.setName(name);
	menuItem.setTooltip(oFF.AuGdsToolbarMappingUtils.getToolbarItemTooltipText(text, explanation));
	menuItem.setText(oFF.AuGdsToolbarMappingUtils.getEffectiveToolbarItemText(icon, text));
	menuItem.setIcon(icon);
	menuItem.setEnabled(enabled);
	menuItem.registerOnPress(oFF.AuGdsLambdaListener.create(procedure));
	return menuItem;
};
oFF.AuGdsStandardToolbarItemFactory.prototype.createToggleItem = function(topLevelItem, isSectionStart, overflowPriority, name, text, icon, enabled, explanation, highlight, unhighlight, procedure, active, stateIcon)
{
	if (isSectionStart)
	{
		topLevelItem.addNewItemOfType(oFF.UiType.SEPARATOR);
	}
	var menuItem = topLevelItem.addNewItemOfType(oFF.UiType.TOGGLE_BUTTON);
	menuItem.setName(name);
	menuItem.setTooltip(oFF.AuGdsToolbarMappingUtils.getToolbarItemTooltipText(text, explanation));
	menuItem.setText(oFF.AuGdsToolbarMappingUtils.getEffectiveToolbarItemText(icon, text));
	menuItem.setEnabled(enabled);
	menuItem.registerOnPress(oFF.AuGdsLambdaListener.create(procedure));
	menuItem.setIcon(icon);
	menuItem.setPressed(active === oFF.TriStateBool._TRUE);
	return menuItem;
};
oFF.AuGdsStandardToolbarItemFactory.prototype.createSubMenuRenderListener = function(menuToPopulate)
{
	return oFF.UiLambdaPressListener.create( function(controlEvent){
		menuToPopulate.openAt(controlEvent.getControl());
	}.bind(this));
};

oFF.AuGdsToolbarMappingUtils = {

	getToolbarItemTooltipText:function(text, explanation)
	{
			if (oFF.XStringUtils.isNullOrEmpty(explanation))
		{
			return text;
		}
		else
		{
			return oFF.XStringUtils.concatenate3(text, ": ", explanation);
		}
	},
	getEffectiveToolbarItemText:function(icon, text)
	{
			return oFF.XStringUtils.isNullOrEmpty(icon) ? text : null;
	}
};

