oFF.AuGdsDocSideNavPanelController = function() {};
oFF.AuGdsDocSideNavPanelController.prototype = new oFF.AuGdsDocPanelControllerBase();
oFF.AuGdsDocSideNavPanelController.prototype._ff_c = "AuGdsDocSideNavPanelController";

oFF.AuGdsDocSideNavPanelController.create = function()
{
	return new oFF.AuGdsDocSideNavPanelController();
};
oFF.AuGdsDocSideNavPanelController.prototype.m_sideNavigation = null;
oFF.AuGdsDocSideNavPanelController.prototype.m_showSideNavigation = false;
oFF.AuGdsDocSideNavPanelController.prototype.m_navList = null;
oFF.AuGdsDocSideNavPanelController.prototype.m_lastOpenedPanelType = null;
oFF.AuGdsDocSideNavPanelController.prototype.initialize = function(document, contentLayout)
{
	oFF.AuGdsDocPanelControllerBase.prototype.initialize.call( this , document, contentLayout);
	this.m_lastOpenedPanelType = oFF.XCollectionUtils.findFirst(this.getSupportedPanelTypes(false),  function(panelType1){
		return document.getProcess().getLocalStorage().getBooleanByKeyExt(this.getOpenStateKey(panelType1), false);
	}.bind(this));
	this.m_showSideNavigation = true;
};
oFF.AuGdsDocSideNavPanelController.prototype.releaseObject = function()
{
	this.m_navList = oFF.XObjectExt.release(this.m_navList);
	this.m_lastOpenedPanelType = oFF.XObjectExt.release(this.m_lastOpenedPanelType);
	this.m_sideNavigation = oFF.XObjectExt.release(this.m_sideNavigation);
	oFF.AuGdsDocPanelControllerBase.prototype.releaseObject.call( this );
};
oFF.AuGdsDocSideNavPanelController.prototype.setupSideNavigation = function(sideNavigationConfig)
{
	var supportedPanelTypes = this.filterSupportedPanelTypes(sideNavigationConfig);
	if (oFF.notNull(supportedPanelTypes) && supportedPanelTypes.hasElements())
	{
		this.m_sideNavigation = this.m_document.getGenesis().getRoot().addNewItemOfType(oFF.UiType.SIDE_NAVIGATION);
		this.m_sideNavigation.useMaxHeight();
		this.m_sideNavigation.setFlex("0 0 auto");
		this.m_sideNavigation.setBorderStyle(oFF.UiBorderStyle.SOLID);
		this.m_sideNavigation.setBorderWidth(oFF.UiCssBoxEdges.create("0px 0px 0px 1px"));
		this.m_sideNavigation.setBorderColor(oFF.UiTheme.getCurrentTheme().getLightGrayColor());
		this.m_sideNavigation.setExpanded(false);
		this.m_sideNavigation.registerOnItemSelect(oFF.UiLambdaItemSelectListener.create( function(event){
			var selectedItem = event.getAffectedItem();
			var allTypes = oFF.AuGdsPanelType.getAllTypesSupportedByDocType(this.m_document.getDocumentType());
			var panelType = oFF.XCollectionUtils.findFirst(allTypes,  function(panelType1){
				return oFF.XString.isEqual(panelType1.getName(), selectedItem.getTag());
			}.bind(this));
			if (oFF.notNull(panelType))
			{
				this.togglePanel(panelType);
			}
		}.bind(this)));
		this.m_navList = this.m_document.getGenesis().newControl(oFF.UiType.NAVIGATION_LIST);
		this.m_navList.addCssClass("ffGdsPanelSideNavigation");
		this.m_navList.addNewItem().setIcon("close-command-field").registerOnSelect(oFF.UiLambdaSelectListener.create( function(event1){
			var gdsPanelType = oFF.notNull(this.m_lastOpenedPanelType) ? this.m_lastOpenedPanelType : supportedPanelTypes.get(0);
			this.togglePanel(gdsPanelType);
		}.bind(this)));
		oFF.XCollectionUtils.forEach(supportedPanelTypes,  function(panelType3){
			this.addSideNavigationItem(panelType3, false);
		}.bind(this));
		this.m_sideNavigation.setNavList(this.m_navList);
		if (oFF.notNull(this.m_openPanelTypes) && this.m_openPanelTypes.hasElements())
		{
			var currentSelectedItem = this.m_navList.getSelectedItem();
			var openPanelType = this.m_openPanelTypes.get(0);
			var itemToBeSelected = oFF.XCollectionUtils.findFirst(this.m_navList.getItems(),  function(navListItem){
				return oFF.XString.isEqual(navListItem.getTag(), openPanelType.getName());
			}.bind(this));
			if (oFF.notNull(itemToBeSelected) && currentSelectedItem !== itemToBeSelected)
			{
				this.m_navList.setSelectedItem(itemToBeSelected);
			}
		}
		if (!this.shouldShowSideNavigation(sideNavigationConfig))
		{
			this.setSideNavigationVisible(false);
		}
	}
};
oFF.AuGdsDocSideNavPanelController.prototype.addSideNavigationItem = function(panelType, updateSupportedPanelTypes)
{
	if (oFF.notNull(this.m_navList) && !this.isDebugPanelTypeInNonDebugMode(panelType) && !oFF.XCollectionUtils.contains(this.m_navList.getItems(),  function(item){
		return oFF.XString.isEqual(item.getTag(), panelType.getName());
	}.bind(this)))
	{
		this.m_navList.addNewItem().setIcon(panelType.getIcon()).setTag(panelType.getName()).setTooltip(panelType.getDescription());
		if (updateSupportedPanelTypes)
		{
			this.addToSupportedPanelTypes(panelType);
		}
	}
};
oFF.AuGdsDocSideNavPanelController.prototype.setSideNavigationVisible = function(visible)
{
	this.m_showSideNavigation = visible;
	if (oFF.notNull(this.m_sideNavigation))
	{
		this.m_sideNavigation.setVisible(visible);
	}
};
oFF.AuGdsDocSideNavPanelController.prototype.addPanelToContainer = function(panelView, panelType)
{
	var selectedItem;
	oFF.XCollectionUtils.forEach(this.getSupportedPanelTypes(false),  function(panelType1){
		this.resetAutoOpenState(panelType1);
	}.bind(this));
	this.m_panelContainer.clearItems();
	this.m_panelContainer.addItem(panelView);
	this.m_lastOpenedPanelType = panelType;
	this.clearOpenPanelTypes();
	this.addToOpenPanelTypes(panelType);
	if (oFF.notNull(this.m_navList))
	{
		selectedItem = oFF.XCollectionUtils.findFirst(this.m_navList.getItems(),  function(item){
			return oFF.XString.isEqual(item.getTag(), panelType.getName());
		}.bind(this));
		oFF.XTimeout.timeout(0,  function(){
			this.m_navList.setSelectedItem(selectedItem);
		}.bind(this));
	}
	return true;
};
oFF.AuGdsDocSideNavPanelController.prototype.removePanelFromContainer = function(panelView, panelType)
{
	this.m_panelContainer.removeItem(panelView);
	this.removeFromOpenPanelTypes(panelType);
	if (oFF.notNull(this.m_navList))
	{
		oFF.XTimeout.timeout(0,  function(){
			this.m_navList.setSelectedItem(null);
		}.bind(this));
	}
	return false;
};
oFF.AuGdsDocSideNavPanelController.prototype.afterPanelToggle = function(autoOpenPanel)
{
	if (oFF.notNull(this.m_navList))
	{
		var overviewItem = this.m_navList.getItem(0);
		var overviewIcon = autoOpenPanel ? "open-command-field" : "close-command-field";
		overviewItem.setIcon(overviewIcon);
	}
};
oFF.AuGdsDocSideNavPanelController.prototype.getPanelAutoOpenState = function(panelType)
{
	return panelType === this.m_lastOpenedPanelType;
};
oFF.AuGdsDocSideNavPanelController.prototype.filterSupportedPanelTypes = function(sideNavigationConfig)
{
	var supportedPanelTypes = this.getSupportedPanelTypes(true);
	if (oFF.notNull(sideNavigationConfig))
	{
		var enabledPanels = sideNavigationConfig.getListByKey(oFF.AuGdsConstants.CONFIG_SIDE_NAVIGATION_SUPPORTED_PANELS);
		if (oFF.notNull(enabledPanels))
		{
			var filteredPanelTypes = oFF.XList.create();
			oFF.XCollectionUtils.forEach(enabledPanels,  function(panel){
				if (panel.isString())
				{
					var type = oFF.XCollectionUtils.findFirst(supportedPanelTypes,  function(panelType){
						return oFF.XString.isEqual(panelType.getName(), panel.getString());
					}.bind(this));
					if (oFF.notNull(type))
					{
						filteredPanelTypes.add(type);
					}
				}
			}.bind(this));
			var filteredTypes = filteredPanelTypes.getValuesAsReadOnlyList();
			this.setSupportedPanelTypes(filteredTypes);
			return filteredTypes;
		}
	}
	return supportedPanelTypes;
};
oFF.AuGdsDocSideNavPanelController.prototype.shouldShowSideNavigation = function(sideNavigationConfig)
{
	var showSideNavigation = this.m_showSideNavigation;
	if (oFF.notNull(sideNavigationConfig))
	{
		showSideNavigation = showSideNavigation && sideNavigationConfig.getBooleanByKeyExt(oFF.AuGdsConstants.CONFIG_SIDE_NAVIGATION_VISIBLE, true);
	}
	return showSideNavigation;
};

