oFF.AuGdsQbQueryController.prototype.setupQueryController = function(queryBuilderDocument)
{
	this.m_parentDocument = queryBuilderDocument;
	this.m_listener = queryBuilderDocument;
	this.m_resultEmptyListeners = oFF.XList.create();
	this.m_resultReadyListeners = oFF.XList.create();
	this.m_renderingPauseEndListeners = oFF.XList.create();
	this.m_isExternalQueryManager = false;
	this.m_isBusy = false;
	this.m_status = oFF.AuGdsQbQueryControllerStatus.INITIAL;
	this.m_internalTriggerIdentifier = oFF.XStringValue.create(oFF.AuGdsQbQueryController.INTERNAL_TRIGGER_IDENTIFIER);
	this.m_memberRepo = oFF.XHashMapByString.create();
	this.m_initialRowWindowSize = 150;
	this.m_initialColumnWindowSize = 50;
};
oFF.AuGdsQbQueryController.prototype.releaseObject = function()
{
	this.m_listener = null;
	this.m_activeResultSetContainer = null;
	this.m_parentDocument = null;
	this.m_pendingResultUpdates = null;
	this.m_pendingScrolls = null;
	if (!this.isExternalQm())
	{
		this.m_queryManager = oFF.XObjectExt.release(this.m_queryManager);
	}
	this.m_resultEmptyListeners.clear();
	this.m_resultEmptyListeners = null;
	this.m_renderingPauseEndListeners.clear();
	this.m_renderingPauseEndListeners = null;
	this.m_newQueryManagerReadyConsumer = null;
	this.m_queryStateChanged = null;
	this.m_busyStateChangedConsumer = null;
	this.m_messageConsumer = null;
	this.m_setupInterruptedConsumer = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsQbQueryController.prototype.reset = function()
{
	if (!this.isExternalQm())
	{
		this.m_queryManager = oFF.XObjectExt.release(this.m_queryManager);
	}
	else
	{
		this.m_queryManager = null;
	}
	this.m_isExternalQueryManager = false;
	this.m_isBusy = false;
	this.m_status = oFF.AuGdsQbQueryControllerStatus.INITIAL;
};
oFF.AuGdsQbQueryController.prototype.initQueryManagerFromDataSource = function(application, dataSource)
{
	this.m_messageManager = oFF.MessageManagerSimple.createMessageManager();
	var messageCenter = this.getParentDocument().getMessageCenter();
	if (oFF.isNull(dataSource))
	{
		messageCenter.showErrorToast(this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_SPECIFY_DATA_SOURCE));
		return;
	}
	this.m_listener.onBackendRequestStarted();
	this.setSetupStarted();
	var serviceConfig = oFF.QueryServiceConfig.createWithDataSource(application, dataSource.getSystemName(), dataSource);
	serviceConfig.processQueryManagerCreation(oFF.SyncType.NON_BLOCKING, this, null);
};
oFF.AuGdsQbQueryController.prototype.initWithExistingQueryManager = function(queryManager)
{
	this.m_messageManager = oFF.MessageManagerSimple.createMessageManager();
	var messageCenter = this.getParentDocument().getMessageCenter();
	this.m_inaRepoJson = null;
	this.m_forceInitialVariableDialog = false;
	if (oFF.isNull(queryManager))
	{
		messageCenter.showErrorToast(this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_MANAGER_REQUIRED));
		return;
	}
	if (queryManager.isReleased())
	{
		messageCenter.showErrorToast(this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_SPECIFIED_QUERY_MANAGER_RELEASED));
		return;
	}
	this.setSetupStarted();
	this.setupNewQueryManager(queryManager, true);
};
