oFF.AuGdsQbQueryController.prototype.setAutoUpdatesEnabledInternal = function(enabled)
{
	this.m_updatesPaused = !enabled;
	if (!this.m_updatesPaused)
	{
		if (this.m_pendingUpdates)
		{
			this.setBusyState(true);
			this.updateQueryResultSet();
		}
		else
		{
			this.notifyQueryStateChanged();
			this.notifyRenderingPauseEnd();
		}
		this.m_pendingUpdates = false;
	}
	else
	{
		this.cancelProcessing();
		this.notifyQueryStateChanged();
	}
};
