oFF.AuGdsQbQueryController.prototype.updateQueryResultSetExt = function(forceUpdate)
{
	if (this.getQueryManager() === null)
	{
		this.getParentDocument().setCriticalError(this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_MISSING_QUERY_MANAGER));
		return;
	}
	oFF.XTimeout.clear(this.m_timeoutResultSet);
	this.m_timeoutResultSet = oFF.XTimeout.timeout(30,  function(){
		if (!this.m_updatesPaused || forceUpdate)
		{
			this.setStatus(oFF.AuGdsQbQueryControllerStatus.SYNC_IN_PROGRESS, null);
			this.m_pendingUpdates = false;
			this.setBusyState(true);
			if ((this.isSyncActionProcessing() || this.hasPendingResultSetUpdates()) && !this.m_rescheduled)
			{
				this.rescheduleTableUpdate();
			}
			else
			{
				this.m_rescheduled = false;
				this.m_canceledUpdate = false;
				this.processQueryExecutionWindow(0, this.m_initialRowWindowSize, 0, this.m_initialColumnWindowSize);
			}
		}
		else
		{
			this.setStatus(oFF.AuGdsQbQueryControllerStatus.NOT_IN_SYNC, null);
			this.m_pendingUpdates = true;
		}
	}.bind(this));
};
oFF.AuGdsQbQueryController.prototype.setupNewQueryManager = function(queryManager, isExternal)
{
	if (oFF.notNull(queryManager))
	{
		if (oFF.notNull(this.m_queryManager) && !this.m_queryManager.isReleased() && isExternal)
		{
			this.m_queryManager.detachBeforeQueryExecutionListener(this);
			this.m_queryManager.detachQueryExecutedListener(this);
		}
		this.m_queryManager = queryManager;
		this.m_isExternalQueryManager = isExternal;
		if (isExternal)
		{
			queryManager.attachQueryExecutedListener(this, oFF.AuGdsQbQueryController.EXTERNAL_QM_IDENTIFIER_OBJ);
		}
		queryManager.attachBeforeQueryExecutionListener(this, null);
		if (queryManager.getConvenienceCommands().isBw())
		{
			queryManager.setDataRefreshEnabled(oFF.ActionChoice.ON);
		}
		queryManager.getTagging().put(oFF.QStateConstants.TAG_UNDO_INCLUDE, "true");
		queryManager.getApplication().getUndoManager().reset();
		queryManager.disableReturnedDataSelection(oFF.ReturnedDataSelection.CELL_EXPLAIN);
		var queryModel = queryManager.getQueryModel();
		if (queryModel.getModelCapabilities().supportsCellDocumentId())
		{
			queryModel.getDocumentsIdsRequest().setDocumentsIdsScope(oFF.DocumentsIdsScope.RESULT_SET_BOUND);
		}
		if (!this.isExternalQm())
		{
			this.setDefaultQmSettings(this.getQueryManager());
		}
		if (oFF.notNull(this.m_inaRepoJson))
		{
			queryModel.getVariableContainer().deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY_DELTA, this.m_inaRepoJson);
			this.applyInitialVariables();
			this.ensureReadOnly(queryManager);
			queryManager.submitVariables(oFF.SyncType.NON_BLOCKING, this, null);
		}
		else
		{
			this.applyInitialVariables();
			this.ensureReadOnly(queryManager);
			var didPresent = this.presentInitialVariablesDialogIfNecessary();
			if (!didPresent)
			{
				this.finalizeQueryManagerSetup();
			}
		}
	}
};
oFF.AuGdsQbQueryController.prototype.finalizeQueryManagerSetup = function()
{
	this.setDefaultAccountHierarchy(this.getQueryManager());
	if (!this.isExternalQm())
	{
		this.applyInitialPresentationAttributes();
		this.applyInitialFilters();
		this.applyInitialDataSourceText();
	}
	this.ensureReadOnly(this.getQueryManager());
	this.m_memberRepo = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_memberRepo);
	this.m_memberRepo = oFF.XHashMapByString.create();
	var queryModel = this.getQueryManager().getQueryModel();
	var measurePromise = this.fetchMember(queryModel.getMeasureDimension()).onCatch( function(measureError){
		this.notifyMessage(oFF.UiMessageType.WARNING, this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_MEASURE_HIERARCHY_ERROR));
	}.bind(this));
	var structurePromise = this.fetchMember(queryModel.getDimensionByType(oFF.DimensionType.SECONDARY_STRUCTURE)).onCatch( function(structureError){
		this.notifyMessage(oFF.UiMessageType.WARNING, this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_STRUCTURE_HIERARCHY_ERROR));
	}.bind(this));
	var accountPromise = this.fetchMember(queryModel.getAccountDimension()).onCatch( function(accountError){
		this.notifyMessage(oFF.UiMessageType.ERROR, this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_ACCOUNT_MEMBER_ERROR));
	}.bind(this));
	var promises = oFF.XList.create();
	promises.add(measurePromise);
	promises.add(structurePromise);
	promises.add(accountPromise);
	var all = oFF.XPromise.all(promises);
	all.onFinally( function(){
		this.setSetupFinished();
		this.m_inaRepoJson = null;
		this.m_forceInitialVariableDialog = false;
		this.notifyNewQueryManagerReady();
	}.bind(this));
};
oFF.AuGdsQbQueryController.prototype.applyInitialPresentationAttributes = function()
{
	var queryManager = this.getQueryManager();
	if (oFF.notNull(queryManager))
	{
		var isBW = queryManager.getSystemType().isTypeOf(oFF.SystemType.BW);
		var defaultSettings = this.getParentDocument().getDefaultSettings();
		if (isBW && oFF.notNull(defaultSettings) && defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_SETUP_BW_DEFAULT_KEY_TYPES))
		{
			var dimensions = queryManager.getDimensionAccessor().getDimensions();
			for (var i = 0; i < dimensions.size(); i++)
			{
				var dimension = dimensions.get(i);
				oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
			}
		}
	}
};
oFF.AuGdsQbQueryController.prototype.applyInitialVariables = function()
{
	if (!this.isExternalQm() && oFF.notNull(this.m_initialVariables) && !this.m_initialVariables.isEmpty())
	{
		this.setVariables(this.m_initialVariables);
		this.m_initialVariables = null;
	}
};
