oFF.AuGdsQbQueryController.prototype.fetchMember = function(dimension)
{
	return oFF.XPromise.create( function(resolve, reject){
		if (oFF.isNull(dimension))
		{
			resolve(null);
			return;
		}
		if (dimension.isStructure() && !dimension.isHierarchyActive())
		{
			var members = oFF.XStream.of(dimension.getAllStructureMembers()).map( function(m){
				return oFF.QFactory.createMeasureHelpNode(m.getName(), m);
			}.bind(this)).collect(oFF.XStreamCollector.toList());
			this.m_memberRepo.put(dimension.getName(), members);
			resolve(null);
			return;
		}
		dimension.setSelectorHierarchyActive(dimension.isHierarchyActive());
		dimension.setSelectorHierarchyName(dimension.getHierarchyName());
		dimension.setSelectorInitialDrillLevel(-2);
		dimension.setSelectorSortType(null);
		var selectorFields = dimension.getSelectorFields();
		selectorFields.clear();
		selectorFields.add(dimension.getKeyField());
		selectorFields.add(dimension.getDisplayKeyField());
		selectorFields.add(dimension.getTextField());
		dimension.processValueHelp(oFF.SyncType.NON_BLOCKING, oFF.OuValHelpExecutedListenerLambda.createSingleUse( function(result){
			if (result.hasErrors())
			{
				reject(result.getSummary());
				return;
			}
			this.m_memberRepo.put(dimension.getName(), result.getData());
			resolve(null);
		}.bind(this)), null);
	}.bind(this));
};
oFF.AuGdsQbQueryController.prototype.presentInitialVariablesDialogIfNecessary = function()
{
	var variables = this.getQueryManager().getInputEnabledAndNonTechnicalVariables();
	if (!oFF.XCollectionUtils.hasElements(variables) || !this.m_implicitVariableHandling)
	{
		return false;
	}
	var foundNotSetMandatoryVar = oFF.XCollectionUtils.contains(variables,  function(variable){
		return variable.isMandatory() && variable.isEmpty();
	}.bind(this));
	if (this.m_forceInitialVariableDialog || this.getQueryManager().isSubmitNeeded() || foundNotSetMandatoryVar || !this.hasInaRepoJson())
	{
		var variableDialog = oFF.VdUqmEntryPoint.createEntryPoint(this.getLocalization().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.DIALOG_VARIABLE_WITH_PLACEHOLDER, this.getQueryManager().getDataSource().getName()), this.getQueryManager(), this);
		variableDialog.open();
		this.notifyMessage(oFF.UiMessageType.WARNING, this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_SELECT_INITIAL_VARIABLES));
		return true;
	}
	return false;
};
oFF.AuGdsQbQueryController.prototype.resetPaging = function()
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	cmd.setOffsetRows(0);
	if (this.m_initialRowWindowSize > 0)
	{
		cmd.setMaxRows(this.m_initialRowWindowSize);
	}
	cmd.setOffsetColumns(0);
	if (this.m_initialColumnWindowSize > 0)
	{
		cmd.setMaxColumns(this.m_initialColumnWindowSize);
	}
};
oFF.AuGdsQbQueryController.prototype.processQueryExecutionWindow = function(startRow, sizeRow, startCol, sizeCol)
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	if (sizeRow > 0)
	{
		cmd.setOffsetRows(startRow);
		cmd.setMaxRows(sizeRow);
	}
	if (sizeCol > 0)
	{
		cmd.setOffsetColumns(startCol);
		cmd.setMaxColumns(sizeCol);
	}
	this.m_listener.onBackendRequestStarted();
	this.m_activeResultSetContainer = this.getQueryManager().getActiveResultSetContainer();
	this.getQueryManager().processQueryExecution(oFF.SyncType.NON_BLOCKING, this, this.isExternalQm() ? oFF.AuGdsQbQueryController.EXTERNAL_QM_IDENTIFIER_OBJ : this.m_internalTriggerIdentifier);
};
oFF.AuGdsQbQueryController.prototype.setDefaultAccountHierarchy = function(queryManager)
{
	if (oFF.isNull(queryManager))
	{
		return;
	}
	var accountDimension = queryManager.getQueryModel().getAccountDimension();
	if (oFF.notNull(accountDimension))
	{
		var accountHierarchyName = accountDimension.getDefaultHierarchyName();
		var accountHierarchies = accountDimension.getHierarchies();
		if (oFF.XStringUtils.isNullOrEmpty(accountHierarchyName) && oFF.notNull(accountHierarchies) && oFF.XCollectionUtils.hasElements(accountHierarchies.getObjects()))
		{
			accountHierarchyName = accountHierarchies.getObjects().get(0).getHierarchyName();
		}
		accountDimension.setHierarchyName(accountHierarchyName);
		accountDimension.setHierarchyActive(true);
	}
};
oFF.AuGdsQbQueryController.prototype.setDefaultQmSettings = function(queryManager)
{
	if (oFF.notNull(queryManager))
	{
		var defaultSettings = this.getParentDocument().getDefaultSettings();
		if (oFF.notNull(defaultSettings))
		{
			var cmd = queryManager.getConvenienceCommands();
			var measureDimension = queryManager.getQueryModel().getMeasureDimension();
			var accountDimension = queryManager.getQueryModel().getAccountDimension();
			var isHana = queryManager.getSystemType().isTypeOf(oFF.SystemType.HANA);
			var isBW = queryManager.getSystemType().isTypeOf(oFF.SystemType.BW);
			if (isHana && oFF.notNull(measureDimension))
			{
				var setupDefaultMeasureStructureFilter = defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_CREATE_HANA_DEFAULT_MEASURE_FILTER);
				var setupDefaultMeasureStructureAttributes = defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_SETUP_HANA_DEFAULT_MEASURE_ATTRIBUTES);
				this.setupDefaultStructureSettingsForHana(cmd, measureDimension, setupDefaultMeasureStructureFilter, setupDefaultMeasureStructureAttributes);
				if (oFF.notNull(accountDimension))
				{
					this.setupDefaultStructureSettingsForHana(cmd, accountDimension, setupDefaultMeasureStructureFilter, setupDefaultMeasureStructureAttributes);
					var accountHierarchyName = accountDimension.getDefaultHierarchyName();
					var accountHierarchies = accountDimension.getHierarchies();
					if (oFF.XStringUtils.isNullOrEmpty(accountHierarchyName) && oFF.notNull(accountHierarchies) && oFF.XCollectionUtils.hasElements(accountHierarchies.getObjects()))
					{
						accountHierarchyName = accountHierarchies.getObjects().get(0).getHierarchyName();
					}
					cmd.setDimensionHierarchy(accountDimension.getName(), accountHierarchyName, true, 0);
					var versionDimension = queryManager.getQueryModel().getVersionDimension();
					if (oFF.notNull(versionDimension))
					{
						cmd.moveDimensionToAxis(accountDimension.getName(), oFF.AxisType.ROWS);
						cmd.moveDimensionToAxis(versionDimension.getName(), oFF.AxisType.COLUMNS);
					}
					else if (accountDimension.getAxisType() === oFF.AxisType.FREE)
					{
						cmd.moveDimensionToAxis(accountDimension.getName(), oFF.AxisType.COLUMNS);
					}
					if (setupDefaultMeasureStructureFilter)
					{
						cmd.moveDimensionToAxis(measureDimension.getName(), oFF.AxisType.FREE);
					}
				}
			}
			var dimensions;
			var i;
			var dimension;
			if (isHana && (defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_PREACTIVATE_HANA_DEFAULT_HIERARCHY) || defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_HANA_TOTAL_ALIGNMENT_TOP)))
			{
				dimensions = queryManager.getDimensionAccessor().getDimensions();
				if (defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_PREACTIVATE_HANA_DEFAULT_HIERARCHY))
				{
					for (i = 0; i < dimensions.size(); i++)
					{
						dimension = dimensions.get(i);
						if (dimension.supportsHierarchy() && oFF.XStringUtils.isNotNullAndNotEmpty(dimension.getDefaultHierarchyName()) && oFF.XStringUtils.isNullOrEmpty(dimension.getHierarchyName()))
						{
							cmd.setDimensionHierarchy(dimension.getName(), dimension.getDefaultHierarchyName(), true, dimension.getInitialDrillLevel());
							oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimensionExt(dimension, oFF.FieldContainerDisplay.TEXT);
						}
					}
				}
				if (defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_HANA_TOTAL_ALIGNMENT_TOP))
				{
					for (i = 0; i < dimensions.size(); i++)
					{
						dimension = dimensions.get(i);
						if (dimension.supportsResultAlignment())
						{
							cmd.alignTotals(oFF.QModelLevel.DIMENSIONS, dimension.getName(), oFF.ResultAlignment.TOP);
						}
					}
				}
			}
			if (isHana && defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_HANA_TOTAL_ALIGNMENT_TOP))
			{
				cmd.alignTotals(oFF.QModelLevel.AXES, oFF.AxisType.ROWS.getName(), oFF.ResultAlignment.TOP);
				cmd.alignTotals(oFF.QModelLevel.AXES, oFF.AxisType.COLUMNS.getName(), oFF.ResultAlignment.TOP);
				cmd.alignTotals(oFF.QModelLevel.QUERY, null, oFF.ResultAlignment.TOP);
			}
			if (isBW && defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_SETUP_BW_DEFAULT_KEY_TYPES))
			{
				dimensions = queryManager.getDimensionAccessor().getDimensions();
				for (i = 0; i < dimensions.size(); i++)
				{
					dimension = dimensions.get(i);
					oFF.FieldContainerPresentationHelper.enforceKeyDisplayForDimension(dimension, oFF.FieldContainerKeyDisplay.EXTERNAL_KEY, true);
				}
			}
			if (defaultSettings.getBooleanByKey(oFF.AuGdsConstants.DEFAULT_SETTINGS_SET_ACTIVE_NODE_ALIGNMENT_INHERIT))
			{
				queryManager.getQueryModel().getRowsAxis().setLowerLevelNodeAlignment(oFF.Alignment.INHERIT_FROM_FIRST_DIMENSION_ON_AXIS);
				queryManager.getQueryModel().getColumnsAxis().setLowerLevelNodeAlignment(oFF.Alignment.INHERIT_FROM_FIRST_DIMENSION_ON_AXIS);
			}
		}
	}
};
oFF.AuGdsQbQueryController.prototype.setupDefaultStructureSettingsForHana = function(cmd, structureDimension, setupDefaultMeasureStructureFilter, setupDefaultMeasureAttributes)
{
	if (oFF.XCollectionUtils.hasElements(structureDimension.getAllStructureMembers()) && setupDefaultMeasureStructureFilter && !oFF.XCollectionUtils.hasElements(structureDimension.getFilter()))
	{
		cmd.addSingleMeasureFilter(structureDimension.getAllStructureMembers().get(0).getName());
	}
	if (setupDefaultMeasureAttributes)
	{
		var resultSetFields;
		if (structureDimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED || structureDimension.getMainAttribute() === null)
		{
			resultSetFields = structureDimension.getResultSetFields();
		}
		else
		{
			resultSetFields = structureDimension.getMainAttribute().getResultSetFields();
		}
		if (oFF.notNull(resultSetFields) && resultSetFields.size() > 1)
		{
			var resultSetField = structureDimension.getTextField();
			if (oFF.isNull(resultSetField))
			{
				resultSetField = structureDimension.getDisplayKeyField();
			}
			if (oFF.isNull(resultSetField))
			{
				resultSetField = structureDimension.getKeyField();
			}
			if (oFF.notNull(resultSetField))
			{
				resultSetFields.clear();
				resultSetFields.add(resultSetField);
			}
		}
	}
};
