oFF.FilterDialogTestProgramLayout.prototype.createItem = function(parent, name, type)
{
	var container = parent.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	container.setDirection(oFF.UiFlexDirection.ROW);
	container.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	container.addNewItemOfType(oFF.UiType.LABEL).setText(name).setWidth(oFF.UiCssLength.create("200px"));
	return container.addNewItemOfType(type).useMaxWidth().setName(oFF.XString.replace(name, " ", ""));
};
oFF.FilterDialogTestProgramLayout.prototype.fillDimensionDropdown = function(queryManager, dimensionName)
{
	this.m_dimensionDropdown.clearItems();
	if (oFF.notNull(queryManager))
	{
		var dimensions = queryManager.getDimensionAccessor().getDimensions();
		for (var i = 0; i < dimensions.size(); i++)
		{
			var dimension = dimensions.get(i);
			if (!dimension.isUniversalDisplayHierarchyDimension())
			{
				this.m_dimensionDropdown.addNewItem().setName(dimension.getName()).setText(dimension.getName());
			}
		}
		var dim = dimensionName;
		if (oFF.XStringUtils.isNullOrEmpty(dim) || queryManager.getDimensionAccessor().getDimensionByName(dim) === null)
		{
			dim = dimensions.get(0).getName();
		}
		this.m_dimensionDropdown.setSelectedName(dim);
	}
};
oFF.FilterDialogTestProgramLayout.prototype.fillVariableDropdown = function(queryManager, variableName)
{
	this.m_variableDropdown.clearItems();
	if (oFF.notNull(queryManager) && queryManager.hasInputEnabledAndNonTechnicalVariables())
	{
		var variables = queryManager.getInputEnabledAndNonTechnicalVariables();
		for (var i = 0; i < variables.size(); i++)
		{
			var variable = variables.get(i);
			this.m_variableDropdown.addNewItem().setName(variable.getName()).setText(variable.getName());
		}
		var _var = variableName;
		if (oFF.XStringUtils.isNullOrEmpty(_var) || queryManager.getVariable(_var) === null)
		{
			_var = variables.get(0).getName();
		}
		this.m_variableDropdown.setSelectedName(_var);
	}
};
oFF.FilterDialogTestProgramLayout.prototype.fillMeasuresDropdown = function(queryManager, measure)
{
	this.m_measuresDropdown.clearItems();
	if (this.m_dataObjectMeasureBasedRadioBtn.isVisible())
	{
		var queryModel = queryManager.getQueryModel();
		var accountDimension = queryModel.getAccountDimension();
		var measureDimension = oFF.notNull(accountDimension) && accountDimension.getAllStructureMembers().hasElements() ? accountDimension : queryModel.getMeasureDimension();
		var structureMembers = measureDimension.getAllStructureMembers();
		oFF.XCollectionUtils.forEach(structureMembers,  function(member){
			this.m_measuresDropdown.addNewItem().setName(member.getName()).setText(member.getText());
		}.bind(this));
		var defaultMember = measure;
		if (oFF.XStringUtils.isNullOrEmpty(defaultMember) || measureDimension.getStructureMember(defaultMember) === null)
		{
			defaultMember = structureMembers.get(0).getName();
		}
		this.m_measuresDropdown.setSelectedName(defaultMember);
	}
};
oFF.FilterDialogTestProgramLayout.prototype.onChange = function(event)
{
	this.updateConfigVisibility();
};
oFF.FilterDialogTestProgramLayout.prototype.updateConfigVisibility = function()
{
	var isDimension = this.m_dataObjectDimensionRadioBtn.isSelected();
	var isVariable = this.m_dataObjectVariableRadioBtn.isSelected();
	var isHierarchyCatalog = this.m_dataObjectHierarchyRadioBtn.isSelected();
	var isMeasureBasedFilter = this.m_dataObjectMeasureBasedRadioBtn.isSelected();
	var isEntryPointSac = this.m_entryPointSacRadioBtn.isSelected();
	if (isHierarchyCatalog)
	{
		this.m_entryPointDefaultRadioBtn.setSelected(true);
		this.m_multiSelectionModeCheckbox.setChecked(false);
	}
	this.m_dimensionDropdown.getParent().setVisible(isDimension || isHierarchyCatalog);
	this.m_hierarchyInput.getParent().setVisible(isDimension);
	this.m_filterTypeCombobox.getParent().setVisible(isDimension);
	this.m_filterTypeDefaultDropdown.getParent().setVisible(isDimension);
	this.m_variableDropdown.getParent().setVisible(this.m_dataObjectVariableRadioBtn.isSelected());
	this.m_measuresDropdown.getParent().setVisible(isMeasureBasedFilter);
	this.m_enforceCrossCalculationMeasureSelection.getParent().setVisible(isMeasureBasedFilter);
	this.m_entryPointSacRadioBtn.setVisible(!isHierarchyCatalog && !isMeasureBasedFilter);
	this.m_filterRadioBtnGroup.setVisible(this.m_entryPointDefaultRadioBtn.isSelected() && (isDimension || isMeasureBasedFilter));
	if (!this.m_filterRadioBtnGroup.isVisible())
	{
		this.m_useNoFilterRadioBtn.setSelected(true);
	}
	this.m_useDynamicFilterRadioBtn.setVisible(isDimension);
	this.m_displayInfoDropdown.getParent().setVisible(!isEntryPointSac && !isMeasureBasedFilter);
	this.m_pageSizeInput.getParent().setVisible(!isEntryPointSac && !isMeasureBasedFilter);
	this.m_multiSelectionModeCheckbox.getParent().setVisible(!isEntryPointSac);
	this.m_selectionRequiredCheckbox.getParent().setVisible(!isEntryPointSac);
	this.m_showSelectionContainerCheckBox.getParent().setVisible(!isEntryPointSac);
	this.m_readModeCheckbox.getParent().setVisible(isDimension || isVariable);
	this.m_excludeCheckbox.getParent().setVisible(!isEntryPointSac && !isHierarchyCatalog && !isMeasureBasedFilter);
	this.m_equalInRangeViewCheckbox.getParent().setVisible(!isEntryPointSac && !isHierarchyCatalog);
	this.m_hierarchyChangeCheckbox.getParent().setVisible(!isEntryPointSac && isDimension && !isMeasureBasedFilter);
	if (this.m_useDynamicFilterRadioBtn.isSelected() || this.m_useLinkedFilterRadioBtn.isSelected())
	{
		this.m_hierarchyChangeCheckbox.setChecked(this.m_useLinkedFilterRadioBtn.isSelected());
		this.m_hierarchyChangeCheckbox.setEnabled(false);
	}
	else
	{
		this.m_hierarchyChangeCheckbox.setEnabled(true);
	}
	this.m_expandHierarchyCheckbox.getParent().setVisible(!isHierarchyCatalog && !isMeasureBasedFilter);
	this.m_clipboardCheckbox.getParent().setVisible(isDimension && !isMeasureBasedFilter);
};
