oFF.AuGdsDfView.prototype.initView = function(parentDocument)
{
	if (oFF.isNull(parentDocument))
	{
		throw oFF.XException.createRuntimeException("Error while creating a gds view. Missing parent document!");
	}
	this.m_parentDocument = parentDocument;
	this.m_isVisible = false;
	var viewType = this.getViewType();
	if (oFF.isNull(viewType))
	{
		viewType = oFF.AuGdsViewType.GENERIC;
	}
	var prefix = oFF.XStringUtils.concatenate3("gds_", oFF.XString.toLowerCase(viewType.getName()), "_view_");
	this.m_uuid = oFF.XStringUtils.concatenate2(prefix, oFF.XGuid.getGuid());
	this.m_viewName = viewType.getDisplayName();
	this.m_view = parentDocument.getGenesis().newControl(oFF.UiType.CONTENT_WRAPPER);
	this.m_view.setName(this.m_uuid);
	this.m_view.useMaxSpace();
	this.m_genesis = oFF.UiGenesis.create(this.m_view);
	this.setupView(parentDocument);
	this.buildViewUi(this.m_genesis);
};
oFF.AuGdsDfView.prototype.releaseObject = function()
{
	this.m_parentDocument = null;
	this.m_view = oFF.XObjectExt.release(this.m_view);
	this.m_genesis = oFF.XObjectExt.release(this.m_genesis);
	oFF.XObject.prototype.releaseObject.call( this );
};
