oFF.AuGdsQbInteractiveChartContextActionsHelper.createValueLeaves = function(blockedMemberNames, newGroup, chartConfiguration, chartView, visualizationValueType)
{
	var typedValueSelections = chartConfiguration.getChartSetting().getTypedValueSelectionsForType(visualizationValueType);
	var blockedItems = oFF.XListOfString.create();
	for (var i = 0; i < typedValueSelections.size(); i++)
	{
		blockedItems.add(typedValueSelections.get(i).getDimensionMember().getName());
		oFF.AuGdsQbInteractiveChartContextActionsHelper.addNewKeyFigureSelectionLeaf(newGroup, chartView, chartConfiguration, visualizationValueType, typedValueSelections.get(i));
	}
	var keyFigureDimension = chartConfiguration.getKeyFigureDimension();
	var structureMembers = keyFigureDimension.getAllStructureMembers();
	for (var j = 0; j < structureMembers.size(); j++)
	{
		var structureMember = structureMembers.get(j);
		if (!blockedItems.contains(structureMember.getName()))
		{
			oFF.AuGdsQbInteractiveChartContextActionsHelper.addKeyFigureLeaf(newGroup, chartView, chartConfiguration, visualizationValueType, structureMember, !blockedMemberNames.contains(structureMember.getName()));
		}
	}
};
