oFF.AuGdsQbInteractiveTableContextActionsHelper.filterOnSelection = function(context, tupleElements, setSign, drill)
{
	var dimension = tupleElements.get(0).getDimension();
	var dynamicFilter = context.getQueryModel().getFilter().getDynamicFilter();
	dynamicFilter.queueEventing();
	var cartesianList = dynamicFilter.getCartesianProductWithDefault().getCartesianListWithDefault(dimension);
	cartesianList.setHierarchyInfo(dimension.getHierarchyName(), dimension.getHierarchyDueDate(), dimension.getHierarchyVersion());
	if (setSign === oFF.SetSign.INCLUDING)
	{
		cartesianList.clear();
	}
	var textField = dimension.getTextField();
	var displayKeyField = dimension.getDisplayKeyField() !== dimension.getKeyField() ? dimension.getDisplayKeyField() : null;
	cartesianList.addSupplementField(textField);
	cartesianList.addSupplementField(displayKeyField);
	for (var i = 0; i < tupleElements.size(); i++)
	{
		var element = tupleElements.get(i);
		var member = element.getDimensionMember();
		if (!member.getMemberType().isTypeOf(oFF.OlapComponentType.TOTALS) && !member.getMemberType().isTypeOf(oFF.MemberType.RESULT))
		{
			var cartesianElement = cartesianList.addNewCartesianElement();
			var isNullValue = member.getDimensionMemberNameValueException() === oFF.ValueException.NULL_VALUE;
			cartesianElement.setComparisonOperator(isNullValue ? oFF.ComparisonOperator.IS_NULL : oFF.ComparisonOperator.EQUAL);
			cartesianElement.setSetSign(setSign);
			var fieldValue;
			if (oFF.notNull(textField))
			{
				fieldValue = member.getFieldValue(textField);
				if (oFF.notNull(fieldValue) && fieldValue.hasValue())
				{
					cartesianElement.getLow().addSupplementValue(textField.getName(), fieldValue.getValue().getStringRepresentation());
				}
			}
			if (oFF.notNull(displayKeyField))
			{
				fieldValue = member.getFieldValue(displayKeyField);
				if (oFF.notNull(fieldValue) && fieldValue.hasValue())
				{
					cartesianElement.getLow().addSupplementValue(displayKeyField.getName(), fieldValue.getValue().getStringRepresentation());
				}
			}
			cartesianElement.getLow().setDimensionMember(member);
		}
	}
	if (drill)
	{
		context.getQueryModel().getConvenienceCommands().moveDimensionToAxis(dimension.getName(), oFF.AxisType.FREE);
	}
	dynamicFilter.resumeEventing();
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.moveToAxis = function(context, dimensions, axisType)
{
	var cmd = context.getQueryManager().getConvenienceCommands();
	for (var i = 0; i < dimensions.size(); i++)
	{
		cmd.moveDimensionToAxis(dimensions.get(i).getName(), axisType);
	}
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.moveDimensions = function(dimensionList, offset)
{
	var axis = dimensionList.get(0).getAxis();
	var dimension;
	var index = 0;
	var i;
	for (i = dimensionList.size() - 1; i >= 0; i--)
	{
		dimension = dimensionList.get(i);
		index = axis.getIndex(dimension);
		axis.removeAt(index);
	}
	for (i = 0; i < dimensionList.size(); i++)
	{
		axis.insert(index + offset + i, dimensionList.get(i));
	}
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.sortInDirection = function(context, direction, field, sortPath, measure)
{
	var cmd = context.getQueryManager().getConvenienceCommands();
	var caps = context.getModelCapabilities();
	var sortingManager = context.getQueryManager().getQueryModel().getSortingManager();
	if (oFF.notNull(sortPath) && caps.supportsDataCellSorting())
	{
		var datacellSorting = sortingManager.getDataCellSorting(sortPath, true);
		datacellSorting.setDirection(direction);
	}
	else if (oFF.notNull(measure) && caps.supportsMeasureSorting())
	{
		var measureSorting = sortingManager.getMeasureSorting(measure, true);
		measureSorting.setDirection(direction);
	}
	else if (oFF.notNull(field))
	{
		var dimension = field.getDimension();
		sortingManager.removeDimensionSorting(dimension);
		cmd.clearSort(oFF.SortType.ABSTRACT_DIMENSION_SORT, dimension.getName());
		cmd.clearSort(oFF.SortType.MEASURE, null);
		var axisType = dimension.getAxisType();
		var orthogonalAxisType = axisType.getOrthogonalAxisType();
		if (oFF.notNull(orthogonalAxisType))
		{
			cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, orthogonalAxisType.getName());
			cmd.clearSort(oFF.SortType.COMPLEX, orthogonalAxisType.getName());
		}
		var presentationType = field.getPresentationType();
		var dimSortType = oFF.AuGdsQbInteractiveTableContextActionsHelper.resolveDimensionSortType(field);
		if (caps.supportsFieldSorting(field))
		{
			if (direction !== oFF.XSortDirection.DEFAULT_VALUE)
			{
				cmd.sort(oFF.SortType.FIELD, dimension.getDimensionType(), dimension.getName(), presentationType, field.getName(), null, direction);
			}
		}
		else if (oFF.notNull(dimSortType) && caps.supportsDimensionSorting(dimension, dimSortType))
		{
			if (direction === oFF.XSortDirection.DEFAULT_VALUE)
			{
				if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.MEASURE_STRUCTURE) && dimension.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
				{
					var dimensionSorting = sortingManager.getDimensionSorting(dimension, true);
					dimensionSorting.setSortByKey();
					dimensionSorting.setDirection(direction);
					dimensionSorting.setCustomSort(oFF.XStream.of(dimension.getStructureLayout()).collect(oFF.XStreamCollector.toListOfString( function(input){
						return input.getName();
					}.bind(this))));
				}
			}
			else
			{
				cmd.sort(dimSortType, dimension.getDimensionType(), dimension.getName(), presentationType, null, null, direction);
			}
		}
	}
};
