oFF.AuGdsQbInteractiveTableContextActionsHelper.openFilterDialog = function(application, dimension, updateProcedure, localizationProvider)
{
	var dimensionText = oFF.XStringUtils.isNotNullAndNotEmpty(dimension.getText()) ? dimension.getText() : dimension.getName();
	if (dimension.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
	{
		if (dimension.getDimensionType() === oFF.DimensionType.MEASURE_STRUCTURE)
		{
			dimensionText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.COMMON_MEASURES);
		}
		else if (dimension.getDimensionType() === oFF.DimensionType.SECONDARY_STRUCTURE)
		{
			dimensionText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.COMMON_STRUCTURE);
		}
	}
	var title = localizationProvider.getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.FILTER_DIALOG_TITLE, dimensionText);
	var entryPoint = oFF.FdEntryPoint.createEntryPoint(application, title);
	var config = entryPoint.getConfiguration();
	config.setSelectionMode(oFF.UiSelectionMode.MULTI_SELECT);
	config.setOfferingClipboard(true);
	config.setOfferingExclude(true);
	entryPoint.openWithDynamicFilter(dimension,  function(){
		oFF.UiPerformanceCenter.getCenter().startMeasure("[Dragonfly][Filter Dimension]");
	}.bind(this),  function(){
		updateProcedure();
	}.bind(this), null);
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.getSortDirection = function(context, field, sortPath, measure)
{
	var caps = context.getModelCapabilities();
	var direction = oFF.XSortDirection.DEFAULT_VALUE;
	if (oFF.notNull(sortPath) && caps.supportsDataCellSorting())
	{
		var datacellSorting = context.getQueryModel().getSortingManager().getDataCellSorting(sortPath, false);
		if (oFF.notNull(datacellSorting))
		{
			direction = datacellSorting.getDirection();
		}
	}
	else if (oFF.notNull(measure) && caps.supportsMeasureSorting())
	{
		var measureSorting = context.getQueryModel().getSortingManager().getMeasureSorting(measure, false);
		if (oFF.notNull(measureSorting))
		{
			direction = measureSorting.getDirection();
		}
	}
	else if (oFF.notNull(field))
	{
		var dimension = field.getDimension();
		var dimSortType = oFF.AuGdsQbInteractiveTableContextActionsHelper.resolveDimensionSortType(field);
		if (caps.supportsFieldSorting(field))
		{
			var fieldSorting = context.getQueryModel().getSortingManager().getFieldSorting(field, false);
			if (oFF.notNull(fieldSorting))
			{
				direction = fieldSorting.getDirection();
			}
		}
		if (direction === oFF.XSortDirection.DEFAULT_VALUE && caps.supportsDimensionSorting(dimension, dimSortType))
		{
			var dimensionSorting = context.getQueryModel().getSortingManager().getDimensionSorting(dimension, false);
			if (oFF.notNull(dimensionSorting) && dimensionSorting.getSortingType() === dimSortType)
			{
				direction = dimensionSorting.getDirection();
			}
		}
	}
	return direction;
};
