oFF.AuGdsQbInteractiveTableContextActionsHelper.openCommentingDialog = function(application, documentStoreService, documentId, readOnly, tableView)
{
	var displayManager = oFF.OlapUiDisplayFactory.createFactoryForDialog(application.getProcess().getUiManager());
	var context = oFF.OlapUiContext.createContext(application.getProcess().getUiManager(), displayManager);
	var commentingController = context.getCommentingController();
	var documentContent = documentStoreService.getContentForFile(documentId);
	var documentContentString = "";
	if (oFF.notNull(documentContent))
	{
		documentContentString = documentContent.getString();
	}
	var commentingListener = oFF.AuGdsCommentingListener.create(documentStoreService, commentingController, tableView);
	commentingListener.setDocumentId(documentId);
	commentingController.openCommentingDialog("Edit comment:", documentContentString, readOnly, commentingListener);
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.openDataCellDialogForMember = function(application, qmContext, measureMember, secondaryMember, updateProcedure)
{
	var displayManager = oFF.OlapUiDisplayFactory.createFactoryForDialog(application.getProcess().getUiManager());
	var context = oFF.OlapUiContext.createContext(application.getProcess().getUiManager(), displayManager);
	var ddController = oFF.DataCellController.create(context);
	var aldcl = oFF.AuGdsLambdaDialogCloseListener.create(updateProcedure,  function(){
		ddController.close();
	}.bind(this));
	if (oFF.isNull(secondaryMember))
	{
		ddController.openDataCellPropertiesDialog(aldcl, qmContext.getQueryManager(), measureMember.getName(), null, false);
	}
	else
	{
		ddController.openDataCellPropertiesDialog(aldcl, qmContext.getQueryManager(), measureMember.getName(), secondaryMember.getName(), true);
	}
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.resolveDimensionSortType = function(field)
{
	var dimension = field.getDimension();
	if (field === dimension.getKeyField())
	{
		return oFF.SortType.MEMBER_KEY;
	}
	if (field === dimension.getTextField())
	{
		return oFF.SortType.MEMBER_TEXT;
	}
	if (dimension.getMainAttribute() !== null && dimension.getMainAttribute().getFields().contains(field))
	{
		var pt = field.getPresentationType();
		if (pt.isTypeOf(oFF.PresentationType.ABSTRACT_TEXT))
		{
			return oFF.SortType.MEMBER_TEXT;
		}
		if (pt.isTypeOf(oFF.PresentationType.ABSTRACT_KEY))
		{
			return oFF.SortType.MEMBER_KEY;
		}
	}
	return null;
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.hasFilterOnDimension = function(context, dimension)
{
	var cartesianProduct = context.getQueryModel().getFilter().getDynamicFilter().getCartesianProduct();
	return oFF.notNull(cartesianProduct) && oFF.XCollectionUtils.hasElements(cartesianProduct.getCartesianList(dimension));
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.showComment = function(application, documentId, documentsService, tableView)
{
	oFF.AuGdsQbInteractiveTableContextActionsHelper.openCommentingDialog(application, documentsService, documentId, true, tableView);
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.editComment = function(application, documentId, documentsService, tableView)
{
	oFF.AuGdsQbInteractiveTableContextActionsHelper.openCommentingDialog(application, documentsService, documentId, false, tableView);
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.deleteComment = function(application, genesis, action, title, message, context, columnTuple, rowTuple, selectedRowTupleIndex, dataCell, documentId, documentsService, tableView)
{
	var exitConfirmPopup = oFF.UiConfirmPopup.create(genesis, title, message);
	exitConfirmPopup.setConfirmButtonText(action);
	exitConfirmPopup.setConfirmButtonIcon("delete");
	exitConfirmPopup.setConfirmButtonType(oFF.UiButtonType.DESTRUCTIVE);
	exitConfirmPopup.setConfirmProcedure( function(){
		var listener = oFF.AuGdsDocumentsIdsDeleteListener.create(tableView, documentsService, documentId);
		var queryManager = context.getQueryManager();
		var resultSetContainer = queryManager.getActiveResultSetContainer();
		resultSetContainer.setOffsetRows(selectedRowTupleIndex);
		var documentsIdCollection = resultSetContainer.getDocumentIdCollection();
		var documentsId = documentsIdCollection.createDocumentId(columnTuple, rowTuple);
		documentsId.getDocumentIdAction(dataCell).setAction(oFF.DocumentsIdsAction.DELETE);
		queryManager.transferNewValues();
		queryManager.processQueryExecution(oFF.SyncType.NON_BLOCKING, listener, null);
	}.bind(this));
	exitConfirmPopup.open();
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.createComment = function(application, context, columnTuple, rowTuple, selectedColumnTupleIndex, selectedRowTupleIndex, dataCell, documentsService, tableView)
{
	var queryManager = context.getQueryManager();
	var resultSetContainer = queryManager.getActiveResultSetContainer();
	resultSetContainer.setOffsetRows(selectedRowTupleIndex);
	var documentsIdCollection = resultSetContainer.getDocumentIdCollection();
	var documentsId = documentsIdCollection.createDocumentId(columnTuple, rowTuple);
	documentsId.getDocumentIdAction(dataCell).setAction(oFF.DocumentsIdsAction.CREATE);
	queryManager.transferNewValues();
	var listener = oFF.AuGdsDocumentsIdsAddListener.create(application, tableView, documentsService, selectedColumnTupleIndex);
	queryManager.processQueryExecution(oFF.SyncType.NON_BLOCKING, listener, null);
};

