oFF.DfAuGdsFilterLineMenu.prototype.createDimensionMenuItem = function(dimension)
{
	var name = dimension.getName();
	var item = this.createMenuItem(name, dimension.getText());
	var areNumericDimensionsSupported = this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.NUMERIC_DIMENSION_FILTER_SUPPORT);
	var isRangeSupported = oFF.FdFilterType.RANGE.isSupportedByDim(dimension);
	var isListSupported = oFF.FdFilterType.LIST.isSupportedByDim(dimension);
	if (areNumericDimensionsSupported && isRangeSupported && isListSupported)
	{
		item.setListItemType(oFF.UiListType.NAVIGATION);
		var filterByMember = this.createSubMenuItem("Filter by Member...");
		filterByMember.setListItemType(oFF.UiListType.ACTIVE);
		filterByMember.registerOnPress(oFF.UiLambdaPressListener.create( function(filterByMemberEvent){
			this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FdFilterType.LIST);
		}.bind(this)));
		var filterByRange = this.createSubMenuItem("Filter by Range...");
		filterByRange.setListItemType(oFF.UiListType.ACTIVE);
		filterByRange.registerOnPress(oFF.UiLambdaPressListener.create( function(filterByRangeEvent){
			this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FdFilterType.RANGE);
		}.bind(this)));
		item.registerOnPress(oFF.UiLambdaPressListener.create( function(dimensionPressEvent){
			var popover = this.getGenesis().newControl(oFF.UiType.POPOVER);
			popover.setShowArrow(false);
			popover.setPlacement(oFF.UiPlacementType.RIGHT);
			var filterByList = this.getGenesis().newControl(oFF.UiType.LIST);
			filterByList.addItem(filterByMember);
			filterByList.addItem(filterByRange);
			popover.setContent(filterByList);
			popover.openAt(item);
		}.bind(this)));
	}
	else
	{
		item.registerOnPress(oFF.UiLambdaPressListener.create( function(event){
			this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FdFilterType.LIST);
		}.bind(this)));
	}
	this.m_allDimensions.put(item, oFF.XStringValue.create(name));
	return item;
};
oFF.DfAuGdsFilterLineMenu.prototype.createMenuItem = function(name, description)
{
	var item = this.getGenesis().newControl(oFF.UiType.LIST_ITEM);
	var tooltip = this.getLocalization().getTextWithPlaceholder2(oFF.AuGdsFilterLineI18n.FILTER_MENU_DIMENSION_NAME_TOOLTIP, name, description);
	item.setText(description);
	item.setTooltip(tooltip);
	item.setListItemType(oFF.UiListType.ACTIVE);
	return item;
};
oFF.DfAuGdsFilterLineMenu.prototype.createSubMenuItem = function(text)
{
	var item = this.getGenesis().newControl(oFF.UiType.LIST_ITEM);
	item.setText(text);
	item.setTooltip(text);
	return item;
};
oFF.DfAuGdsFilterLineMenu.prototype.updateMenuItemsStatus = function(selectedDimensions, selectedMeasures)
{
	var dimensionItems = this.getDimensionMenuItems();
	var dimensionItemIterator = dimensionItems.getIterator();
	while (dimensionItemIterator.hasNext())
	{
		var dimensionItem = dimensionItemIterator.next();
		var dimensionName = this.m_allDimensions.getByKey(dimensionItem);
		dimensionItem.setEnabled(!selectedDimensions.contains(dimensionName.toString()));
	}
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.MEASURE_FILTER_SUPPORT))
	{
		var measureItems = this.getMeasureMenuItems();
		var measureItemIterator = measureItems.getIterator();
		while (measureItemIterator.hasNext())
		{
			var measureItem = measureItemIterator.next();
			var measureName = this.m_allMeasures.getByKey(measureItem);
			measureItem.setEnabled(!selectedMeasures.contains(measureName.toString()));
		}
	}
};
oFF.DfAuGdsFilterLineMenu.prototype.setSubPageTitle = function(title)
{
	this.m_subPage.setTitle(title);
};
oFF.DfAuGdsFilterLineMenu.prototype.createMenuItems = function(queryManager)
{
	this.m_dimensionList = oFF.XList.create();
	oFF.XCollectionUtils.forEach(queryManager.getQueryModel().getDimensions(),  function(dimension){
		if (this.shouldDimensionBeShownInFilterSelector(dimension))
		{
			this.m_dimensionList.add(this.createDimensionMenuItem(dimension));
		}
	}.bind(this));
	this.m_dimensionList.sortByComparator(oFF.XComparatorLambda.create( function(item1, item2){
		return oFF.XIntegerValue.create(oFF.XString.compare(oFF.XString.toLowerCase(item1.getText()), oFF.XString.toLowerCase(item2.getText())));
	}.bind(this)));
	this.createMenuItemsInternal(queryManager);
};
oFF.DfAuGdsFilterLineMenu.prototype.shouldDimensionBeShownInFilterSelector = function(dim)
{
	if (!dim.supportsAxis(oFF.AxisType.ROWS) && !dim.supportsAxis(oFF.AxisType.COLUMNS))
	{
		return false;
	}
	if (!oFF.FdEntryPoint.supportsFilterOnDimension(dim))
	{
		return false;
	}
	if (dim.isMeasureStructure())
	{
		return false;
	}
	if (dim.isGroupingDimension())
	{
		return false;
	}
	if (this.shouldHideDimensionBasedOnSystemType(dim))
	{
		return false;
	}
	return true;
};
