oFF.AuGdsHomeView.prototype.prepareUi = function()
{
	this.m_mainView = this.getGenesis().newControl(oFF.UiType.FLEX_LAYOUT);
	this.m_mainView.addCssClass("ffGdsHomeView");
	this.m_mainView.setDirection(oFF.UiFlexDirection.COLUMN);
	this.m_mainView.setAlignItems(oFF.UiFlexAlignItems.START);
	this.m_mainView.useMaxSpace();
	this.createHeader();
	this.createContent();
	this.createRecentFilesFooter();
	this.reloadRecentFilesList();
};
oFF.AuGdsHomeView.prototype.createHeader = function()
{
	var headerWrapper = this.m_mainView.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	headerWrapper.addCssClass("ffGdsHomeViewHeader");
	headerWrapper.setFlex("0 0 auto");
	headerWrapper.setDirection(oFF.UiFlexDirection.COLUMN);
	headerWrapper.useMaxWidth();
	headerWrapper.setPadding(oFF.UiCssBoxEdges.create("1.5rem 2rem 0 2rem"));
	headerWrapper.setBorderStyle(oFF.UiBorderStyle.SOLID);
	headerWrapper.setBorderColor(oFF.UiColor.create("#d1e0ee"));
	headerWrapper.setBorderWidth(oFF.UiCssBoxEdges.create("0 0 2px 0"));
	var headerTitleLbl = headerWrapper.addNewItemOfType(oFF.UiType.LABEL);
	headerTitleLbl.setText("Welcome to Galaxy Data Studio!");
	headerTitleLbl.setFontSize(oFF.UiCssLength.create("1.375rem"));
	headerTitleLbl.setTextAlign(oFF.UiTextAlign.LEFT);
	headerTitleLbl.setMargin(oFF.UiCssBoxEdges.create("0 0 0.75rem 0"));
	var headerDescriptionLbl = headerWrapper.addNewItemOfType(oFF.UiType.LABEL);
	headerDescriptionLbl.setText("Instantly create various documents and explore your data.");
	headerDescriptionLbl.setFontSize(oFF.UiCssLength.create(oFF.AuGdsConstants.SMALL_FONT_SIZE));
	headerDescriptionLbl.setMargin(oFF.UiCssBoxEdges.create("0 0 1rem 0"));
	headerDescriptionLbl.setTextAlign(oFF.UiTextAlign.LEFT);
};
oFF.AuGdsHomeView.prototype.createContent = function()
{
	var tileContainer = oFF.AuGdsTileContainer.create(this.getGenesis(), "Create a new document");
	this.createDocumentTiles(tileContainer);
	this.m_mainView.addItem(tileContainer.getView());
};
oFF.AuGdsHomeView.prototype.createRecentFilesFooter = function()
{
	this.m_recentFileTable = this.m_mainView.addNewItemOfType(oFF.UiType.RESPONSIVE_TABLE);
	this.m_recentFileTable.setFlex("1 1 250px");
	this.m_recentFileTable.addNewResponsiveTableColumn().setTitle("Name");
	this.m_recentFileTable.addNewResponsiveTableColumn().setTitle("Description");
	this.m_recentFileTable.setTag(oFF.AuGdsHomeView.GDS_HW_RECENT_FILES_TABLE_TAG);
	this.m_recentFileTable.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT_MASTER);
	this.m_recentFileTable.setOverflow(oFF.UiOverflow.AUTO);
	this.m_recentFileTable.registerOnSelect(this);
	var tableHeaderWrapper = this.m_recentFileTable.setNewHeader(oFF.UiType.FLEX_LAYOUT);
	tableHeaderWrapper.useMaxSpace();
	tableHeaderWrapper.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	this.m_recentFileLabel = tableHeaderWrapper.addNewItemOfType(oFF.UiType.LABEL);
	this.m_recentFileLabel.setText("Recent Files (0)");
	this.m_recentFileLabel.setFontSize(oFF.UiCssLength.create("1.125rem"));
	this.m_recentFileLabel.useMaxWidth();
	var searchField = tableHeaderWrapper.addNewItemOfType(oFF.UiType.SEARCH_FIELD);
	searchField.setWidth(oFF.UiCssLength.create("320px"));
	searchField.setPlaceholder("Search in: Recent Files");
};
oFF.AuGdsHomeView.prototype.createDocumentTiles = function(tileContainer)
{
	oFF.XCollectionUtils.forEach(oFF.AuGdsDocumentType.getAllTypes(),  function(docType){
		var docTypeTile = tileContainer.addNewTile(docType.getDisplayName(), docType.getIcon(),  function(controlEvent){
			this.newDocumentWithType(docType);
		}.bind(this));
		docTypeTile.setTooltip(docType.getDescription());
		if (!docType.isAvailable())
		{
			docTypeTile.setLoadState(oFF.UiLoadState.DISABLED);
			docTypeTile.setTooltip("Coming soon!");
		}
	}.bind(this));
};
oFF.AuGdsHomeView.prototype.reloadRecentFilesList = function()
{
	if (oFF.notNull(this.m_recentFileTable))
	{
		var recentFiles = this.getSettingsManager().getRecentFilesList();
		this.m_recentFileTable.clearResponsiveTableRows();
		var recentFilesIterator = recentFiles.getIterator();
		while (recentFilesIterator.hasNext())
		{
			var filePathStr = recentFilesIterator.next();
			var fileName = oFF.XString.substring(filePathStr, oFF.XString.lastIndexOf(filePathStr, "/") + 1, -1);
			var tmpListItem = this.m_recentFileTable.addNewResponsiveTableRow();
			tmpListItem.setTag(oFF.AuGdsHomeView.GDS_HW_RECENT_FILES_ITEM_TAG);
			var fileNameCell = tmpListItem.addNewLabelCell();
			fileNameCell.setText(fileName);
			var pathCell = tmpListItem.addNewLabelCell();
			pathCell.setText(filePathStr);
		}
		this.updateRecentFilesCount(recentFiles.size());
	}
};
oFF.AuGdsHomeView.prototype.getController = function()
{
	return this.m_controller;
};
oFF.AuGdsHomeView.prototype.updateRecentFilesCount = function(count)
{
	if (oFF.notNull(this.m_recentFileLabel))
	{
		var text = oFF.XStringUtils.concatenate3("Recent Files (", oFF.XInteger.convertToString(count), ")");
		this.m_recentFileLabel.setText(text);
	}
};
oFF.AuGdsHomeView.prototype.newDocumentWithType = function(docType)
{
	if (oFF.notNull(this.m_listener))
	{
		this.m_listener.onGdsHvNewDocumentPress(docType);
	}
};
oFF.AuGdsHomeView.prototype.recentFileSelected = function(recentFilePath)
{
	if (oFF.notNull(this.m_listener))
	{
		this.m_listener.onGdsHvRecentFileSelect(this, recentFilePath);
	}
};
oFF.AuGdsHomeView.prototype.onSelect = function(event)
{
	var control = event.getControl();
	if (oFF.XString.isEqual(control.getTag(), oFF.AuGdsHomeView.GDS_HW_RECENT_FILES_TABLE_TAG))
	{
		var tmpItem = event.getSelectedItem();
		var tmpLabelCell = tmpItem.getResponsiveTableCell(1);
		this.recentFileSelected(tmpLabelCell.getText());
		control.clearSelectedItems();
	}
};

