oFF.AuGdsDfDocument.prototype.setupDocument = function(controller, file, fileJson, documentArguments, listener)
{
	if (oFF.isNull(controller))
	{
		throw oFF.XException.createRuntimeException("Error while creating a gds document. Missing controller!");
	}
	this.m_uuid = oFF.XGuid.getGuid();
	this.m_controller = controller;
	this.m_listener = listener;
	this.m_isVisible = false;
	this.m_docTitle = "";
	this.m_docIcon = "";
	this.m_isDirty = false;
	this.m_isEmptyDocument = true;
	var mainApplication = controller.getProcess().getApplication();
	this.m_documentSubApplication = mainApplication.newSubApplication(controller.getProcess().newChildProcess(oFF.ProcessType.SERVICE));
	this.m_menuButtons = oFF.XList.create();
	this.m_toolbarGroups = oFF.XList.create();
	this.m_toolbarFixedSection = oFF.XList.create();
	this.m_documentFeatures = oFF.XProperties.create();
	this.initDocumentArguments(documentArguments);
	this.initPanelController();
	this.doInitialSetup();
	this.processArguments(this.getDocumentArgStruct());
	this.createDocumentMenuBar();
	this.createDocumentToolbar();
	this.createDocumentView(controller.getGenesis());
	if (oFF.notNull(this.m_documentView))
	{
		var innerGenesis = oFF.UiGenesis.create(this.m_documentView);
		this.m_genesis = innerGenesis;
		this.buildDocumentUi(innerGenesis);
	}
	var startEmpty = true;
	if (oFF.notNull(fileJson) && fileJson.size() > 0)
	{
		startEmpty = !this.initDocContentAndFile(fileJson, file);
	}
	if (oFF.notNull(file) && oFF.isNull(fileJson))
	{
		startEmpty = false;
		this.openFile(file).onCatch( function(errMdg){
			this.handleStartupWithEmptyDocument();
			this.updateTitle();
		}.bind(this));
	}
	if (startEmpty)
	{
		this.handleStartupWithEmptyDocument();
	}
	this.setIcon(this.getDocumentType().getIcon());
	this.updateTitle();
};
