oFF.AuGdsDfDocument.prototype.getDocumentFileType = function(fileJson, file)
{
	if (oFF.AuGdsFileType.GDS_DOCUMENT_FILE.validate(fileJson, file))
	{
		return oFF.AuGdsFileType.GDS_DOCUMENT_FILE;
	}
	var foundFileType = oFF.AuGdsFileType.determineFileType(fileJson, file);
	if (oFF.notNull(foundFileType))
	{
		if (foundFileType.getDocumentType() !== null && foundFileType.getDocumentType() !== this.getDocumentType())
		{
			return null;
		}
	}
	return foundFileType;
};
oFF.AuGdsDfDocument.prototype.initDocContentAndFile = function(fileJson, file)
{
	var fileType = this.getDocumentFileType(fileJson, file);
	if (fileType === oFF.AuGdsFileType.GDS_DOCUMENT_FILE)
	{
		this.setupDocContentAndFile(fileJson, file);
		if (!this.isEmptyDocument())
		{
			this.handleExistingDocContent(this.getDocContent());
			return true;
		}
	}
	else if (oFF.notNull(fileType))
	{
		this.handleExternalFileType(fileType, fileJson, file);
		return true;
	}
	else
	{
		this.getMessageCenter().showWarningToast(oFF.AuGdsQbTextContants.FILE_CONTENT_NOT_RECOGNIZED);
	}
	return false;
};
oFF.AuGdsDfDocument.prototype.setupDocContentAndFile = function(extDoc, file)
{
	var isDocumentValid = false;
	if (oFF.notNull(extDoc))
	{
		var docContent = this.createDocumentContent(extDoc);
		isDocumentValid = this.isValidDocumentContent(docContent);
		if (isDocumentValid)
		{
			if (oFF.notNull(file))
			{
				this.markPristine();
			}
			else
			{
				this.markDirty();
			}
			this.setFile(file);
			var documentName = docContent.getDocumentName();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(documentName))
			{
				this.setDocumentName(documentName);
			}
			this.m_docContent = docContent;
			this.m_isEmptyDocument = false;
		}
	}
	if (!isDocumentValid)
	{
		this.getMessageCenter().showErrorToast(oFF.AuGdsQbTextContants.INVALID_DOCUMENT);
	}
};
