oFF.AuGdsQbLandingPage.prototype.getRecentFiles = function()
{
	var recentsDir = null;
	if (this.getParentDocument().getProcess().getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.VFS)
	{
		recentsDir = oFF.XFile.createFromEnvVar(this.getParentDocument().getProcess(), oFF.XEnvironmentConstants.FIREFLY_RECENT_FILES, null);
	}
	else if (this.getParentDocument().getProcess().getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.FS_DUMMY)
	{
		recentsDir = oFF.XFile.create(this.getParentDocument().getProcess(), "/sys/EHS/clib/RecentFiles/");
	}
	else if (this.getParentDocument().getProcess().getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.FS_CONTENTLIB)
	{
		recentsDir = oFF.XFile.create(this.getParentDocument().getProcess(), "/RecentFiles/");
	}
	if (oFF.notNull(recentsDir) && recentsDir.isValid())
	{
		this.m_recentFileTable.setBusy(true);
		recentsDir.processFetchChildren(oFF.SyncType.NON_BLOCKING, this, null, null);
	}
};
oFF.AuGdsQbLandingPage.prototype.handleRecentFilesLoaded = function(recentFiles)
{
	if (oFF.notNull(recentFiles))
	{
		this.m_recentFileTable.clearResponsiveTableRows();
		this.m_allRecentFileEntries.clear();
		this.updateRecentFilesLabel(recentFiles.size());
		oFF.XCollectionUtils.forEach(recentFiles,  function(recentFile){
			var tmpRow = this.m_recentFileTable.addNewResponsiveTableRow();
			tmpRow.setCustomObject(recentFile);
			tmpRow.addResponsiveTableCell(this.createNameCell(recentFile));
			var descCell = tmpRow.addNewLabelCell();
			descCell.setText(this.getRecentFileDescription(recentFile));
			var createbByCell = tmpRow.addNewLabelCell();
			createbByCell.setText(this.getRecentFileCreatedBy(recentFile));
			var createbAtCell = tmpRow.addNewLabelCell();
			createbAtCell.setText(this.getRecentFileCreatedAt(recentFile));
			var changebByCell = tmpRow.addNewLabelCell();
			changebByCell.setText(this.getRecentFileChangedBy(recentFile));
			var changebAtCell = tmpRow.addNewLabelCell();
			changebAtCell.setText(this.getRecentFileChangedAt(recentFile));
			this.m_allRecentFileEntries.add(tmpRow);
		}.bind(this));
	}
};
oFF.AuGdsQbLandingPage.prototype.createNameCell = function(recentFile)
{
	var nameCellWrapper = this.getGenesis().newControl(oFF.UiType.FLEX_LAYOUT);
	nameCellWrapper.setDirection(oFF.UiFlexDirection.ROW);
	nameCellWrapper.setAlignItems(oFF.UiFlexAlignItems.START);
	nameCellWrapper.useMaxWidth();
	var iconName = this.getRecentFileIcon(recentFile);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(iconName))
	{
		var fileIcon = nameCellWrapper.addNewItemOfType(oFF.UiType.ICON);
		fileIcon.setIcon(iconName);
		fileIcon.setEnabled(false);
		fileIcon.setMargin(oFF.UiCssBoxEdges.create("0.1rem 0.5rem 0 0"));
	}
	var nameBreadcrumbWrapper = nameCellWrapper.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	nameBreadcrumbWrapper.setDirection(oFF.UiFlexDirection.COLUMN);
	nameBreadcrumbWrapper.useMaxWidth();
	var namelLbl = nameBreadcrumbWrapper.addNewItemOfType(oFF.UiType.LABEL);
	namelLbl.setText(this.getRecentFileName(recentFile));
	nameCellWrapper.setCustomObject(namelLbl);
	if (this.getFeatureManager().isSacIntegration())
	{
		this.generateAncestorPathsIfNecessary(nameBreadcrumbWrapper, recentFile);
	}
	return nameCellWrapper;
};
oFF.AuGdsQbLandingPage.prototype.generateAncestorPathsIfNecessary = function(nameCellWrapper, recentFile)
{
	var ancestorList = recentFile.getAttributes().getListByKey(oFF.FileAttributeType.ANCESTOR_RESOURCE.getName());
	if (oFF.notNull(ancestorList) && ancestorList.hasElements())
	{
		var ancestorsBreadcrumbs = nameCellWrapper.addNewItemOfType(oFF.UiType.BREADCRUMBS);
		ancestorsBreadcrumbs.addCssClass("ffGdsQbLandingPageRecentFileBreadcrumbs");
		ancestorsBreadcrumbs.useMaxWidth();
		ancestorsBreadcrumbs.setMargin(oFF.UiCssBoxEdges.create("0.325rem 0"));
		oFF.XCollectionUtils.forEach(ancestorList,  function(ancestor){
			if (ancestor.isStructure())
			{
				var ancestorStruct = ancestor.asStructure();
				if (ancestorStruct.hasElements())
				{
					var newAncestorLink = ancestorsBreadcrumbs.addNewLink();
					newAncestorLink.setText(ancestorStruct.getStringByKey(oFF.FileAttributeType.DISPLAY_NAME.getName()));
					newAncestorLink.setTarget("_self");
					var resUid = ancestorStruct.getStringByKey(oFF.FileAttributeType.UNIQUE_ID.getName());
					var linkUrl = "/sap/fpa/ui/app.html#/files&/f/myfiles";
					if (oFF.XStringUtils.isNotNullAndNotEmpty(resUid) && !oFF.XString.isEqual(oFF.XString.toLowerCase(resUid), "myfiles"))
					{
						linkUrl = oFF.XStringUtils.concatenate3(linkUrl, "/", resUid);
					}
					newAncestorLink.setSrc(linkUrl);
				}
			}
		}.bind(this));
	}
};
