oFF.AuGdsQbInteractiveTableView.prototype.setupTableRendererWithDefinition = function(queryManager)
{
	if (oFF.notNull(queryManager))
	{
		var interopTableDefinition = queryManager.getQueryModel().getVisualizationManager().getVisualizationDefinitionByName(oFF.AuGdsConstants.INTEROP_TABLE_DEFINITION);
		if (oFF.notNull(interopTableDefinition))
		{
			this.m_tableDefinition = interopTableDefinition;
		}
		else
		{
			this.m_tableDefinition = queryManager.getQueryModel().getVisualizationManager().getOrCreateVisualisationDefinition(this.getUuid(), oFF.ProtocolBindingType.SAC_TABLE_GRID, oFF.SemanticBindingType.TABLE);
		}
		this.m_tableDefinition.getApplicationSettings().setUserProfile(this.getParentDocument().getProcess().getUserProfile());
		var defaultSettings = this.getParentDocument().getDefaultSettings();
		if (oFF.notNull(defaultSettings))
		{
			var defaultFreezeTableTitle = defaultSettings.getBooleanByKeyExt(oFF.AuGdsConstants.DEFAULT_SETTINGS_FREEZE_TABLE_HEADERS, false);
			this.m_tableDefinition.setFreezeHeaderRows(defaultFreezeTableTitle);
		}
		if (oFF.notNull(this.m_stashedTableCfgJson) && oFF.notNull(this.m_tableDefinition))
		{
			this.setTableDefinitionFromStructure(this.m_stashedTableCfgJson);
			this.m_stashedTableCfgJson = null;
		}
	}
};
