oFF.AuGdsQbInteractiveTableView.prototype.reRenderTitleAndGenericSettings = function(fullReRender)
{
	this.m_tableDefinition.getApplicationSettings().setWidgetWidth(this.m_sacTable.getOffsetWidth());
	this.m_tableDefinition.getApplicationSettings().setWidgetHeight(this.m_sacTable.getOffsetHeight());
	if (this.isSyncActionProcessing() || this.hasPendingGeneralUpdates())
	{
		if (fullReRender)
		{
			this.m_pendingFullTableReRendering = true;
		}
		else
		{
			this.m_pendingTableReConfiguration = true;
		}
	}
	else
	{
		this.setBusy(true);
		var modelJson = this.m_renderer.reFormat(this.m_tableDefinition.getActiveVisualizationContainer(), fullReRender);
		if (oFF.XCollectionUtils.hasElements(modelJson))
		{
			this.m_sacTable.setModelJson(modelJson);
		}
		else
		{
			this.setBusy(false);
		}
	}
};
