{
	if (active)
	{
		this.getQueryManager().getConvenienceCommands().setUniversalDisplayHierarchy(this.getQueryManager().getQueryModel().getAxis(axisType).getDimensionNames().createListOfStringCopy(), -1, true);
	}
	else
	{
		this.getQueryManager().getQueryModel().getUniversalDisplayHierarchies().getByAxisType(axisType).setActive(false);
	}
	this.updateQueryResultSet();
};
oFF.AuGdsQbInteractiveTableView.prototype.processSelectionChangeEvent = function(event)
{
	this.m_selectionString = event.getParameters().getStringByKey(oFF.UiControlEvent.PARAM_SELECTION_AREA);
	this.processSelection();
};
oFF.AuGdsQbInteractiveTableView.prototype.processSelection = function()
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_selectionString))
	{
		var selectionElement = oFF.JsonParserFactory.createFromString(this.m_selectionString);
		if (!this.trySetupSelection(selectionElement))
		{
			this.m_columnMax = -1;
			this.m_rowMax = -1;
		}
	}
	else
	{
		this.m_columnMax = -1;
		this.m_rowMax = -1;
		this.resetSelectionStructure();
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.trySetupSelection = function(selectionElement)
{
	this.m_currentSelectionElement = selectionElement;
	var success = false;
	this.resetSelectionStructure();
	if (oFF.notNull(selectionElement))
	{
		if (selectionElement.isStructure())
		{
			this.analyseSelectionStructure(selectionElement.asStructure());
			success = true;
		}
		else if (selectionElement.isList())
		{
			var selectionList = selectionElement.asList();
			if (oFF.XCollectionUtils.hasElements(selectionList))
			{
				this.m_isMultiSelectWithGaps = selectionList.size() > 1;
				for (var i = 0; i < selectionList.size(); i++)
				{
					this.analyseSelectionStructure(selectionList.getStructureAt(i));
				}
				if (this.m_isMultiSelectWithGaps)
				{
					this.m_selectedMeasure = null;
					this.m_selectedSecondaryStructureMember = null;
					this.m_selectedDocumentId = null;
					this.m_selectedRowTupleIndex = -1;
					this.m_selectedColumnTupleIndex = -1;
				}
				success = true;
			}
		}
		oFF.XObjectExt.release(this.m_tableSelectionContext);
		this.m_tableSelectionContext = this.getParentDocument().getBasicContextForMenu();
		var columnContext = this.m_tableSelectionContext.addSubContext();
		if (this.m_onHeaderColumns)
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_HEADER);
		}
		else if (this.m_onDataColumns)
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_DATA);
		}
		else
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_OTHER);
		}
		columnContext.setCustomObject(oFF.XIntegerValue.create(this.m_columnMax));
		var rowContext = this.m_tableSelectionContext.addSubContext();
		if (this.m_onHeaderRows)
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_HEADER);
		}
		else if (this.m_onDataRows)
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_DATA);
		}
		else
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_OTHER);
		}
		rowContext.setCustomObject(oFF.XIntegerValue.create(this.m_rowMax));
		if (this.m_onDataRows && this.m_onDataColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_DATA_CELLS);
		}
		else if (this.m_onHeaderRows && this.m_onDataColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_MEMBER_HEADERS);
		}
		else if (this.m_onDataRows && this.m_onHeaderColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_ROWS_MEMBER_HEADERS);
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_columnDimensionsAllSelected))
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_DIMENSION_HEADERS);
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_rowDimensionsAllSelected))
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_ROWS_DIMENSION_HEADERS);
		}
		var queryModel = this.getQueryManager().getQueryModel();
		if (oFF.XCollectionUtils.hasElements(this.m_columnDimensionsAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_columnDimensionsAllSelected, this.m_columnDimensionsAllSelected.size() > this.m_columnDimensionsLastSelected.size());
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_rowDimensionsAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_rowDimensionsAllSelected, this.m_rowDimensionsAllSelected.size() > this.m_rowDimensionsLastSelected.size());
		}
		if (oFF.XCollectionUtils.hasElements(this.m_rowTuplesAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendTupleContext(this.m_tableSelectionContext, queryModel, this.m_rowTuplesAllSelected, this.m_rowTuplesAllSelected.size() > this.m_rowTuplesLastSelected.size(), true);
		}
		if (oFF.XCollectionUtils.hasElements(this.m_columnTuplesAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendTupleContext(this.m_tableSelectionContext, queryModel, this.m_columnTuplesAllSelected, this.m_columnTuplesAllSelected.size() > this.m_columnTuplesLastSelected.size(), false);
		}
		oFF.AuGdsQbSubContextFillerUtil.extendMemberContext(this.m_tableSelectionContext, queryModel, this.m_membersAllSelected, this.m_membersAllSelected.size() > this.m_membersLastSelected.size());
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getVersionDimension(), this.m_tableSelectionContext, this.m_versionMembersAllSelected, this.m_versionMembersAllSelected.size() > this.m_versionMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_SINGLE, oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_MULTI_GAPS);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getAccountDimension(), this.m_tableSelectionContext, this.m_accountMembersAllSelected, this.m_accountMembersAllSelected.size() > this.m_accountMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_MULTI_GAPS);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getNonMeasureDimension(), this.m_tableSelectionContext, this.m_secondaryStructureMembersAllSelected, this.m_secondaryStructureMembersAllSelected.size() > this.m_secondaryStructureMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_GAPS);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getMeasureDimension(), this.m_tableSelectionContext, this.m_measureMembersAllSelected, this.m_measureMembersAllSelected.size() > this.m_measureMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_GAPS);
		if (oFF.notNull(this.m_rowTuplesAllSelected) && this.m_rowTuplesAllSelected.size() === 1 && oFF.notNull(this.m_columnTuplesAllSelected) && this.m_columnTuplesAllSelected.size() === 1 && oFF.notNull(this.m_selectedDocumentId))
		{
			var subContext = this.m_tableSelectionContext.addSubContext();
			subContext.setType(oFF.AuGdsContextConstants.OLAP_DATA_CELL_DOCUMENT_ID);
			subContext.setCustomObject(oFF.XStringValue.create(this.m_selectedDocumentId));
		}
		oFF.AuGdsQbSubContextFillerUtil.extendAttributeAndFieldContext(this.m_tableSelectionContext, queryModel, this.m_attributesAllSelected, this.m_attributesLastSelected, this.m_fieldsAllSelected, this.m_fieldsAllSelected.size() > this.m_fieldsLastSelected.size());
	}
	return success;
};
oFF.AuGdsQbInteractiveTableView.prototype.analyseSelectionStructure = function(selectionStructure)
{
	var startCol = selectionStructure.getIntegerByKey(oFF.SacTableConstants.CCD_N_START_COL);
	var endCol = selectionStructure.getIntegerByKey(oFF.SacTableConstants.CCD_N_END_COL);
	var startRow = selectionStructure.getIntegerByKey(oFF.SacTableConstants.CCD_N_START_ROW);
	var endRow = selectionStructure.getIntegerByKey(oFF.SacTableConstants.CCD_N_END_ROW);
	this.m_columnMin = oFF.XMath.min(startCol, endCol);
	this.m_columnMax = oFF.XMath.max(startCol, endCol);
	this.m_rowMin = oFF.XMath.min(startRow, endRow);
	this.m_rowMax = oFF.XMath.max(startRow, endRow);
	this.updateSelectionObjects();
};
oFF.AuGdsQbInteractiveTableView.prototype.updateSelectionObjects = function()
{
	if (this.m_rowMax > -1 && this.m_rowMin > -1 && this.m_columnMax > -1 && this.m_columnMin > -1)
	{
		var resolver = this.m_sacTable.getCustomObject();
		if (oFF.notNull(resolver))
		{
			this.m_onEmptyHeaderSection = this.m_onEmptyHeaderSection && resolver.isEmptyHeaderCell(this.m_columnMax, this.m_rowMax);
			this.m_onHeaderRows = this.m_onHeaderRows || resolver.isOnHeaderRow(this.m_rowMax);
			this.m_onHeaderColumns = this.m_onHeaderColumns || resolver.isOnHeaderColumn(this.m_columnMax);
			this.m_onDataRows = this.m_onDataRows || resolver.isOnDataRow(this.m_rowMin);
			this.m_onDataColumns = this.m_onDataColumns || resolver.isOnDataColumn(this.m_columnMin);
			this.m_columnDimensionsLastSelected = resolver.getColumnDimensions(this.m_rowMin, this.m_rowMax);
			this.m_columnDimensionsAllSelected.addAll(this.m_columnDimensionsLastSelected);
			this.m_rowDimensionsLastSelected = resolver.getRowDimensions(this.m_columnMin, this.m_columnMax);
			this.m_rowDimensionsAllSelected.addAll(this.m_rowDimensionsLastSelected);
			this.m_rowTuplesLastSelected = resolver.getRowTuples(this.m_rowMin, this.m_rowMax);
			this.addAllTuplesIfNotContains(this.m_rowTuplesAllSelected, this.m_rowTuplesLastSelected);
			this.m_columnTuplesLastSelected = resolver.getColumnTuples(this.m_columnMin, this.m_columnMax);
			this.addAllTuplesIfNotContains(this.m_columnTuplesAllSelected, this.m_columnTuplesLastSelected);
			this.m_membersLastSelected.clear();
			this.m_measureMembersLastSelected.clear();
			this.m_accountMembersLastSelected.clear();
			this.m_versionMembersLastSelected.clear();
			this.m_secondaryStructureMembersLastSelected.clear();
			this.m_rowTupleElementsLastSelected = resolver.getRowTupleElements(this.m_columnMin, this.m_columnMax, this.m_rowMin, this.m_rowMax);
			this.addAllTupleElementsIfNotContains(this.m_rowTupleElementsAllSelected, this.m_rowTupleElementsLastSelected);
			this.m_columnTupleElementsLastSelected = resolver.getColumnTupleElements(this.m_columnMin, this.m_columnMax, this.m_rowMin, this.m_rowMax);
			this.addAllTupleElementsIfNotContains(this.m_columnTupleElementsAllSelected, this.m_columnTupleElementsLastSelected);
			this.extractMembersFromTupleElements(this.m_rowTupleElementsLastSelected);
			this.extractMembersFromTupleElements(this.m_columnTupleElementsLastSelected);
			if (this.m_onDataColumns && this.m_onDataRows)
			{
				this.extractStructureMembersFromTuples(this.m_rowTuplesLastSelected);
				this.extractStructureMembersFromTuples(this.m_columnTuplesLastSelected);
			}
			this.m_membersAllSelected.addAll(this.m_membersLastSelected);
			this.m_measureMembersAllSelected.addAll(this.m_measureMembersLastSelected);
			this.m_accountMembersAllSelected.addAll(this.m_accountMembersLastSelected);
			this.m_versionMembersAllSelected.addAll(this.m_versionMembersLastSelected);
			this.m_secondaryStructureMembersAllSelected.addAll(this.m_secondaryStructureMembersLastSelected);
			this.m_fieldsLastSelected.clear();
			this.m_attributesLastSelected.clear();
			this.m_columnFieldNamesLastSelected = resolver.getColumnTupleFieldNames(this.m_rowMin, this.m_rowMax, true);
			this.m_rowFieldNamesLastSelected = resolver.getRowTupleFieldNames(this.m_columnMin, this.m_columnMax, true);
			var queryModel = this.getQueryManager().getQueryModel();
			if (oFF.XCollectionUtils.hasElements(this.m_columnFieldNamesLastSelected))
			{
				this.processFieldsAndAttributes(this.m_columnFieldNamesLastSelected, queryModel);
			}
			else if (oFF.XCollectionUtils.hasElements(this.m_rowFieldNamesLastSelected))
			{
				this.processFieldsAndAttributes(this.m_rowFieldNamesLastSelected, queryModel);
			}
			this.m_fieldsAllSelected.addAll(this.m_fieldsLastSelected);
			this.m_attributesAllSelected.addAll(this.m_attributesLastSelected);
			this.m_selectedColumnTupleFieldName = resolver.getColumnTupleFieldName(this.m_rowMax);
			this.m_selectedRowTupleFieldName = resolver.getRowTupleFieldName(this.m_columnMax);
			this.m_selectedMeasure = null;
			this.m_selectedSecondaryStructureMember = null;
			this.m_selectedDocumentId = null;
			this.m_selectedRowTupleIndex = -1;
			this.m_selectedColumnTupleIndex = -1;
			var structureMember;
			if (oFF.XCollectionUtils.hasElements(this.m_rowTuplesLastSelected) && this.m_rowTuplesLastSelected.size() === 1)
			{
				structureMember = this.getStructureMember(this.m_rowTuplesLastSelected.get(0));
				if (oFF.notNull(structureMember) && structureMember.getDimension().isMeasureStructure())
				{
					this.m_selectedMeasure = structureMember;
				}
				else
				{
					this.m_selectedSecondaryStructureMember = structureMember;
				}
			}
			if (oFF.XCollectionUtils.hasElements(this.m_columnTuplesLastSelected) && this.m_columnTuplesLastSelected.size() === 1)
			{
				structureMember = this.getStructureMember(this.m_columnTuplesLastSelected.get(0));
				if (oFF.notNull(structureMember) && structureMember.getDimension().isMeasureStructure())
				{
					this.m_selectedMeasure = structureMember;
				}
				else
				{
					this.m_selectedSecondaryStructureMember = structureMember;
				}
			}
			if (this.m_rowMax === this.m_rowMin && this.m_columnMax === this.m_columnMin)
			{
				this.m_selectedDocumentId = resolver.getDocumentId(this.m_columnMax, this.m_rowMax);
				this.m_selectedRowTupleIndex = resolver.getRowTupleIndex(this.m_rowMax);
				this.m_selectedColumnTupleIndex = resolver.getColumnTupleIndex(this.m_columnMax);
			}
			this.m_numberOfSelectedCells = (this.m_rowMax + 1 - this.m_rowMin) * (this.m_columnMax + 1 - this.m_columnMin) + this.m_numberOfSelectedCells;
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processFieldsAndAttributes = function(fieldNamesLastSelected, queryModel)
{
	for (var i = 0; i < fieldNamesLastSelected.size(); i++)
	{
		var fieldName = fieldNamesLastSelected.get(i);
		var field = queryModel.getFieldByName(fieldName);
		if (oFF.notNull(field))
		{
			this.m_fieldsLastSelected.add(field);
			var attribute = field.getAttribute();
			if (field.getDimension().getFieldLayoutType() !== oFF.FieldLayoutType.FIELD_BASED && oFF.notNull(attribute))
			{
				this.m_attributesLastSelected.add(attribute);
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.extractStructureMembersFromTuples = function(tuplesLastSelected)
{
	for (var i = 0; i < tuplesLastSelected.size(); i++)
	{
		var tuple = tuplesLastSelected.get(i);
		for (var j = 0; j < tuple.size(); j++)
		{
			var tupleElement = tuple.getTupleElementAt(j);
			var member = tupleElement.getDimensionMember();
			var dimension = this.getQueryManager().getQueryModel().getDimensionByName(tupleElement.getDimension().getName());
			this.extractStructureMember(dimension, member);
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.extractMembersFromTupleElements = function(tupleElementsLastSelected)
{
	for (var i = 0; i < tupleElementsLastSelected.size(); i++)
	{
		var tupleElement = tupleElementsLastSelected.get(i);
		var member = tupleElement.getDimensionMember();
		if (member.getMemberType().isTypeOf(oFF.MemberType.RESULT))
		{
			continue;
		}
		var dimension = this.getQueryManager().getQueryModel().getDimensionByName(tupleElement.getDimension().getName());
		this.extractStructureMember(dimension, member);
		this.m_membersLastSelected.add(member);
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.extractStructureMember = function(dimension, member)
{
	var structureMember;
	if (dimension.getDimensionType() === oFF.DimensionType.MEASURE_STRUCTURE)
	{
		structureMember = dimension.getStructureMember(member.getName());
		oFF.XCollectionUtils.addIfNotNull(this.m_measureMembersLastSelected, structureMember);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.SECONDARY_STRUCTURE)
	{
		structureMember = dimension.getStructureMember(member.getName());
		oFF.XCollectionUtils.addIfNotNull(this.m_secondaryStructureMembersLastSelected, structureMember);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.ACCOUNT)
	{
		structureMember = dimension.getStructureMember(member.getName());
		if (oFF.notNull(structureMember))
		{
			this.m_accountMembersLastSelected.add(structureMember);
		}
		else
		{
			this.m_accountMembersLastSelected.add(member);
		}
	}
	else if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.GENERAL_VERSION))
	{
		structureMember = dimension.getStructureMember(member.getName());
		if (oFF.notNull(structureMember))
		{
			this.m_versionMembersLastSelected.add(structureMember);
		}
		else
		{
			this.m_versionMembersLastSelected.add(member);
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.addAllTupleElementsIfNotContains = function(receivingCollection, toAdd)
{
	if (oFF.XCollectionUtils.hasElements(toAdd))
	{
		for (var i = 0; i < toAdd.size(); i++)
		{
			var element = toAdd.get(i);
			if (!receivingCollection.contains(element))
			{
				receivingCollection.add(element);
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.addAllTuplesIfNotContains = function(receivingCollection, toAdd)
{
	if (oFF.XCollectionUtils.hasElements(toAdd))
	{
		for (var i = 0; i < toAdd.size(); i++)
		{
			var element = toAdd.get(i);
			if (!receivingCollection.contains(element))
			{
				receivingCollection.add(element);
			}
		}
	}
};
