oFF.AuGdsQbInteractiveTableView.prototype.onTableDragAndDrop = function(event)
{
	var parameters = event.getParameters();
	var sourceColumn = parameters.getIntegerByKeyExt(oFF.UiControlEvent.PARAM_SOURCE_COLUMN, -1);
	var sourceRow = parameters.getIntegerByKeyExt(oFF.UiControlEvent.PARAM_SOURCE_ROW, -1);
	var targetColumn = parameters.getIntegerByKeyExt(oFF.UiControlEvent.PARAM_TARGET_COLUMN, -1);
	var targetRow = parameters.getIntegerByKeyExt(oFF.UiControlEvent.PARAM_TARGET_ROW, -1);
	var beforeCell = parameters.getBooleanByKey(oFF.UiControlEvent.PARAM_PLACED_BEFORE_CELL);
	var resolver = event.getControl().getCustomObject();
	var queryModel = this.getQueryManager().getQueryModel();
	var sourceFieldName = this.getFieldName(resolver, sourceColumn, sourceRow);
	var targetFieldName = this.getFieldName(resolver, targetColumn, targetRow);
	var sourceField = queryModel.getFieldByName(sourceFieldName);
	var targetField = queryModel.getFieldByName(targetFieldName);
	var targetAxisType = resolver.getTargetDropAxisType(targetColumn, targetRow);
	if (oFF.notNull(sourceField) && oFF.notNull(targetField))
	{
		var sourceDimension = sourceField.getDimension();
		var targetDimension = targetField.getDimension();
		var sourceAxis = sourceDimension.getAxis();
		var targetAxis = targetDimension.getAxis();
		if (sourceDimension === targetDimension)
		{
			this.moveFields(beforeCell, sourceField, targetField, sourceDimension);
		}
		else if (sourceAxis === targetAxis && beforeCell && sourceAxis.getIndex(targetDimension) === sourceAxis.getIndex(sourceDimension) + 1)
		{
			this.moveFieldToEnd(sourceField, sourceDimension);
		}
		else if (sourceAxis === targetAxis && !beforeCell && sourceAxis.getIndex(targetDimension) === sourceAxis.getIndex(sourceDimension) - 1)
		{
			this.moveFieldToStart(sourceField, sourceDimension);
		}
		else
		{
			this.moveDimensions(beforeCell, sourceDimension, targetDimension);
		}
	}
	else if (oFF.notNull(sourceField) && oFF.notNull(targetAxisType))
	{
		this.getQueryManager().getConvenienceCommands().moveDimensionToAxis(sourceField.getDimension().getName(), targetAxisType);
		this.updateQueryResultSet();
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.moveFields = function(beforeCell, sourceField, targetField, sourceDimension)
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	var sourceDimensionName = sourceDimension.getName();
	var sourceFieldName = sourceField.getName();
	var targetIndex;
	if (sourceDimension.getFieldLayoutType() === oFF.FieldLayoutType.ATTRIBUTE_BASED)
	{
		var sourceAttribute = sourceField.getAttribute();
		var targetAttribute = targetField.getAttribute();
		var rsAttributes = sourceDimension.getResultSetAttributes();
		var sourceRsFields = sourceAttribute.getResultSetFields();
		var sourceAttributeName = sourceAttribute.getName();
		if (sourceAttribute === targetAttribute)
		{
			if (sourceField !== targetField && sourceRsFields.getIndex(targetField) > -1)
			{
				cmd.removeAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
				targetIndex = sourceRsFields.getIndex(targetField) + (beforeCell ? 0 : 1);
				cmd.insertAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET, targetIndex);
			}
		}
		else if (beforeCell && rsAttributes.getIndex(sourceAttribute) === rsAttributes.getIndex(targetAttribute) - 1)
		{
			cmd.removeAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
			cmd.addAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
		}
		else if (!beforeCell && rsAttributes.getIndex(sourceAttribute) === rsAttributes.getIndex(targetAttribute) + 1)
		{
			cmd.removeAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
			cmd.insertAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET, 0);
		}
		else
		{
			if (sourceAttribute !== targetAttribute && rsAttributes.getIndex(targetAttribute) > -1)
			{
				cmd.removeAttributeFromResultSet(sourceDimensionName, sourceAttributeName);
				targetIndex = rsAttributes.getIndex(targetAttribute) + (beforeCell ? 0 : 1);
				cmd.insertAttributeToResultSet(sourceDimensionName, sourceAttributeName, targetIndex);
			}
		}
	}
	else
	{
		var rsFields = sourceDimension.getResultSetFields();
		var sourceMainAttributeField = sourceField.getAttribute() !== sourceDimension.getMainAttribute() || sourceField !== sourceDimension.getKeyField() && sourceField !== sourceDimension.getTextField();
		var targetMainAttributeField = targetField.getAttribute() !== sourceDimension.getMainAttribute() || targetField !== sourceDimension.getKeyField() && targetField !== sourceDimension.getTextField();
		if (targetMainAttributeField === sourceMainAttributeField)
		{
			if (sourceField !== targetField && rsFields.getIndex(targetField) > -1)
			{
				cmd.removeField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
				targetIndex = rsFields.getIndex(targetField) + (beforeCell ? 0 : 1);
				cmd.insertField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET, targetIndex);
			}
		}
		else
		{
			cmd.removeField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
			targetIndex = oFF.AuGdsQbInteractiveTableView.getFirstNonMainAttributeFieldIndex(sourceDimension, rsFields);
			cmd.insertField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET, targetIndex);
		}
	}
	this.updateQueryResultSet();
};
oFF.AuGdsQbInteractiveTableView.prototype.moveAttributes = function(beforeCell, sourceAttribute, targetField, sourceDimension)
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	var sourceDimensionName = sourceDimension.getName();
	var targetIndex;
	if (sourceDimension.getFieldLayoutType() === oFF.FieldLayoutType.ATTRIBUTE_BASED)
	{
		var targetAttribute = targetField.getAttribute();
		var rsAttributes = sourceDimension.getResultSetAttributes();
		var sourceAttributeName = sourceAttribute.getName();
		if (sourceAttribute !== targetAttribute && rsAttributes.getIndex(targetAttribute) > -1)
		{
			cmd.removeAttributeFromResultSet(sourceDimensionName, sourceAttributeName);
			targetIndex = rsAttributes.getIndex(targetAttribute) + (beforeCell ? 0 : 1);
			cmd.insertAttributeToResultSet(sourceDimensionName, sourceAttributeName, targetIndex);
		}
	}
	this.updateQueryResultSet();
};
oFF.AuGdsQbInteractiveTableView.prototype.moveFieldToEnd = function(sourceField, sourceDimension)
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	var sourceFieldName = sourceField.getName();
	var sourceDimensionName = sourceDimension.getName();
	if (sourceDimension.getFieldLayoutType() === oFF.FieldLayoutType.ATTRIBUTE_BASED)
	{
		var sourceAttribute = sourceField.getAttribute();
		var sourceAttributeName = sourceAttribute.getName();
		if (sourceAttribute !== sourceDimension.getMainAttribute())
		{
			cmd.removeAttributeFromResultSet(sourceDimensionName, sourceAttributeName);
			cmd.addAttributeToResultSet(sourceDimensionName, sourceAttributeName);
		}
		cmd.removeAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
		cmd.addAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
	}
	else
	{
		cmd.removeField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
		var rsFields = sourceDimension.getResultSetFields();
		if (sourceField.getAttribute() !== sourceDimension.getMainAttribute() || sourceField !== sourceDimension.getKeyField() && sourceField !== sourceDimension.getTextField())
		{
			cmd.addFieldToResultSet(sourceDimensionName, sourceFieldName);
		}
		else
		{
			var targetIndex = oFF.AuGdsQbInteractiveTableView.getFirstNonMainAttributeFieldIndex(sourceDimension, rsFields);
			cmd.insertField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET, targetIndex);
		}
	}
	this.updateQueryResultSet();
};
oFF.AuGdsQbInteractiveTableView.prototype.moveFieldToStart = function(sourceField, sourceDimension)
{
	var cmd = this.getQueryManager().getConvenienceCommands();
	var sourceFieldName = sourceField.getName();
	var sourceDimensionName = sourceDimension.getName();
	var targetIndex;
	if (sourceDimension.getFieldLayoutType() === oFF.FieldLayoutType.ATTRIBUTE_BASED)
	{
		var sourceAttribute = sourceField.getAttribute();
		var sourceAttributeName = sourceAttribute.getName();
		if (sourceAttribute !== sourceDimension.getMainAttribute())
		{
			cmd.removeAttributeFromResultSet(sourceDimensionName, sourceAttributeName);
			var rsAttributes = sourceDimension.getResultSetAttributes();
			targetIndex = rsAttributes.get(0) === sourceDimension.getMainAttribute() ? 1 : 0;
			cmd.insertAttributeToResultSet(sourceDimensionName, sourceAttributeName, targetIndex);
		}
		cmd.removeAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
		cmd.insertAttributeField(null, sourceDimensionName, sourceAttributeName, null, sourceFieldName, oFF.QContextType.RESULT_SET, 0);
	}
	else
	{
		var rsFields = sourceDimension.getResultSetFields();
		rsFields.removeElement(sourceField);
		cmd.removeField(null, sourceDimensionName, null, sourceFieldName, oFF.QContextType.RESULT_SET);
		if (sourceField.getAttribute() !== sourceDimension.getMainAttribute() || sourceField !== sourceDimension.getKeyField() && sourceField !== sourceDimension.getTextField())
		{
			targetIndex = oFF.AuGdsQbInteractiveTableView.getFirstNonMainAttributeFieldIndex(sourceDimension, rsFields);
			cmd.insertField(null, sourceFieldName, null, sourceFieldName, oFF.QContextType.RESULT_SET, targetIndex);
		}
		else
		{
			cmd.addFieldToResultSet(sourceDimensionName, sourceFieldName);
		}
	}
	this.updateQueryResultSet();
};
oFF.AuGdsQbInteractiveTableView.prototype.moveDimensions = function(beforeCell, sourceDimension, targetDimension)
{
	var targetAxis = targetDimension.getAxis();
	var cmd = this.getQueryManager().getConvenienceCommands();
	if (sourceDimension !== targetDimension && targetAxis.getIndex(targetDimension) > -1)
	{
		cmd.moveDimensionToFree(sourceDimension.getName());
		sourceDimension.getAxis().removeElement(sourceDimension);
		var targetIndex = targetAxis.getIndex(targetDimension) + (beforeCell ? 0 : 1);
		cmd.moveDimensionOnAxisTo(sourceDimension.getName(), targetAxis.getType(), targetIndex);
		this.updateQueryResultSet();
	}
};
