oFF.AuGdsQbInteractiveTableView.prototype.onScrollLoad = function(event)
{
	var scrollTopRaw = event.getParameters().getIntegerByKeyExt(oFF.UiControlEvent.PARAM_SCROLL_TOP, -1);
	var totalHeightRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_TOTAL_HEIGHT);
	var widgetHeightRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_WIDGET_HEIGHT);
	var rowsTotalCount = this.getRowsCountTotal();
	var scrollLeftRaw = event.getParameters().getIntegerByKeyExt(oFF.UiControlEvent.PARAM_SCROLL_LEFT, -1);
	var totalWidthRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_TOTAL_WIDTH);
	var widgetWidthRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_WIDGET_WIDTH);
	var columnsTotalCount = oFF.XMath.min(this.getColumnsCountTotal(), this.getColumnsMaxLoad());
	if (scrollTopRaw > -1 || this.isHorizontalLazyLoad() && scrollLeftRaw > -1)
	{
		var rowScrollReferencePoint = this.m_rowScrollReferencePoint;
		var rowScrollEndReferencePoint = this.m_rowScrollEndReferencePoint;
		if (scrollTopRaw > -1)
		{
			var totalHeight = oFF.XMath.div(totalHeightRaw, 1000) + 1;
			var scrollTop = oFF.XMath.div(scrollTopRaw, 1000);
			var scrollTopEnd = oFF.XMath.div(scrollTopRaw + widgetHeightRaw, 1000) + 2;
			rowScrollReferencePoint = oFF.XMath.div(rowsTotalCount * scrollTop, totalHeight);
			rowScrollEndReferencePoint = oFF.XMath.div(rowsTotalCount * scrollTopEnd, totalHeight) + 1;
		}
		var colScrollReferencePoint = this.m_colScrollReferencePoint;
		var colScrollEndReferencePoint = this.m_colScrollEndReferencePoint;
		if (this.isHorizontalLazyLoad() && scrollLeftRaw > -1)
		{
			var totalWidth = oFF.XMath.div(totalWidthRaw, 1000) + 1;
			var scrollLeft = oFF.XMath.div(scrollLeftRaw, 1000);
			var scrollLeftEnd = oFF.XMath.div(scrollLeftRaw + widgetWidthRaw, 1000) + 2;
			colScrollReferencePoint = oFF.XMath.div(columnsTotalCount * scrollLeft, totalWidth);
			colScrollEndReferencePoint = oFF.XMath.div(columnsTotalCount * scrollLeftEnd, totalWidth) + 1;
		}
		var rowScrollDifference = rowScrollReferencePoint - this.m_rowScrollReferencePoint;
		var colScrollDifference = colScrollReferencePoint - this.m_colScrollReferencePoint;
		var rowScrollTolerance = oFF.XMath.div(this.getRowsWindowSize(), 2);
		var colScrollTolerance = oFF.XMath.div(this.getColumnsWindowSize(), 2);
		if (rowScrollDifference > rowScrollTolerance || rowScrollDifference < -rowScrollTolerance || colScrollDifference > colScrollTolerance || colScrollDifference < -colScrollTolerance)
		{
			this.reschedulePendingScrollInternal(rowScrollReferencePoint, rowScrollEndReferencePoint, colScrollReferencePoint, colScrollEndReferencePoint);
			this.m_sacTable.setModelJson(this.m_renderer.reFormat(this.m_tableDefinition.getActiveVisualizationContainer(), false));
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.reschedulePendingScroll = function()
{
	this.reschedulePendingScrollInternal(this.m_rowScrollReferencePoint, this.m_rowScrollEndReferencePoint, this.m_colScrollReferencePoint, this.m_colScrollEndReferencePoint);
};
oFF.AuGdsQbInteractiveTableView.prototype.reschedulePendingScrollInternal = function(rowScrollReferencePoint, rowScrollEndReferencePoint, colScrollReferencePoint, colScrollEndReferencePoint)
{
	if (this.getQueryManager().getActiveResultSetContainer().getSyncState().isInSync())
	{
		var tableObject = this.m_tableDefinition.getActiveVisualizationContainer().getVisualizationData();
		var parentDocument = this.getParentDocument();
		var queryController = parentDocument.getQueryController();
		var dataRowsCountTotal = this.getDataRowsCountTotal();
		var dataColsCountTotal = oFF.XMath.min(this.getDataColumnsCountTotal(), this.getColumnsMaxLoad());
		var rowsWindowSize = this.getRowsWindowSize();
		var colsWindowSize = this.getColumnsWindowSize();
		this.m_pendingRowScrollPoint = -1;
		this.m_pendingRowScrollPointEnd = -1;
		this.m_pendingColScrollPoint = -1;
		this.m_pendingColScrollPointEnd = -1;
		var newMinOrigRow = oFF.XMath.max(0, rowScrollReferencePoint - rowsWindowSize * 2);
		var newMaxOrigRow = oFF.XMath.min(dataRowsCountTotal - 1, rowScrollEndReferencePoint + rowsWindowSize * 2);
		var newMinOrigCol = oFF.XMath.max(0, colScrollReferencePoint - colsWindowSize * 2);
		var newMaxOrigCol = oFF.XMath.min(dataColsCountTotal - 1, colScrollEndReferencePoint + colsWindowSize * 2);
		var newMinRow = tableObject.getIndexOfFirstIncompleteTileRowAfter(newMinOrigCol, newMaxOrigCol, newMinOrigRow, newMaxOrigRow);
		var newMaxRow = tableObject.getIndexOfLastIncompleteTileRowBefore(newMinOrigCol, newMaxOrigCol, newMinOrigRow, newMaxOrigRow);
		var defaultRowsWindowSize = this.getDefaultRowsWindowSize();
		var defaultColsWindowSize = this.getDefaultColumnsWindowSize();
		var horizontalLazyLoad = this.isHorizontalLazyLoad();
		var newMinCol = 0;
		var newMaxCol = defaultColsWindowSize - 1;
		if (horizontalLazyLoad)
		{
			newMinCol = tableObject.getIndexOfFirstIncompleteTileColumnAfter(newMinOrigCol, newMaxOrigCol, newMinOrigRow, newMaxOrigRow);
			newMaxCol = tableObject.getIndexOfLastIncompleteTileColumnBefore(newMinOrigCol, newMaxOrigCol, newMinOrigRow, newMaxOrigRow);
		}
		if (newMaxRow >= newMinRow && newMaxRow - newMinRow < defaultRowsWindowSize)
		{
			if (newMaxRow === newMaxOrigRow)
			{
				newMaxRow = tableObject.getIndexOfLastIncompleteTileRowBefore(newMinCol, newMaxCol, newMinRow, oFF.XMath.min(dataRowsCountTotal - 1, newMinRow + defaultRowsWindowSize));
			}
			if (newMinRow === newMinOrigRow)
			{
				newMinRow = tableObject.getIndexOfFirstIncompleteTileRowAfter(newMinCol, newMaxCol, oFF.XMath.max(0, newMaxRow - defaultRowsWindowSize), newMaxRow);
			}
		}
		if (horizontalLazyLoad && newMaxCol >= newMinCol && newMaxCol - newMinCol < defaultColsWindowSize)
		{
			if (newMaxCol === newMaxOrigCol)
			{
				newMaxCol = tableObject.getIndexOfLastIncompleteTileColumnBefore(newMinCol, oFF.XMath.min(dataColsCountTotal - 1, newMinCol + defaultColsWindowSize), newMinRow, newMaxRow);
			}
			if (newMinCol === newMinOrigCol)
			{
				newMinCol = tableObject.getIndexOfFirstIncompleteTileColumnAfter(oFF.XMath.max(0, newMaxCol - defaultColsWindowSize), newMaxCol, newMinRow, newMaxRow);
			}
		}
		if (newMinRow <= newMaxOrigRow && newMaxRow >= newMinOrigRow && newMinRow <= newMaxRow && newMinRow < dataRowsCountTotal && newMaxRow < dataRowsCountTotal && newMinRow > -1 && newMaxRow > -1 && newMinCol <= newMaxOrigCol && newMaxCol >= newMinOrigCol && newMinCol <= newMaxCol && newMinCol < dataColsCountTotal && newMaxCol < dataColsCountTotal && newMinCol > -1 && newMaxCol > -1)
		{
			var smallWinStartRow = oFF.XMath.max(newMinRow, rowScrollReferencePoint - rowsWindowSize);
			var smallWinEndRow = oFF.XMath.min(newMaxRow, rowScrollEndReferencePoint + rowsWindowSize);
			var smallWinStartCol = oFF.XMath.max(newMinCol, colScrollReferencePoint - colsWindowSize);
			var smallWinEndCol = oFF.XMath.min(newMaxCol, colScrollEndReferencePoint + colsWindowSize);
			if (smallWinEndRow > this.m_scrollWindowMaxRow || smallWinStartRow < this.m_scrollWindowMinRow || smallWinEndCol > this.m_scrollWindowMaxCol || smallWinStartCol < this.m_scrollWindowMinCol)
			{
				this.setBusy(true);
			}
			this.m_rowScrollReferencePoint = rowScrollReferencePoint;
			this.m_rowScrollEndReferencePoint = rowScrollEndReferencePoint;
			this.m_colScrollReferencePoint = colScrollReferencePoint;
			this.m_colScrollEndReferencePoint = colScrollEndReferencePoint;
			if ((!this.hasPendingGeneralUpdates() || smallWinEndRow > this.m_scrollWindowMaxRow || smallWinStartRow < this.m_scrollWindowMinRow || smallWinEndCol > this.m_scrollWindowMaxCol || smallWinStartCol < this.m_scrollWindowMinCol) && (newMaxRow > this.m_scrollWindowMaxRow || newMinRow < this.m_scrollWindowMinRow || newMaxCol > this.m_scrollWindowMaxCol || newMinCol < this.m_scrollWindowMinCol))
			{
				var newMinFinalRow = newMinRow;
				var newMaxFinalRow = newMaxRow;
				var newMinFinalCol = newMinCol;
				var newMaxFinalCol = newMaxCol;
				queryController.executeWindowedRequestIfPossible(newMinRow, newMaxRow, newMinCol, newMaxCol,  function(){
					this.reschedulePendingScroll();
				}.bind(this),  function(){
					this.m_scrollWindowMinRow = newMinFinalRow;
					this.m_scrollWindowMaxRow = newMaxFinalRow;
					this.m_scrollWindowMinCol = newMinFinalCol;
					this.m_scrollWindowMaxCol = newMaxFinalCol;
				}.bind(this));
			}
		}
	}
	else
	{
		this.m_pendingRowScrollPoint = rowScrollReferencePoint;
		this.m_pendingRowScrollPointEnd = rowScrollEndReferencePoint;
		this.m_pendingColScrollPoint = colScrollReferencePoint;
		this.m_pendingColScrollPointEnd = colScrollEndReferencePoint;
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.preloadWindow = function(rowMin, rowMax, colMin, colMax, preloadFinishedProcedure)
{
	var tableObject = this.m_tableDefinition.getActiveVisualizationContainer().getVisualizationData();
	var rowMinEff = oFF.XMath.max(0, rowMin - 1);
	var rowMaxEff = oFF.XMath.min(tableObject.getDataRowsTotalCount(), rowMax + 1);
	var colMinEff = oFF.XMath.max(0, colMin - 1);
	var colMaxEff = oFF.XMath.max(tableObject.getDataColumnsTotalCount(), colMax + 1);
	var newMaxRow = tableObject.getIndexOfLastIncompleteTileRowBefore(colMinEff, colMaxEff, rowMinEff, rowMaxEff);
	var newMinRow = tableObject.getIndexOfFirstIncompleteTileRowAfter(colMinEff, colMaxEff, rowMinEff, rowMaxEff);
	var newMaxCol = tableObject.getIndexOfLastIncompleteTileColumnBefore(colMinEff, colMaxEff, rowMinEff, rowMaxEff);
	var newMinCol = tableObject.getIndexOfFirstIncompleteTileColumnAfter(colMinEff, colMaxEff, rowMinEff, rowMaxEff);
	var needsRequest = newMinCol < newMaxCol && newMinRow < newMaxRow;
	if (needsRequest)
	{
		this.preloadWindowInternal(newMinRow, newMaxRow, newMinCol, newMaxCol, preloadFinishedProcedure);
	}
	else if (oFF.notNull(preloadFinishedProcedure) && oFF.notNull(this.m_tableDefinition))
	{
		var activeTableContainer = this.m_tableDefinition.getActiveTableContainer();
		var resultTable = oFF.isNull(activeTableContainer) ? null : activeTableContainer.getResultTable();
		preloadFinishedProcedure(resultTable);
	}
	return needsRequest;
};
oFF.AuGdsQbInteractiveTableView.prototype.preloadWindowInternal = function(newMinRow, newMaxRow, newMinCol, newMaxCol, preloadFinishedProcedure)
{
	var parentDocument = this.getParentDocument();
	var queryController = parentDocument.getQueryController();
	queryController.executeWindowedRequestIfPossible(newMinRow, newMaxRow, newMinCol, newMaxCol,  function(){
		this.preloadWindowInternal(newMinRow, newMaxRow, newMinCol, newMaxCol, preloadFinishedProcedure);
	}.bind(this),  function(){
		this.m_preloadFinishedProcedure = preloadFinishedProcedure;
	}.bind(this));
};
oFF.AuGdsQbInteractiveTableView.prototype.onRenderingPauseEnd = function()
{
	if (this.m_pendingRowScrollPoint > -1 || this.m_pendingColScrollPoint > -1)
	{
		this.setBusy(true);
		this.m_rowScrollReferencePoint = this.m_pendingRowScrollPoint;
		this.m_rowScrollEndReferencePoint = this.m_pendingRowScrollPointEnd;
		this.m_colScrollReferencePoint = this.m_pendingColScrollPoint;
		this.m_colScrollEndReferencePoint = this.m_pendingColScrollPointEnd;
		this.reschedulePendingScroll();
	}
	else
	{
		this.checkPendingReRendering();
	}
	this.m_pendingRowScrollPoint = -1;
	this.m_pendingRowScrollPointEnd = -1;
	this.m_pendingColScrollPoint = -1;
	this.m_pendingColScrollPointEnd = -1;
};
oFF.AuGdsQbInteractiveTableView.prototype.onResultEmpty = function()
{
	this.renderEmptyTable();
};
oFF.AuGdsQbInteractiveTableView.prototype.checkPendingReRendering = function()
{
	var rerendered = true;
	if (this.m_pendingFullTableReRendering)
	{
		this.setBusy(true);
		this.m_sacTable.setModelJson(this.m_renderer.reFormat(this.m_tableDefinition.getActiveVisualizationContainer(), true));
	}
	else if (this.m_pendingTableReConfiguration)
	{
		this.m_sacTable.setModelJson(this.m_renderer.reFormat(this.m_tableDefinition.getActiveVisualizationContainer(), false));
	}
	else
	{
		rerendered = false;
	}
	this.m_pendingFullTableReRendering = false;
	this.m_pendingTableReConfiguration = false;
	return rerendered;
};
