oFF.AuGdsQuasarDocument.prototype.setDocument = function(docString)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(docString))
	{
		var parser = oFF.JsonParserFactory.newInstance();
		if (oFF.notNull(parser))
		{
			var jsonContent = parser.parse(docString);
			if (oFF.notNull(jsonContent))
			{
				if (parser.hasErrors())
				{
					this.getGenesis().showErrorToast("Document is not a quasar document!");
				}
				else
				{
					oFF.XObjectExt.release(parser);
					if (jsonContent.isStructure())
					{
						this.m_quasarEngine.setDocument(jsonContent);
					}
				}
			}
			else
			{
				this.getGenesis().showErrorToast("Document is not a json!");
			}
		}
	}
	else
	{
		this.getGenesis().showErrorToast("Document is empty!");
	}
};
oFF.AuGdsQuasarDocument.prototype.initQuasarEngineAndGenesis = function()
{
	if (oFF.isNull(this.m_quasarEngine))
	{
		this.m_quasarEngine = oFF.QuasarEngine.create(this.getApplication());
		this.m_quasarEngine.setCustomLoadingText("Rendering...");
	}
	if (oFF.isNull(this.m_quasarEngineGenesis))
	{
		this.m_quasarEngineGenesis = oFF.UiGenesis.create(this.m_appContainer);
	}
};
oFF.AuGdsQuasarDocument.prototype.releaseQuasarEngineAndGenesis = function()
{
	if (oFF.notNull(this.m_quasarEngine))
	{
		this.m_quasarEngine = oFF.XObjectExt.release(this.m_quasarEngine);
	}
	if (oFF.notNull(this.m_quasarEngineGenesis))
	{
		this.m_quasarEngineGenesis = oFF.XObjectExt.release(this.m_quasarEngineGenesis);
	}
};
oFF.AuGdsQuasarDocument.prototype.showAppContainer = function(show)
{
	if (oFF.notNull(this.m_appContainerWrapper))
	{
		this.m_appContainerWrapper.setVisible(show);
		this.m_splitActionBarBtn.setPressed(show);
	}
};
oFF.AuGdsQuasarDocument.prototype.exportToUi5 = function()
{
	this.setStatusInfo("...");
	this.initQuasarEngineAndGenesis();
	this.setDocument(this.m_codeEditor.getText());
	var document = this.m_quasarEngine.getDocument();
	if (oFF.notNull(document))
	{
		var proteusEngine = oFF.AuProteusEngine.createEngine(document);
		proteusEngine.convert();
		if (proteusEngine.hasErrors())
		{
			this.setStatusError(proteusEngine.getParsingErrors().get(0));
		}
		else
		{
			this.saveExport(proteusEngine);
		}
	}
};
oFF.AuGdsQuasarDocument.prototype.saveExport = function(proteusEngine)
{
	var config = oFF.SuResourceExplorerConfigWrapper.create();
	config.setTitle("Select target directory");
	oFF.SuResourceExplorerPromise.selectDirectory(this.getProcess(), config).then( function(directory){
		if (oFF.notNull(directory))
		{
			var projectName = this.getTitle();
			var projectFolderName = oFF.XString.substring(projectName, 0, oFF.XString.indexOf(projectName, ".gdf"));
			var outputPath = oFF.XStringUtils.concatenate5(directory.getUri().getPath(), oFF.XFile.SLASH, projectFolderName, oFF.XFile.SLASH, "index.html");
			var file = oFF.XFile.createWithVars(this.getProcess(), outputPath);
			if (file.hasErrors())
			{
				this.setStatusError(file.getFirstError().getText());
			}
			else
			{
				var contentToSave = oFF.XContent.createStringContent(oFF.ContentType.TEXT, proteusEngine.getCombinedHtmlFileContent());
				oFF.XFilePromise.saveContentRecursive(file, contentToSave).then( function(file1){
					this.setStatusSuccess("Quasar document successfully exported as UI5 app.");
					return file1;
				}.bind(this),  function(errorMsg1){
					this.setStatusError(errorMsg1);
				}.bind(this));
			}
		}
		return directory;
	}.bind(this),  function(errorMsg){
		this.setStatusError(errorMsg);
	}.bind(this));
};
