oFF.AuGdsQueryBuilderDocument.prototype.doInitialSetup = function()
{
	this.m_views = oFF.XHashMapByString.create();
	this.addDocumentFeature(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_MULTI_VIEWS, true);
	this.addDocumentFeature(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_AUTO_OPEN_DATA_SOURCE_PICKER, true);
	this.addDocumentFeature(oFF.AuGdsConstants.PARAM_IMPLICIT_VARIABLE_HANDLING, true);
	this.m_queryController = oFF.AuGdsQbQueryController.create(this);
	this.m_queryController.setImplicitVariableHandling(this.isFeatureEnabled(oFF.AuGdsConstants.PARAM_IMPLICIT_VARIABLE_HANDLING));
	this.m_queryController.setNewQueryManagerReadyConsumer( function(newQm){
		this.handleNewQueryManagerCreated();
	}.bind(this));
	this.m_queryController.setQueryStateChangedConsumer( function(qm){
		this.handleQueryManagerStateChanged();
	}.bind(this));
	this.m_queryController.setBusyStateChangeConsumer( function(qc){
		this.setAllViewsBusy(qc.isBusy());
	}.bind(this));
	this.m_queryController.setMessageConsumer( function(msgType, msg){
		this.handleQueryControllerMessage(msgType, msg);
	}.bind(this));
	this.m_queryController.setStatusChangedConsumer( function(status, message){
		this.handleQueryControllerStatusChanged(status, message);
	}.bind(this));
	this.m_queryController.setSetupStepChangedConsumer( function(setupStep){
		this.handleQueryControllerSetupStepChanged(setupStep);
	}.bind(this));
	this.m_queryController.setSetupInterruptedConsumer( function(interruptReason){
		this.handleQueryControllerSetupInterrupt(interruptReason);
	}.bind(this));
	this.m_panelToggleBtnMap = oFF.XSimpleMap.create();
	this.m_uiStateChangedCallbacks = oFF.XList.create();
	this.m_showFilterLine = true;
};
oFF.AuGdsQueryBuilderDocument.prototype.processArguments = function(documentArguments)
{
	var system = documentArguments.getStringByKeyExt(oFF.AuGdsConstants.PARAM_SYSTEM, null);
	var dataSourceName = documentArguments.getStringByKeyExt(oFF.AuGdsConstants.PARAM_DATASOURCE, null);
	this.m_dataSource = this.createDataSourceBySystemAndName(system, dataSourceName);
	this.m_externalQueryManagerInstance = this.getArgumentsManager().getObjectArgument(oFF.AuGdsConstants.PARAM_QUERY_MANAGER);
};
oFF.AuGdsQueryBuilderDocument.prototype.buildDocumentUi = function(genesis)
{
	this.m_contentLayout = genesis.newRoot(oFF.UiType.FLEX_LAYOUT);
	this.m_contentLayout.setDirection(oFF.UiFlexDirection.ROW);
	this.m_contentLayout.useMaxSpace();
	this.m_contentLayout.setBorderStyle(oFF.UiBorderStyle.SOLID);
	this.m_contentLayout.setBorderWidth(oFF.UiCssBoxEdges.create("1px 0px 0px 0px"));
	this.m_contentLayout.setBorderColor(oFF.UiTheme.getCurrentTheme().getLightGrayColor());
	this.m_viewContainer = this.m_contentLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	this.m_viewContainer.setTag("GDS_VIEW_CONTAINER");
	this.m_viewContainer.addCssClass("ffGdsQbViewContainer");
	this.m_viewContainer.setDirection(oFF.UiFlexDirection.COLUMN);
	this.m_viewContainer.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	this.m_viewContainer.useMaxSpace();
	this.m_viewContainer.setBorderStyle(oFF.UiBorderStyle.SOLID);
	this.m_viewContainer.setBorderWidth(oFF.UiCssBoxEdges.create("0px 1px 0px 1px"));
	this.m_viewContainer.setBorderColor(oFF.UiTheme.getCurrentTheme().getLightGrayColor());
	this.m_viewContainer.setFlex("1 1 100%");
	if (!this.getFeatureManager().isGa())
	{
		this.m_viewContainer.setMinWidth(oFF.UiCssLength.create(oFF.AuGdsQueryBuilderDocument.GDS_QB_VIEW_CONTAINER_MIN_WIDTH));
	}
	this.m_viewContainer.setOverflow(oFF.UiOverflow.HIDDEN);
	this.getPanelController().initialize(this, this.m_contentLayout);
	this.getPanelController().registerOnPanelStateChange( function(uiState){
		oFF.XCollectionUtils.forEach(this.m_uiStateChangedCallbacks,  function(consumer){
			consumer.accept(uiState);
		}.bind(this));
	}.bind(this));
};
oFF.AuGdsQueryBuilderDocument.prototype.handleStartupWithEmptyDocument = function()
{
	if (oFF.notNull(this.m_externalQueryManagerInstance))
	{
		this.markDirty();
		this.m_queryController.initWithExistingQueryManager(this.m_externalQueryManagerInstance);
	}
	else if (oFF.notNull(this.m_dataSource))
	{
		this.markDirty();
		this.m_queryController.setInaRepoJson(null);
		this.m_queryController.setForceInitialVariableDialog(false);
		this.m_queryController.initQueryManagerFromDataSource(this.getApplication(), this.m_dataSource);
	}
	else
	{
		this.showLandingPage(false);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExistingDocContent = function(docContent)
{
	var qbDocContent = docContent;
	var system = qbDocContent.getSystemName();
	var dataSourceName = qbDocContent.getDataSource();
	var inaRepoJson = qbDocContent.getInaRepoStructure();
	this.m_viewsFromFile = qbDocContent.getViews();
	var filterLineConfig = qbDocContent.getFilterLineConfig();
	this.setFilterLineConfig(filterLineConfig);
	var queryDetailsConfig = qbDocContent.getQueryDetailsConfig();
	this.setQueryDetailsConfig(queryDetailsConfig);
	this.m_dataSource = this.createDataSourceBySystemAndName(system, dataSourceName);
	this.m_queryController.setInaRepoJson(inaRepoJson);
	this.m_queryController.setForceInitialVariableDialog(qbDocContent.getForcePrompt());
	this.m_queryController.initQueryManagerFromDataSource(this.getApplication(), this.m_dataSource);
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExternalFileType = function(fileType, fileJson, file)
{
	if (fileType === oFF.AuGdsFileType.INSIGHT)
	{
		this.openInsight(file, fileJson);
	}
	else if (fileType === oFF.AuGdsFileType.MODEL)
	{
		this.openModel(fileJson, file);
	}
	oFF.AuGdsQbExternalConfiguration.getInstance().fireFileLoadedCallback(this, fileType, file);
};
oFF.AuGdsQueryBuilderDocument.prototype.handleNewDocContentLoaded = function()
{
	var loadingText = "Loading document...";
	if (this.getFile() !== null)
	{
		loadingText = oFF.XStringUtils.concatenate2("Loading ", this.getFile().getName());
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getDocumentName()))
	{
		loadingText = oFF.XStringUtils.concatenate2("Loading ", this.getDocumentName());
	}
	this.cleanMainView();
	this.setContentBusy(loadingText);
	this.handleExistingDocContent(this.getDocContent());
};
