oFF.AuGdsQueryBuilderDocument.prototype.updateDocContentForSave = function()
{
	if (this.getQueryManager() !== null)
	{
		var docContent = this.getQueryBuilderDocContent();
		docContent.setSystemName(this.getQueryManager().getQueryModel().getDataSource().getSystemName());
		docContent.setDataSource(this.getQueryManager().getQueryModel().getDataSource().getFullQualifiedName());
		docContent.setInaRepoStructure(this.getQueryManager().getQueryModel().serializeToElement(oFF.QModelFormat.INA_REPOSITORY_DELTA));
		var allViews = oFF.PrFactory.createList();
		oFF.XCollectionUtils.forEach(this.m_views,  function(qbView){
			var viewData = qbView.getViewSaveData();
			var viewSaveStruct = oFF.PrFactory.createStructure();
			viewSaveStruct.put(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_DATA_KEY, viewData);
			viewSaveStruct.putInteger(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_INDEX_KEY, this.getViewIndex(qbView));
			allViews.add(viewSaveStruct);
		}.bind(this));
		docContent.setViews(allViews);
		docContent.setSelectedViewIndex(this.getSelectedViewIndex());
		if (oFF.notNull(this.m_filterLine))
		{
			docContent.setFilterLineConfig(this.m_filterLine.getConfig());
		}
		if (oFF.notNull(this.m_queryDetails))
		{
			docContent.setQueryDetailsConfig(this.m_queryDetails.getConfig());
		}
	}
};
