	formPopup.addInput(oFF.AuGdsQueryBuilderDocument.GDS_QB_PREFS_ROWS_PAGE_SIZE, "50", "Page size for rows", "", oFF.UiInputType.NUMBER, null).setEditable(false);
	formPopup.addInput(oFF.AuGdsQueryBuilderDocument.GDS_QB_PREFS_COLUMNS_PAGE_SIZE, "30", "Page size for columns", "", oFF.UiInputType.NUMBER, null).setEditable(false);
