oFF.AuGdsQueryBuilderDocument.prototype.executeSave = function(consumer)
{
	if (this.getFeatureManager().isSacIntegration() && (this.getFeatureManager().isBeta() || this.getFeatureManager().isGa()))
	{
		if (this.hasFile())
		{
			this.saveInsightToFile(this.getFile(), consumer);
		}
		else
		{
			this.presentInsightSaveDialog();
		}
	}
	else
	{
		oFF.AuGdsDfDocument.prototype.executeSave.call( this , consumer);
	}
};
