oFF.AuGdsQueryBuilderDocument.prototype.renderTableView = function(tableView)
{
	if (oFF.notNull(tableView) && tableView.getViewType() === oFF.AuGdsViewType.TABLE)
	{
		if (this.getFeatureManager().areAdvancedFeaturesEnabled())
		{
			this.setupInteractiveSplitter();
		}
		this.getPanelController().setupSideNavigation(this.getSideNavigationConfig());
		this.m_tableView = tableView;
		if (this.areMultiViewsEnabled())
		{
			this.addNewViewTab(tableView);
			this.selectView(tableView);
		}
		else
		{
			this.m_viewContainer.clearItems();
			this.m_viewContainer.addItem(tableView.getView());
			this.m_views.put(tableView.getUuid(), tableView);
			this.changeActiveView(tableView);
		}
	}
};
