	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(viewName))
		{
			this.m_activeView.setViewName(viewName);
			var tabBarItem = this.m_viewIconTabBar.getSelectedItem();
			if (oFF.notNull(tabBarItem))
			{
				tabBarItem.setText(viewName);
			}
			this.markDirty();
		}
	}
