oFF.AuGdsQueryBuilderDocument.prototype.closeActiveView = function()
{
	if (oFF.notNull(this.m_activeView))
	{
		var viewIndex = this.m_views.getValuesAsReadOnlyList().getIndex(this.m_activeView);
		if (viewIndex >= 0)
		{
			var tmpTabItem = this.m_viewIconTabBar.getSelectedItem();
			this.m_viewIconTabBar.removeItem(tmpTabItem);
			this.m_views.remove(this.m_activeView.getUuid());
			var viewToRemove = this.m_activeView;
			var newViewIndex = viewIndex < this.m_views.size() ? viewIndex : this.m_views.size() - 1;
			if (newViewIndex >= 0)
			{
				this.m_activeView = this.m_views.getValuesAsReadOnlyList().get(newViewIndex);
				this.selectViewTab(this.m_activeView);
			}
			tmpTabItem = oFF.XObjectExt.release(tmpTabItem);
			viewToRemove.notifyBeforeClose();
			viewToRemove = oFF.XObjectExt.release(viewToRemove);
		}
	}
};
