oFF.AuGdsQueryBuilderDocument.prototype.validateResultSet = function()
{
	if (this.getQueryManager() === null)
	{
		this.setStatusError("No QueryManager.");
		return false;
	}
	var activeResultSet = this.getQueryManager().getActiveResultSetContainer();
	if (oFF.isNull(activeResultSet))
	{
		this.setStatusError("Cannot fetch results.");
		return false;
	}
	if (activeResultSet.hasErrors())
	{
		this.setStatusError(activeResultSet.getSummary());
		return false;
	}
	return true;
};
oFF.AuGdsQueryBuilderDocument.prototype.parseViewsFromFile = function(viewList)
{
	if (oFF.notNull(viewList))
	{
		var orderedViews = oFF.PrStructure.create();
		oFF.XCollectionUtils.forEach(viewList,  function(listElement){
			if (listElement.isStructure())
			{
				var tmpViewStruct = listElement;
				var viewIndex = tmpViewStruct.getIntegerByKeyExt(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_INDEX_KEY, 0);
				orderedViews.put(oFF.XInteger.convertToString(viewIndex), tmpViewStruct);
			}
		}.bind(this));
		for (var a = 0; a < orderedViews.size(); a++)
		{
			var viewStruct = orderedViews.getStructureByKey(oFF.XInteger.convertToString(a));
			var viewData = viewStruct.getStructureByKey(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_DATA_KEY);
			var loadedView = oFF.AuGdsQbViewFactory.createViewByViewData(viewData, this);
			if (oFF.notNull(loadedView))
			{
				if (this.areMultiViewsEnabled())
				{
					if (loadedView.getViewType() === oFF.AuGdsViewType.TABLE && oFF.isNull(this.m_tableView))
					{
						this.renderTableView(loadedView);
					}
					else
					{
						this.addNewViewTab(loadedView);
					}
					if (oFF.isNull(this.m_activeView))
					{
						this.selectView(loadedView);
					}
				}
				else
				{
					if (loadedView.getViewType() === oFF.AuGdsViewType.TABLE && oFF.isNull(this.m_tableView))
					{
						this.renderTableView(loadedView);
						break;
					}
				}
			}
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.createDataSourceBySystemAndName = function(system, dataSourceName)
{
	var newDataSource = null;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(system) && oFF.XStringUtils.isNotNullAndNotEmpty(dataSourceName))
	{
		newDataSource = oFF.QFactory.createDataSource();
		newDataSource.setSystemName(system);
		newDataSource.setFullQualifiedName(dataSourceName);
	}
	return newDataSource;
};
oFF.AuGdsQueryBuilderDocument.prototype.showStatusTableInfo = function()
{
	if (oFF.notNull(this.m_tableView))
	{
		var numOfRows = this.m_tableView.getRowsCountTotal();
		var numOfColumns = this.m_tableView.getColumnsCountTotal();
		var totalCells = numOfColumns * numOfRows;
		if (totalCells > 0)
		{
			var numOfLoadedRows = this.m_tableView.getRowsCountLoaded();
			var numOfLoadedColumns = this.m_tableView.getColumnsCountLoaded();
			var tableInfoStr = oFF.XStringUtils.concatenate2("Total rows: ", oFF.XInteger.convertToString(numOfRows));
			tableInfoStr = oFF.XStringUtils.concatenate3(tableInfoStr, " | Total columns: ", oFF.XInteger.convertToString(numOfColumns));
			tableInfoStr = oFF.XStringUtils.concatenate3(tableInfoStr, " | Total cells: ", oFF.XInteger.convertToString(totalCells));
			tableInfoStr = oFF.XStringUtils.concatenate3(tableInfoStr, " | Loaded rows: ", oFF.XInteger.convertToString(numOfLoadedRows));
			tableInfoStr = oFF.XStringUtils.concatenate3(tableInfoStr, " | Loaded columns: ", oFF.XInteger.convertToString(numOfLoadedColumns));
			this.setStatusInfo(tableInfoStr);
		}
	}
	else
	{
		this.clearStatus();
	}
};
