oFF.AuGdsQueryBuilderDocument.prototype.updateQuickActionToolbarDefault = function()
{
	if (oFF.notNull(this.m_toolbarResetBtn))
	{
		this.m_toolbarResetBtn.setEnabled(this.getQueryManager() !== null);
	}
	if (oFF.notNull(this.m_toolbarRefreshBtn))
	{
		this.m_toolbarRefreshBtn.setEnabled(this.getQueryManager() !== null);
	}
	if (oFF.notNull(this.m_toolbarVariablesBtn))
	{
		this.m_toolbarVariablesBtn.setEnabled(this.getQueryManager() !== null && this.getQueryManager().hasInputEnabledAndNonTechnicalVariables());
	}
	if (oFF.notNull(this.m_toolbarLayoutBtn))
	{
		this.m_toolbarLayoutBtn.setEnabled(this.getQueryManager() !== null);
	}
	if (oFF.notNull(this.m_toolbarUdhRowBtn))
	{
		this.m_toolbarUdhRowBtn.setEnabled(this.getQueryManager() !== null && this.getQueryManager().getModelCapabilities().supportsUniversalDisplayHierarchies() && this.getQueryManager().getQueryModel().getRowsAxis().getDimensions().size() > 1);
		this.m_toolbarUdhRowBtn.setPressed(this.getQueryManager() !== null && this.getQueryManager().getModelCapabilities().supportsUniversalDisplayHierarchies() && this.getQueryManager().getQueryModel().getUniversalDisplayHierarchies().getByAxisType(oFF.AxisType.ROWS).isActive());
	}
	var axis = null;
	var lastSelected = null;
	var firstElement = null;
	var lastElement = null;
	if (oFF.notNull(this.m_toolbarMoveUpBtn) && oFF.notNull(this.m_toolbarMoveDownBtn) && oFF.notNull(this.m_tableView) && this.getQueryManager() !== null)
	{
		lastSelected = this.m_tableView.getColumnDimensionsLastSelected();
		if (oFF.XCollectionUtils.hasElements(lastSelected))
		{
			firstElement = this.getQueryManager().getQueryModel().getDimensionByName(lastSelected.get(0).getName());
			lastElement = this.getQueryManager().getQueryModel().getDimensionByName(lastSelected.get(lastSelected.size() - 1).getName());
			axis = oFF.isNull(firstElement) ? null : firstElement.getAxis();
		}
		this.m_toolbarMoveUpBtn.setEnabled(this.getQueryManager() !== null && !this.m_tableView.isIsMultiSelectWithGaps() && !this.m_tableView.isOnEmptyHeaderSection() && oFF.notNull(axis) && axis.getIndex(firstElement) > 0);
		this.m_toolbarMoveDownBtn.setEnabled(this.getQueryManager() !== null && !this.m_tableView.isIsMultiSelectWithGaps() && !this.m_tableView.isOnEmptyHeaderSection() && oFF.notNull(axis) && axis.getIndex(lastElement) < axis.size() - 1);
	}
	if (oFF.notNull(this.m_toolbarMoveLeftBtn) && oFF.notNull(this.m_toolbarMoveRightBtn) && oFF.notNull(this.m_tableView) && this.getQueryManager() !== null)
	{
		axis = null;
		lastSelected = this.m_tableView.getRowDimensionsLastSelected();
		if (oFF.XCollectionUtils.hasElements(lastSelected))
		{
			firstElement = this.getQueryManager().getQueryModel().getDimensionByName(lastSelected.get(0).getName());
			lastElement = this.getQueryManager().getQueryModel().getDimensionByName(lastSelected.get(lastSelected.size() - 1).getName());
			axis = oFF.isNull(firstElement) ? null : firstElement.getAxis();
		}
		this.m_toolbarMoveLeftBtn.setEnabled(this.getQueryManager() !== null && !this.m_tableView.isIsMultiSelectWithGaps() && !this.m_tableView.isOnEmptyHeaderSection() && !this.m_tableView.isOnHeaderRows() && oFF.notNull(axis) && axis.getIndex(firstElement) > 0);
		this.m_toolbarMoveRightBtn.setEnabled(this.getQueryManager() !== null && !this.m_tableView.isIsMultiSelectWithGaps() && !this.m_tableView.isOnEmptyHeaderSection() && !this.m_tableView.isOnHeaderRows() && oFF.notNull(axis) && axis.getIndex(lastElement) < axis.size() - 1);
	}
	var remappedDims;
	if (oFF.notNull(this.m_toolbarTableColumnBtn) && oFF.notNull(this.m_tableView) && this.getQueryManager() !== null)
	{
		remappedDims = this.m_tableView.getDimensionsAllSelectedRemapped(oFF.AxisType.COLUMNS);
		this.m_toolbarTableColumnBtn.setEnabled(this.getQueryManager() !== null && oFF.XCollectionUtils.hasElements(remappedDims) && !this.m_tableView.isOnEmptyHeaderSection() && remappedDims.get(0).getAxisType() !== oFF.AxisType.COLUMNS);
	}
	if (oFF.notNull(this.m_toolbarTableRowBtn) && oFF.notNull(this.m_tableView) && this.getQueryManager() !== null)
	{
		remappedDims = this.m_tableView.getDimensionsAllSelectedRemapped(oFF.AxisType.ROWS);
		this.m_toolbarTableRowBtn.setEnabled(this.getQueryManager() !== null && oFF.XCollectionUtils.hasElements(remappedDims) && !this.m_tableView.isOnEmptyHeaderSection() && remappedDims.get(0).getAxisType() !== oFF.AxisType.ROWS);
	}
	if (oFF.notNull(this.m_toolbarTableFreeBtn) && oFF.notNull(this.m_tableView))
	{
		this.m_toolbarTableFreeBtn.setEnabled(this.getQueryManager() !== null && !this.m_tableView.isOnEmptyHeaderSection() && oFF.XCollectionUtils.hasElements(this.m_tableView.getDimensionsAllSelectedRemapped(oFF.AxisType.FREE)));
	}
	if (oFF.notNull(this.m_toolbarClearFilterBtn) && oFF.notNull(this.m_toolbarAddFilterBtn) && oFF.notNull(this.m_toolbarFilterSelectionBtn) && oFF.notNull(this.m_toolbarDimensionSettingsBtn) && oFF.notNull(this.m_tableView) && this.getQueryManager() !== null)
	{
		var singleDimension = this.m_tableView.getSingleSelectedDimension();
		this.m_toolbarClearFilterBtn.setEnabled(oFF.notNull(singleDimension) && !this.m_tableView.isOnEmptyHeaderSection() && oFF.AuGdsQbInteractiveTableContextActionsHelper.hasFilterOnDimension(this.getQueryManager(), singleDimension));
		this.m_toolbarAddFilterBtn.setEnabled(oFF.notNull(singleDimension) && !this.m_tableView.isOnEmptyHeaderSection());
		this.m_toolbarFilterSelectionBtn.setEnabled(oFF.notNull(singleDimension) && !this.m_tableView.isOnEmptyHeaderSection() && oFF.XCollectionUtils.hasElements(this.m_tableView.getSelectedTupleElements()));
		this.m_toolbarDimensionSettingsBtn.setEnabled(oFF.notNull(singleDimension) && !this.m_tableView.isOnEmptyHeaderSection());
	}
	if (oFF.notNull(this.m_filterLineToggleBtn))
	{
		this.m_filterLineToggleBtn.setEnabled(this.getQueryManager() !== null);
		if (oFF.notNull(this.m_filterLine))
		{
			this.m_filterLineToggleBtn.setPressed(this.m_filterLine.isVisible());
		}
	}
	if (oFF.notNull(this.m_pauseUpdatesToggleBtn))
	{
		this.m_pauseUpdatesToggleBtn.setEnabled(this.getQueryManager() !== null);
	}
	if (!this.getFeatureManager().isGa())
	{
		this.m_toolbarDesignerPanelToggleBtn.setEnabled(this.getQueryManager() !== null);
		this.m_toolbarFilterPanelToggleBtn.setEnabled(this.getQueryManager() !== null);
		this.m_toolbarStylePanelToggleBtn.setEnabled(this.getQueryManager() !== null);
		if (oFF.notNull(this.m_toolbarSerializationPanelToggleBtn))
		{
			this.m_toolbarSerializationPanelToggleBtn.setEnabled(this.getQueryManager() !== null);
		}
		if (oFF.notNull(this.m_toolbarProfilerPanelToggleBtn))
		{
			this.m_toolbarProfilerPanelToggleBtn.setEnabled(this.getQueryManager() !== null);
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.presentDataSourcePicker = function()
{
	if (this.getFeatureManager().isSacIntegration() && (this.getFeatureManager().isBeta() || this.getFeatureManager().isGa()))
	{
		this.presentNewDataSourcePicker();
	}
	else
	{
		this.presentLegacyDataSourcePicker();
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.presentLegacyDataSourcePicker = function()
{
	if (!oFF.AuGdsQbExternalConfiguration.getInstance().fireDataSourcePickerPresenter())
	{
		var dspDlg = oFF.ProgramRunner.createRunner(this.getProcess(), oFF.AuDatasourcePicker.DEFAULT_PROGRAM_NAME);
		dspDlg.setArgument(oFF.AuDatasourcePicker.PARAM_SYSTEM, oFF.notNull(this.m_dataSource) ? this.m_dataSource.getSystemName() : null);
		dspDlg.setObjectArgument(oFF.AuDatasourcePicker.PARAM_LISTENER, this);
		dspDlg.setObjectArgument(oFF.AuDatasourcePicker.PARAM_APPLICATION, this.getApplication());
		dspDlg.runProgram();
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.presentNewDataSourcePicker = function()
{
	if (!oFF.AuGdsQbExternalConfiguration.getInstance().fireDataSourcePickerPresenter())
	{
		var title = this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.DATASOURCE_PICKER_TITLE);
		var auGdsInstance = oFF.AuGdsQbExternalConfiguration.getInstance();
		var onOk =  function(resourceInfo, dialog){
			this.handleDataSourcePickerOk(resourceInfo);
			var dataSource = this.createDatasource(resourceInfo);
			var dataSourceInfo = this.createDatasourceInfo(dataSource, resourceInfo);
			dialog.saveDSToRecentlyUsed(dataSourceInfo);
			dialog.close();
		}.bind(this);
		var onFilter = auGdsInstance.getResourceExplorerFilterCallback();
		var onQuickAccessChange = auGdsInstance.getResourceExplorerQuickAccessCallback();
		var resourceExplorerListener = oFF.SuResourceExplorerListener.create(onOk, null, null, onQuickAccessChange, onFilter);
		oFF.AuGdsResourceExplorerProgramFactory.createDatasourcePicker(this.getProcess(), title, this.getConfiguration(), resourceExplorerListener).runProgram();
	}
};
