oFF.AuGdsQueryBuilderDocument.prototype.presentInsightSaveDialog = function()
{
	var title;
	var i18nProvider = this.getController().getGlobalLocalization();
	title = i18nProvider.getText(oFF.AuGdsQueryBuilderI18n.RESOURCE_EXPLORER_TITLE_INSIGHT_SAVE);
	var initialPath = null;
	var resourceName = null;
	if (this.hasFile())
	{
		title = i18nProvider.getText(oFF.AuGdsQueryBuilderI18n.RESOURCE_EXPLORER_TITLE_INSIGHT_SAVE_AS);
		var resourceWrapper = oFF.SuResourceWrapper.create(this.getFile());
		var resource = resourceWrapper.getRealResource();
		if (oFF.notNull(resource))
		{
			resourceName = resourceWrapper.getDisplayName();
			if (resource.getParent() !== null)
			{
				initialPath = oFF.SuResourceWrapper.getPathWithoutFinalSlash(resource.getParent().getUri().getPath());
			}
		}
		if (oFF.isNull(initialPath))
		{
			var configJson = this.getController().getConfiguration().getConfigJson().getByKey("ResourceExplorer");
			var defaultInsightSavePath = configJson.getStructureByKey("config").getStringByKey("root");
			initialPath = this.getProcess().getKernel().getKernelProcess().getEnvironment().resolvePath(defaultInsightSavePath);
		}
	}
	var variables = this.getQueryManager().getQueryModel().getVariables();
	var resExplorerSaveRunner;
	var okAndFilter = oFF.SuResourceExplorerListener.createOKAndFilter( function(resourceInfo, dialog){
		this.handleInsightFileForSaveSelected(resourceInfo, dialog);
	}.bind(this), oFF.AuGdsQbExternalConfiguration.getInstance().getResourceExplorerFilterCallback());
	if (variables.size() > 0)
	{
		resExplorerSaveRunner = oFF.AuGdsResourceExplorerProgramFactory.createResourceExplorerSaveWithVariables(this.getProcess(), title, this.getController().getConfiguration(), resourceName, oFF.AuGdsResourceExplorerProgramFactory.CONFIG_EXT_TYPE_INSIGHT, okAndFilter, initialPath, variables, i18nProvider);
	}
	else
	{
		resExplorerSaveRunner = oFF.AuGdsResourceExplorerProgramFactory.createResourceExplorerSaveWithoutVariables(this.getProcess(), title, this.getController().getConfiguration(), resourceName, oFF.AuGdsResourceExplorerProgramFactory.CONFIG_EXT_TYPE_INSIGHT, okAndFilter, initialPath, i18nProvider);
	}
	resExplorerSaveRunner.runProgram();
};
