oFF.AuGdsQueryBuilderDocument.prototype.createDatasource = function(resourceInfo)
{
	var dataSource = oFF.QFactory.createDataSource();
	dataSource.setSystemName(resourceInfo.getString(oFF.SuResourceInfo.SYSTEM_NAME));
	dataSource.setType(oFF.MetaObjectType.lookup(resourceInfo.getString(oFF.SuResourceInfo.TYPE)));
	dataSource.setEnvironmentName(resourceInfo.getString(oFF.SuResourceInfo.ENVIRONMENT_NAME));
	dataSource.setSchemaName(resourceInfo.getString(oFF.SuResourceInfo.SCHEMA_NAME));
	dataSource.setPackageName(resourceInfo.getString(oFF.SuResourceInfo.PACKAGE_NAME));
	dataSource.setObjectName(resourceInfo.getString(oFF.SuResourceInfo.OBJECT_NAME));
	return dataSource;
};
oFF.AuGdsQueryBuilderDocument.prototype.createDatasourceInfo = function(dataSource, resourceInfo)
{
	return oFF.SuDataSourceInfo.create(dataSource.getSystemName(), dataSource.getObjectName(), dataSource.getSchemaName(), resourceInfo.getString(oFF.SuResourceInfo.TYPE), dataSource.getPackageName());
};
oFF.AuGdsQueryBuilderDocument.prototype.handleInsightPickerOk = function(resourceInfo)
{
	var file = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
	this.openFile(file);
};
oFF.AuGdsQueryBuilderDocument.prototype.handleModelPickerOk = function(resourceInfo)
{
	var file = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
	this.openFile(file);
};
oFF.AuGdsQueryBuilderDocument.prototype.handleInsightFileForSaveSelected = function(resourceInfo, dialog)
{
	if (oFF.notNull(resourceInfo) && resourceInfo.isFile())
	{
		var file = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
		oFF.AuGdsQbSacInsightHandler.addFileAttributes(file, resourceInfo);
		var isOpenPromptAutomatically = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.AUTOMATICALLY_OPEN_PROMPT) !== null ? true : false;
		this.getQueryBuilderDocContent().setForcePrompt(isOpenPromptAutomatically);
		var suppressExitVariables = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.SAVE_DYNAMIC_VARIABLES) !== null ? false : true;
		this.getQueryManager().setSuppressExitVariableValuesInRepoMode(suppressExitVariables);
		this.saveInsightToFile(file,  function(extResult){
			if (!extResult.hasErrors())
			{
				this.handleDocumentSaved(extResult.getData());
				dialog.close();
			}
			else
			{
				var errors = extResult.getErrors();
				var iterator = errors.getIterator();
				var error = iterator.next();
				var error_text = error.getText();
				error_text = oFF.XStringUtils.concatenate3(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR), " ", error_text);
				dialog.showErrorMessage(error_text);
			}
		}.bind(this));
	}
	else
	{
		dialog.showErrorMessage(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR));
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.saveInsightToFile = function(fileToSave, consumer)
{
	if (this.hasSaveData())
	{
		var contentToSave = this.getSaveContent();
		var queryBuilderJson = contentToSave.getJsonContent();
		var formattedContent = oFF.AuGdsFileType.INSIGHT.format(queryBuilderJson, fileToSave);
		formattedContent = oFF.AuGdsQbSacInsightHandler.appendModelDataset(formattedContent, this.getDocContent());
		if (oFF.notNull(formattedContent))
		{
			var formattedContentToSave = oFF.XContent.createJsonObjectContent(oFF.ContentType.JSON, formattedContent);
			this.getFileManager().saveDocumentContentAs(formattedContentToSave, fileToSave,  function(extResult){
				if (!extResult.hasErrors())
				{
					this.handleDocumentSaved(extResult.getData());
				}
				if (oFF.notNull(consumer))
				{
					consumer(extResult);
				}
			}.bind(this));
		}
	}
	else
	{
		this.getMessageCenter().showErrorToast("No save data! Cannot save");
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.onDatasourceSelected = function(dataSource)
{
	if (oFF.isNull(dataSource))
	{
		return;
	}
	this.handleNewDataSourceSet(dataSource, null, false);
	oFF.AuGdsQbExternalConfiguration.getInstance().fireDataSourcePickedCallback(dataSource);
};
