oFF.AuGdsQbPresentation = function() {};
oFF.AuGdsQbPresentation.prototype = new oFF.XConstant();
oFF.AuGdsQbPresentation.prototype._ff_c = "AuGdsQbPresentation";

oFF.AuGdsQbPresentation.ID = null;
oFF.AuGdsQbPresentation.DESCRIPTION = null;
oFF.AuGdsQbPresentation.ID_AND_DESCRIPTION = null;
oFF.AuGdsQbPresentation.DESCRIPTION_AND_ID = null;
oFF.AuGdsQbPresentation.staticSetup = function()
{
	oFF.AuGdsQbPresentation.ID = oFF.XConstant.setupName(new oFF.AuGdsQbPresentation(), "id");
	oFF.AuGdsQbPresentation.DESCRIPTION = oFF.XConstant.setupName(new oFF.AuGdsQbPresentation(), "description");
	oFF.AuGdsQbPresentation.ID_AND_DESCRIPTION = oFF.XConstant.setupName(new oFF.AuGdsQbPresentation(), "idAndDescription");
	oFF.AuGdsQbPresentation.DESCRIPTION_AND_ID = oFF.XConstant.setupName(new oFF.AuGdsQbPresentation(), "descriptionAndId");
};
oFF.AuGdsQbPresentation.prototype.composeDisplayStrings = function(key, text)
{
	if (this === oFF.AuGdsQbPresentation.ID)
	{
		return key;
	}
	else if (this === oFF.AuGdsQbPresentation.DESCRIPTION)
	{
		if (oFF.XStringUtils.isNullOrEmpty(text))
		{
			return key;
		}
		return text;
	}
	else if (this === oFF.AuGdsQbPresentation.ID_AND_DESCRIPTION)
	{
		return oFF.XStringUtils.concatenate4(key, " (", text, ")");
	}
	else if (this === oFF.AuGdsQbPresentation.DESCRIPTION_AND_ID)
	{
		return oFF.XStringUtils.concatenate4(text, " (", key, ")");
	}
	throw oFF.XException.createIllegalArgumentException("unknown presentation type");
};
oFF.AuGdsQbPresentation.prototype.getDisplayValueSimple = function(obj)
{
	return this.composeDisplayStrings(obj.getName(), obj.getText());
};
oFF.AuGdsQbPresentation.prototype.getDisplayValueByType = function(modelComponent)
{
	if (oFF.AuGdsQbUtils.isMember(modelComponent))
	{
		var member = modelComponent;
		var text = member.getText();
		if (oFF.XStringUtils.isNullOrEmpty(text))
		{
			var dim = member.getDimension();
			var fieldValue = member.getFieldValue(dim.getDisplayKeyField());
			if (oFF.notNull(fieldValue))
			{
				text = fieldValue.getValue().getStringRepresentation();
			}
		}
		return this.composeDisplayStrings(member.getName(), text);
	}
	return this.getDisplayValueSimple(modelComponent);
};

