oFF.AuGdsFilterLine.prototype.setupGrid = function(widgetWrapper)
{
	var gridLayoutData = oFF.UiBasicGridLayout.create();
	gridLayoutData.setGridTemplateColumns("repeat(auto-fit, 12.5rem)");
	gridLayoutData.setGridGap("0.5rem 0.5rem");
	this.m_grid = widgetWrapper.addNewItemOfType(oFF.UiType.GRID_LIST);
	this.m_grid.setGridLayout(gridLayoutData);
	this.m_grid.setMargin(oFF.UiCssBoxEdges.create("0.4rem 1rem 0rem 0rem"));
	this.m_grid.setVisible(false);
	this.m_grid.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT_MASTER);
	this.m_grid.registerOnSelect(oFF.UiLambdaSelectListener.create( function(controlEvent){
		var fli = controlEvent.getSelectedItem().getCustomObject();
		if (fli.isDimensionType())
		{
			this.openFilterDialogWithDimension(fli.getDimension());
		}
		else if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.MEASURE_FILTER_SUPPORT) && fli.isMeasureType())
		{
			this.openFilterDialogWithMeasure(fli.getMeasure());
		}
		this.m_grid.clearSelectedItems();
	}.bind(this)));
};
oFF.AuGdsFilterLine.prototype.setQueryManager = function(queryManager, updateCommand)
{
	if (oFF.isNull(updateCommand))
	{
		throw oFF.XException.createIllegalArgumentException("Command must not be null");
	}
	this.m_queryManager = oFF.XObjectExt.assertNotNull(queryManager);
	this.m_updateCommand = updateCommand;
	this.m_entryPoint = oFF.FdEntryPoint.createEntryPoint(queryManager.getApplication(), this.getLocalization().getText(oFF.AuGdsFilterLineI18n.FD_TITLE));
	this.m_entryPoint.getConfiguration().setMultiSelection(true);
	this.m_entryPoint.getEvents().registerOnDisplayChange(this);
	var openFilterDialogWithDimensionConsumer =  function(dimension, filterType){
		this.m_filterLineConfig.setFilterTypeForDimension(dimension.getName(), filterType.getName());
		this.openFilterDialogWithDimension(dimension);
	}.bind(this);
	var openFilterDialogWithMeasureConsumer =  function(measure){
		this.openFilterDialogWithMeasure(measure);
	}.bind(this);
	var modelCapabilities = this.m_queryManager.getModelCapabilities();
	var isBW = oFF.notNull(modelCapabilities) && modelCapabilities.getSystemType().isTypeOf(oFF.SystemType.BW);
	this.m_menu = oFF.AuGdsFilterLineMenuFactory.create(this.getGenesis(), isBW, this.m_featureManager, openFilterDialogWithDimensionConsumer, openFilterDialogWithMeasureConsumer);
	this.m_addFilterButtonLayout.clearItems();
	this.m_addFilterButtonLayout.addItem(this.m_menu.getView());
	this.m_menu.createMenuItems(this.m_queryManager);
	this.m_queryManager.getQueryModel().getFilter().registerChangedListener(this, null);
	this.updateFilterLine();
};
