oFF.AuGdsFilterLine.prototype.updateFilterLine = function()
{
	this.m_grid.clearItems();
	this.m_selectedDimensions.clear();
	this.m_selectedMeasures.clear();
	var filter = this.m_queryManager.getQueryModel().getFilter();
	this.updateFilterLineForDimensionFilters(filter);
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.MEASURE_FILTER_SUPPORT))
	{
		this.updateFilterLineForMeasureFilters(filter);
	}
	this.m_menu.updateMenuItemsStatus(this.m_selectedDimensions, this.m_selectedMeasures);
	this.m_grid.setVisible(this.hasFilters());
};
oFF.AuGdsFilterLine.prototype.updateFilterLineForDimensionFilters = function(filter)
{
	var cartesianProduct = filter.getDynamicFilter().getCartesianProduct();
	if (oFF.notNull(cartesianProduct))
	{
		var cartesianProductIter = oFF.AuGdsIQFilterCartesianProductFiltered.create(cartesianProduct).getIterator();
		while (cartesianProductIter.hasNext())
		{
			var fliBuilder = oFF.AuGdsFilterLineItemBuilder.create();
			var cartesianChild = cartesianProductIter.next();
			fliBuilder.setDimension(cartesianChild.getDimension());
			var displayTypeRetriever = oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.create(cartesianChild.getDimension(), this.m_filterLineConfig);
			fliBuilder.setDisplayType(displayTypeRetriever.getDisplayType());
			fliBuilder.setFilterType(this.getStoredFilterTypeForFilterDialog(cartesianChild.getDimension()));
			for (var j = 0; j < cartesianChild.size(); j++)
			{
				var detailsGenerator = oFF.AuGdsDimensionMemberDetailsGenerator.create(cartesianChild, cartesianChild.getOp(j));
				var detailsLow = detailsGenerator.generateFromLow();
				var detailsHigh = detailsGenerator.generateFromHigh();
				var member = oFF.AuGdsFilterLineItemMember.create(cartesianChild.getOp(j).getSetSign(), cartesianChild.getOp(j).getComparisonOperator(), detailsLow, detailsHigh);
				fliBuilder.addMember(member);
			}
			var fli = fliBuilder.build();
			var fliUiElement = this.createFilterLineItemUiElement(fli, this.createDeleteButtonCallbackProcedureForDimension(cartesianProduct, cartesianChild));
			this.m_grid.addItem(fliUiElement.getRootUiElement());
			this.m_selectedDimensions.add(cartesianChild.getDimension().getName());
			var membersMissingDescription = fli.getMembersNeedingDescriptionRetrieval();
			if (!membersMissingDescription.isEmpty())
			{
				oFF.AuGdsFilterLine.updateFilterLineItemsWithCorrectDescriptions(cartesianChild.getDimension(), fli, fliUiElement, membersMissingDescription);
			}
		}
	}
};
oFF.AuGdsFilterLine.prototype.updateFilterLineForMeasureFilters = function(filter)
{
	var linkedFilters = filter.getLinkedFilters();
	if (oFF.notNull(linkedFilters))
	{
		var filterIterator = linkedFilters.getIterator();
		while (filterIterator.hasNext())
		{
			var filterExpression = filterIterator.next();
			var filterElement = filterExpression.getFilterRootElement();
			if (oFF.notNull(filterElement) && filterElement.getOlapComponentType() === oFF.FilterComponentType.FILTER_MEASURE_BASED)
			{
				var mbf = filterElement;
				var memberName = oFF.DialogMBFParser.getMemberName(mbf);
				var fliBuilder = oFF.AuGdsFilterLineItemBuilder.create();
				fliBuilder.setMeasure(this.m_queryManager.getQueryModel().getMeasureDimension().getStructureMember(memberName));
				fliBuilder.setFilterType(oFF.FdFilterType.RANGE);
				var filterRanges = oFF.DialogMBFParser.getFilterRanges(mbf);
				oFF.XCollectionUtils.forEach(filterRanges,  function(filterRange){
					var low = filterRange.getLow();
					var high = filterRange.getHigh();
					var detailsLow = oFF.AuGdsDimensionMemberDetails.create(low.getKey(), low.getDisplayKey(), low.getText());
					var detailsHigh = oFF.AuGdsDimensionMemberDetails.create(high.getKey(), high.getDisplayKey(), high.getText());
					var member = oFF.AuGdsFilterLineItemMember.create(oFF.SetSign.INCLUDING, filterRange.getComparisonOperator().getOriginOperator(), detailsLow, detailsHigh);
					fliBuilder.addMember(member);
				}.bind(this));
				var fli = fliBuilder.build();
				var fliUiElement = this.createFilterLineItemUiElement(fli, this.createDeleteButtonCallbackProcedureForMeasure(filter, memberName));
				this.m_grid.addItem(fliUiElement.getRootUiElement());
				this.m_selectedMeasures.add(memberName);
			}
		}
	}
};
oFF.AuGdsFilterLine.prototype.createDeleteButtonCallbackProcedureForDimension = function(cartesianProduct, cartesianChild)
{
	return  function(){
		cartesianProduct.removeElement(cartesianChild);
	}.bind(this);
};
oFF.AuGdsFilterLine.prototype.createDeleteButtonCallbackProcedureForMeasure = function(filter, filterName)
{
	return  function(){
		filter.linkFilter(filterName, null);
	}.bind(this);
};
