oFF.AuGdsQueryDetails.prototype.reRenderTitle = function(queryModel, rsContainer)
{
	var titleText = oFF.isNull(this.m_title) ? null : this.m_title;
	if (oFF.isNull(titleText) && oFF.notNull(queryModel))
	{
		titleText = queryModel.getText();
		if (oFF.XStringUtils.isNullOrEmpty(titleText))
		{
			titleText = queryModel.getName();
		}
		if (oFF.XStringUtils.isNullOrEmpty(titleText))
		{
			titleText = "Query Model without a name";
		}
	}
	this.m_titleControl.setText(titleText);
	this.m_modelDetails.clearItems();
	var queryController = this.m_parentDocument.getQueryController();
	var table = this.m_parentDocument.getTableView();
	var localization = this.getLocalization();
	var cmd = queryModel.getConvenienceCommands();
	var rankInfo;
	if (queryModel.getModelCapabilities().supportsConditions())
	{
		var condManager = queryModel.getConditionManager();
		var conditions = condManager.getActiveConditions();
		var plainConditions = oFF.XList.create();
		for (var i = 0; i < conditions.size(); i++)
		{
			var condition = conditions.get(i);
			rankInfo = cmd.getRank(condition.getName());
			if (oFF.notNull(rankInfo))
			{
				this.addRankInfoLink(cmd, rankInfo);
			}
			else if (condition.isApplicable())
			{
				plainConditions.add(condition);
			}
		}
		var plainConditionsSize = plainConditions.size();
		var conditionHeader;
		var conditionList;
		if (plainConditionsSize === 1)
		{
			conditionHeader = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_ONE_CONDITION_APPLIED);
			conditionList = oFF.XCollectionUtils.singletonStringList(this.getDescriptionWithFallback(conditions.get(0)));
		}
		else if (plainConditionsSize > 1)
		{
			conditionHeader = localization.getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.MSG_N_CONDITIONS_APPLIED, oFF.XInteger.convertToString(plainConditionsSize));
			conditionList = oFF.XStream.of(plainConditions).collect(oFF.XStreamCollector.toListOfString( function(c){
				return this.getDescriptionWithFallback(c);
			}.bind(this)));
		}
		else
		{
			conditionList = null;
			conditionHeader = null;
		}
		var flexLayoutConsumerConditions =  function(cl){
			this.complementDetailsPopOver(cl, conditionHeader, conditionList);
		}.bind(this);
		if (oFF.notNull(conditionHeader) && oFF.notNull(conditionList))
		{
			this.prepareDetailsPopOver(null, conditionHeader, flexLayoutConsumerConditions);
		}
	}
	else
	{
		rankInfo = cmd.getRank(null);
		if (oFF.notNull(rankInfo))
		{
			this.addRankInfoLink(cmd, rankInfo);
		}
	}
	if (oFF.notNull(rsContainer))
	{
		var cursorResultSet = rsContainer.isCursorResultSetAvailable() ? rsContainer.getCursorResultSet() : null;
		var state = oFF.isNull(cursorResultSet) ? null : cursorResultSet.getState();
		var icon = null;
		var overallMessage = null;
		var maxColumnLoad = table.getEffectiveMaxColumnsLoad();
		var maxColumnRecommendation = table.getMaxColumnsRecommendation();
		if (rsContainer.hasErrors())
		{
			icon = oFF.AuGdsQueryDetails.ERROR_ICON;
			overallMessage = this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_BACKEND_ERRORS);
		}
		else if (rsContainer.hasWarnings())
		{
			icon = oFF.AuGdsQueryDetails.WARNING_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_BACKEND_WARNINGS);
		}
		else if (oFF.notNull(state) && !state.hasData())
		{
			icon = state.isErrorState() ? oFF.AuGdsQueryDetails.ERROR_ICON : oFF.AuGdsQueryDetails.WARNING_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_RESULTSET_RENDERING_ISSUE);
		}
		else if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && maxColumnLoad < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING);
		}
		else if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && maxColumnRecommendation < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING);
		}
		else if (queryModel.getMeasureDimension() === null)
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING);
		}
		var flexLayoutConsumer =  function(fl){
			if (rsContainer.hasErrors())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_COULD_NOT_OPEN_QUERY), this.getMessageList(rsContainer.getErrors()));
			}
			if (rsContainer.hasWarnings())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_OPENED_WITH_WARNINGS), this.getMessageList(rsContainer.getWarnings()));
			}
			if (oFF.notNull(state) && !state.hasData() && state !== oFF.ResultSetState.INITIAL)
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonStringList(queryController.getMessageStringRsState(state)));
			}
			if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && maxColumnLoad < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonStringList(localization.getTextWithPlaceholder2(oFF.AuGdsQueryBuilderI18n.MSG_COLUMN_LIMIT_EXCEEDED, oFF.XInteger.convertToString(rsContainer.getMaxColumns()), oFF.XInteger.convertToString(cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal()))));
			}
			if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && maxColumnRecommendation < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonStringList(localization.getTextWithPlaceholder2(oFF.AuGdsQueryBuilderI18n.MSG_COLUMN_LIMIT_RECOMMENDATION_EXCEEDED, oFF.XInteger.convertToString(maxColumnRecommendation), oFF.XInteger.convertToString(cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal()))));
			}
			if (queryModel.getMeasureDimension() === null)
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_DOES_NOT_CONTAIN_MEASURES), null);
			}
		}.bind(this);
		if (oFF.notNull(icon) && oFF.notNull(overallMessage))
		{
			this.prepareDetailsPopOver(icon, overallMessage, flexLayoutConsumer);
		}
	}
};
oFF.AuGdsQueryDetails.prototype.getMessageList = function(messages)
{
	return oFF.XStream.of(messages).collect(oFF.XStreamCollector.toListOfString( function(msg){
		return msg.getText();
	}.bind(this)));
};
oFF.AuGdsQueryDetails.prototype.addRankInfoLink = function(cmd, rankInfo)
{
	this.addSeparatorIfNecessary();
	var localization = this.getLocalization();
	var comparisonOperator = rankInfo.getComparisonOperator();
	var topNPrefix = localization.getTextWithPlaceholder(comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_N ? oFF.AuGdsQueryBuilderI18n.MSG_BOTTOM_N : oFF.AuGdsQueryBuilderI18n.MSG_TOP_N, oFF.XInteger.convertToString(rankInfo.getMaxRows()));
	var link = this.m_modelDetails.addNewItemOfType(oFF.UiType.LINK);
	var measure = this.getDimensionMember(rankInfo.getMeasure());
	var secondaryMeasure = this.getDimensionMember(rankInfo.getSecondaryMeasure());
	var measureInfix = "";
	var versionDimension = rankInfo.getVersionDimension();
	var versionMember = null;
	if (oFF.notNull(versionDimension))
	{
		var versionId = rankInfo.getVersionElementId();
		var versionNode = this.m_parentDocument.getMemberByTypeAndName(versionDimension.getDimensionType(), versionId);
		if (oFF.notNull(versionNode))
		{
			versionMember = versionNode.getDimensionMember();
		}
		else
		{
			versionMember = versionDimension.getDimensionMember(versionId);
		}
	}
	var finalVersionMember = versionMember;
	if (oFF.notNull(measure) && oFF.notNull(secondaryMeasure) && secondaryMeasure.getDimension().getAllStructureMembers().size() > 1)
	{
		measureInfix = oFF.XStringUtils.concatenate3(this.getTextWithFallback(measure), ", ", this.getTextWithFallback(secondaryMeasure));
	}
	else if (oFF.notNull(measure))
	{
		measureInfix = this.getTextWithFallback(measure);
	}
	else if (oFF.notNull(secondaryMeasure))
	{
		measureInfix = this.getTextWithFallback(secondaryMeasure);
	}
	link.setText(oFF.XStringUtils.concatenate3(topNPrefix, " ", measureInfix));
	link.setFontWeight(oFF.UiFontWeight.BOLD);
	link.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create( function(evEd){
		var ccDlg = oFF.ProgramRunner.createRunner(this.m_parentDocument.getProcess(), oFF.OuTopNDialog.DEFAULT_PROGRAM_NAME);
		ccDlg.setObjectArgument(oFF.OuTopNDialog.PARAM_MEASURE, measure);
		ccDlg.setObjectArgument(oFF.OuTopNDialog.PARAM_SECONDARY_MEASURE, secondaryMeasure);
		ccDlg.setObjectArgument(oFF.OuTopNDialog.PARAM_VERSION, finalVersionMember);
		ccDlg.setObjectArgument(oFF.OuTopNDialog.PARAM_N_VALUE, oFF.XIntegerValue.create(rankInfo.getMaxRows()));
		ccDlg.setObjectArgument(oFF.OuTopNDialog.PARAM_TOP_OR_BOTTOM_VALUE, oFF.XStringValue.create(comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_N ? oFF.OuTopNDialog.BOTTOM : oFF.OuTopNDialog.TOP));
		ccDlg.setObjectArgument(oFF.DfOuDialogProgram.PARAM_QUERY_MANAGER, this.m_parentDocument.getQueryManager());
		ccDlg.setObjectArgument(oFF.DfOuDialogProgram.PARAM_OK_PROCEDURE, oFF.XProcedureHolder.create( function(){
			this.m_parentDocument.getQueryController().updateQueryResultSet();
		}.bind(this)));
		ccDlg.runProgram();
	}.bind(this)));
	this.m_modelDetails.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
	var iconWidget = this.m_modelDetails.addNewItemOfType(oFF.UiType.ICON);
	iconWidget.setColor(oFF.UiColor.BLUE);
	iconWidget.setHeight(oFF.UiCssLength.create("0.8em"));
	iconWidget.setIcon("fpa/cancel");
	iconWidget.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create( function(evDel){
		cmd.clearRank(rankInfo.getConditionName());
		this.m_parentDocument.updateQueryResultSet();
	}.bind(this)));
};
oFF.AuGdsQueryDetails.prototype.addSeparatorIfNecessary = function()
{
	if (oFF.XCollectionUtils.hasElements(this.m_modelDetails.getItems()))
	{
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SEPARATOR).setHeight(oFF.UiCssLength.create("0.5em"));
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
	}
};
oFF.AuGdsQueryDetails.prototype.getDescriptionWithFallback = function(condition)
{
	var descriptionText = condition.getText();
	if (oFF.XStringUtils.isNullOrEmpty(descriptionText))
	{
		descriptionText = condition.getDescription();
	}
	if (oFF.XStringUtils.isNullOrEmpty(descriptionText))
	{
		descriptionText = condition.getName();
	}
	return descriptionText;
};
oFF.AuGdsQueryDetails.prototype.getTextWithFallback = function(measure)
{
	var measureText = measure.getText();
	if (oFF.XStringUtils.isNullOrEmpty(measureText))
	{
		measureText = measure.getName();
	}
	return measureText;
};
oFF.AuGdsQueryDetails.prototype.getDimensionMember = function(memberName)
{
	var memberNode = this.m_parentDocument.getMemberByTypeAndName(oFF.DimensionType.MEASURE_STRUCTURE, memberName);
	if (oFF.isNull(memberNode))
	{
		memberNode = this.m_parentDocument.getMemberByTypeAndName(oFF.DimensionType.SECONDARY_STRUCTURE, memberName);
	}
	if (oFF.isNull(memberNode))
	{
		memberNode = this.m_parentDocument.getMemberByTypeAndName(oFF.DimensionType.ACCOUNT, memberName);
	}
	return oFF.isNull(memberNode) ? null : memberNode.getDimensionMember();
};
oFF.AuGdsQueryDetails.prototype.prepareDetailsPopOver = function(icon, linkText, flexLayoutConsumer)
{
	this.addSeparatorIfNecessary();
	var popoverEventListener = oFF.AuGdsLambdaListenerWithEvent.create( function(event){
		this.m_popover.clearContent();
		this.m_popover.setPlacement(oFF.UiPlacementType.BOTTOM);
		var flexLayout = this.m_popover.setNewContent(oFF.UiType.FLEX_LAYOUT);
		flexLayout.setDirection(oFF.UiFlexDirection.COLUMN);
		flexLayoutConsumer(flexLayout);
		this.m_popover.openAt(event.getControl());
	}.bind(this));
	if (oFF.XStringUtils.isNotNullAndNotEmpty(icon))
	{
		var iconWidget = this.m_modelDetails.addNewItemOfType(oFF.UiType.ICON);
		iconWidget.setIcon(icon);
		iconWidget.registerOnPress(popoverEventListener);
		iconWidget.registerOnHover(popoverEventListener);
		iconWidget.setColor(oFF.UiColor.BLUE);
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
	}
	var link = this.m_modelDetails.addNewItemOfType(oFF.UiType.LINK);
	link.setFontWeight(oFF.UiFontWeight.BOLD);
	link.setText(linkText);
	link.registerOnPress(popoverEventListener);
	return link;
};
oFF.AuGdsQueryDetails.prototype.complementDetailsPopOver = function(flexLayout, header, popOverDetails)
{
	flexLayout.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
	var headerLabel = flexLayout.addNewItemOfType(oFF.UiType.TITLE).setTitleStyle(oFF.UiTitleLevel.H_3).setTitleLevel(oFF.UiTitleLevel.H_3);
	headerLabel.setText(header);
	headerLabel.setFontSize(oFF.UiCssLength.create("1.2em"));
	if (oFF.XCollectionUtils.hasElements(popOverDetails))
	{
		var iterator = popOverDetails.getIterator();
		while (iterator.hasNext())
		{
			flexLayout.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em"));
			flexLayout.addNewItemOfType(oFF.UiType.LABEL).setText(iterator.next()).setWrapping(true);
		}
	}
};
