	{
		if (queryDetailsConfig.hasStringByKey(oFF.AuGdsQueryDetails.TITLE_TEXT))
		{
			this.setTitle(queryDetailsConfig.getStringByKey(oFF.AuGdsQueryDetails.TITLE_TEXT));
		}
		this.setVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.WIDGET_VISIBLE));
		this.setTableTitleVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.TITLE_VISIBLE));
		this.setModelDetailsVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.DETAILS_VISIBLE));
	}
