oFF.AuGdsQueryDetails.prototype.getConfig = function()
{
	var result = oFF.PrFactory.createStructure();
	result.putStringNotNullAndNotEmpty(oFF.AuGdsQueryDetails.TITLE_TEXT, this.m_title);
	result.putBoolean(oFF.AuGdsQueryDetails.WIDGET_VISIBLE, this.isVisible());
	result.putBoolean(oFF.AuGdsQueryDetails.TITLE_VISIBLE, this.isTableTitleVisible());
	result.putBoolean(oFF.AuGdsQueryDetails.DETAILS_VISIBLE, this.isModelDetailsVisible());
	return result;
};
