oFF.AuGdsQueryDetails.prototype.clearContextMenuDelayed = function()
{
	oFF.XTimeout.timeout(50,  function(){
		this.clearMenuItems();
	}.bind(this));
};
oFF.AuGdsQueryDetails.prototype.clearMenuItems = function()
{
	var items = oFF.XList.create();
	items.addAll(this.m_contextMenu.getItems());
	this.m_contextMenu.clearItems();
	oFF.XTimeout.timeout(50,  function(){
		oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(items);
	}.bind(this));
};
oFF.AuGdsQueryDetails.prototype.onContextMenu = function(event)
{
	var basicContext = this.m_parentDocument.getBasicContextForMenu();
	var showMenu =  function(gme, success){
		if (success)
		{
			var clickX = event.getParameters().getIntegerByKeyExt(oFF.UiControlEvent.PARAM_CLICK_X, 0);
			var clickY = event.getParameters().getIntegerByKeyExt(oFF.UiControlEvent.PARAM_CLICK_Y, 0);
			this.m_contextMenu.openAtPosition(clickX, clickY);
		}
	}.bind(this);
	this.m_parentDocument.getMenuManager().populateMenu(this.m_contextMenu, basicContext, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_TITLE_CONTEXT_MENU, showMenu);
};

