oFF.AuGdsDualPanel.prototype.buildPanelUi = function(genesis)
{
	oFF.AuGdsPanel.prototype.buildPanelUi.call( this , genesis);
	this.getHeader().setVisible(false);
	this.m_root = genesis.newRoot(oFF.UiType.FLEX_LAYOUT);
	this.m_root.setDirection(oFF.UiFlexDirection.ROW);
	this.m_root.useMaxHeight();
	this.m_root.setOverflow(oFF.UiOverflow.HIDDEN);
	this.m_root.addItem(this.m_side.getView());
	this.m_root.addItem(this.m_main.getView());
	var toggleButton = this.m_main.getHeader().addNewItemOfType(oFF.UiType.TOGGLE_BUTTON);
	toggleButton.setText(this.m_side.getTitle());
	toggleButton.setTooltip(this.m_side.getTitle());
	toggleButton.registerOnPress(oFF.AuGdsLambdaListener.create( function(){
		this.m_isSidePanelOpen = toggleButton.isPressed();
		this.updateDualPanel();
	}.bind(this)));
	var hideButton = this.m_side.getHeader().addNewItemOfType(oFF.UiType.BUTTON);
	hideButton.setIcon("decline");
	hideButton.setButtonType(oFF.UiButtonType.TRANSPARENT);
	hideButton.registerOnPress(oFF.AuGdsLambdaListener.create( function(){
		toggleButton.setPressed(false);
		this.m_isSidePanelOpen = false;
		this.updateDualPanel();
	}.bind(this)));
	this.m_isSidePanelOpen = this.getParentDocument().getProcess().getLocalStorage().getBooleanByKeyExt(this.getSidePanelOpenStateKey(), this.m_sidePanelVisibleByDefault);
	toggleButton.setPressed(this.m_isSidePanelOpen);
	this.showHideSidePanel();
};
