{
	this.m_side = oFF.XObjectExt.release(this.m_side);
	this.m_main = oFF.XObjectExt.release(this.m_main);
	this.m_root = oFF.XObjectExt.release(this.m_root);
	oFF.AuGdsPanel.prototype.releaseObject.call( this );
};
