{
	return this.m_isSidePanelOpen ? oFF.AuGdsDualPanel.GDS_DUAL_PANEL_MAX_WIDTH_EXPANDED_IN_PX : oFF.AuGdsPanel.prototype.getMaxWidth.call( this );
};
oFF.AuGdsDualPanel.prototype.getMinWidth = function()
{
	return this.m_isSidePanelOpen ? oFF.AuGdsDualPanel.GDS_DUAL_PANEL_MIN_WIDTH_EXPANDED_IN_PX : oFF.AuGdsPanel.prototype.getMinWidth.call( this );
};
oFF.AuGdsDualPanel.prototype.updateDualPanel = function()
{
	this.showHideSidePanel();
	this.persistSidePanelOpenState();
};
oFF.AuGdsDualPanel.prototype.showHideSidePanel = function()
{
	this.m_side.getView().setVisible(this.m_isSidePanelOpen);
	this.adjustDualPanelWidth();
};
oFF.AuGdsDualPanel.prototype.adjustDualPanelWidth = function()
{
	var widthInPx = this.getMaxWidth();
	var newWidth = oFF.UiCssLength.createExt(widthInPx, oFF.UiCssSizeUnit.PIXEL);
	this.getView().setWidth(newWidth);
	this.getView().setMaxWidth(newWidth);
	this.notifyPanelResize();
};
oFF.AuGdsDualPanel.prototype.getSidePanelOpenStateKey = function()
{
	var panelType = this.getPanelType();
	if (oFF.notNull(panelType))
	{
		return oFF.XStringUtils.concatenate2(panelType.getName(), "_SidePanelOpenState");
	}
	return "";
};
oFF.AuGdsDualPanel.prototype.persistSidePanelOpenState = function()
{
	var sidePanelStateKey = this.getSidePanelOpenStateKey();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(sidePanelStateKey))
	{
		this.getParentDocument().getProcess().getLocalStorage().putBoolean(sidePanelStateKey, this.m_isSidePanelOpen);
	}
};
