oFF.AuGdsQbStylePanel.prototype.addMeasureDropdown = function()
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	var queryModel = this.m_queryManager.getQueryModel();
	var measureDimension = queryModel.getMeasureDimension();
	var allStructureMembers = measureDimension.getAllStructureMembers();
	var memberItems = oFF.XHashMapOfStringByString.create();
	if (allStructureMembers.size() > 1)
	{
		memberItems.put(oFF.AuGdsQbStylePanel.ALL_KEY, i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_MEASURE_ALL));
	}
	for (var i = 0; i < allStructureMembers.size(); i++)
	{
		var member = allStructureMembers.get(i);
		memberItems.put(member.getName(), member.getText());
	}
	var measureText = i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_MEASURE_SELECTION);
	this.m_form.addDropdown(oFF.AuGdsQbStylePanel.MEMBER, this.m_loadedValueMember, measureText, memberItems, false).setValueChangedConsumer( function(key, newValue){
		var value = oFF.XValueUtil.getString(newValue);
		if (oFF.XString.isEqual(value, oFF.AuGdsQbStylePanel.ALL_KEY))
		{
			this.loadStateOfAllMeasures();
		}
		else
		{
			var selectedMember = this.getMeasureDimension().getStructureMember(value);
			this.loadStateOfMeasure(selectedMember);
		}
		this.applyStateToUi();
	}.bind(this));
};
oFF.AuGdsQbStylePanel.prototype.addShiftDropdown = function()
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	if (oFF.XString.isEqual(this.m_loadedValueShift, oFF.AuGdsQbStylePanel.MIXED_KEY))
	{
		this.m_shiftOptions.put(oFF.AuGdsQbStylePanel.MIXED_KEY, i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_MIXED));
	}
	var text = i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_SCALE);
	this.m_form.addDropdown(oFF.AuGdsQbStylePanel.SHIFT, this.m_loadedValueShift, text, this.m_shiftOptions, false).setValueChangedConsumer( function(key, newValue){
		this.saveState();
		this.m_form.getFormItemByKey(oFF.AuGdsQbStylePanel.SHIFT).setDropdownItems(this.m_shiftOptions);
	}.bind(this));
};
oFF.AuGdsQbStylePanel.prototype.addScaleDropdown = function()
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	if (oFF.XString.isEqual(this.m_loadedValueScale, oFF.AuGdsQbStylePanel.MIXED_KEY))
	{
		this.m_scaleOptions.put(oFF.AuGdsQbStylePanel.MIXED_KEY, i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_MIXED));
	}
	var text = i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_DECIMAL_PLACES);
	this.m_form.addDropdown(oFF.AuGdsQbStylePanel.SCALE, this.m_loadedValueScale, text, this.m_scaleOptions, false).setValueChangedConsumer( function(key, newValue){
		this.saveState();
		this.m_form.getFormItemByKey(oFF.AuGdsQbStylePanel.SCALE).setDropdownItems(this.m_scaleOptions);
	}.bind(this));
};
oFF.AuGdsQbStylePanel.prototype.loadStateOfMeasure = function(member)
{
	var numericShift = this.getStringValue(member.getNumericShift(), member.getDefaultNumericShift(), this.m_shiftOptions);
	var numericScale = this.getStringValue(member.getNumericScale(), member.getDefaultNumericScale(), this.m_scaleOptions);
	this.m_loadedValueMember = member.getName();
	this.m_loadedValueShift = numericShift;
	this.m_loadedValueScale = numericScale;
};
oFF.AuGdsQbStylePanel.prototype.loadStateOfAllMeasures = function()
{
	var numericShiftAll = null;
	var numericScaleAll = null;
	var members = this.getMeasureDimension().getAllStructureMembers();
	for (var i = 0; i < members.size(); i++)
	{
		var member = members.get(i);
		var numericShift = this.getStringValue(member.getNumericShift(), member.getDefaultNumericShift(), this.m_shiftOptions);
		if (oFF.isNull(numericShiftAll))
		{
			numericShiftAll = numericShift;
		}
		if (!oFF.XString.isEqual(numericShift, numericShiftAll) && !oFF.XString.isEqual(numericShift, oFF.AuGdsQbStylePanel.MIXED_KEY))
		{
			numericShiftAll = oFF.AuGdsQbStylePanel.MIXED_KEY;
		}
		var numericScale = this.getStringValue(member.getNumericScale(), member.getDefaultNumericScale(), this.m_scaleOptions);
		if (oFF.isNull(numericScaleAll))
		{
			numericScaleAll = numericScale;
		}
		if (!oFF.XString.isEqual(numericScale, numericScaleAll) && !oFF.XString.isEqual(numericScale, oFF.AuGdsQbStylePanel.MIXED_KEY))
		{
			numericScaleAll = oFF.AuGdsQbStylePanel.MIXED_KEY;
		}
	}
	this.m_loadedValueMember = oFF.AuGdsQbStylePanel.ALL_KEY;
	this.m_loadedValueShift = numericShiftAll;
	this.m_loadedValueScale = numericScaleAll;
};
oFF.AuGdsQbStylePanel.prototype.applyStateToUi = function()
{
	var memberDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbStylePanel.MEMBER);
	memberDropdown.setValue(oFF.XStringValue.create(this.m_loadedValueMember));
	var shiftDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbStylePanel.SHIFT);
	this.setDropdownValue(shiftDropdown, this.m_shiftOptions, this.m_loadedValueShift);
	var scaleDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbStylePanel.SCALE);
	this.setDropdownValue(scaleDropdown, this.m_scaleOptions, this.m_loadedValueScale);
};
oFF.AuGdsQbStylePanel.prototype.setDropdownValue = function(dropdown, options, key)
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	var optionsToShow = options;
	if (!options.containsKey(key) && !oFF.XString.isEqual(key, oFF.AuGdsQbStylePanel.DEFAULT_KEY))
	{
		var copy = options.createMapOfStringByStringCopy();
		if (oFF.XString.isEqual(key, oFF.AuGdsQbStylePanel.MIXED_KEY))
		{
			copy.put(key, i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_MIXED));
		}
		else
		{
			copy.put(key, i18n.getText(oFF.AuGdsQueryBuilderI18n.STYLE_OTHER));
		}
		optionsToShow = copy;
	}
	dropdown.setDropdownItems(optionsToShow);
	dropdown.setValue(oFF.XStringValue.create(key));
};
oFF.AuGdsQbStylePanel.prototype.getStringValue = function(modelValue, modelDefault, options)
{
	if (oFF.isNull(modelValue))
	{
		return oFF.AuGdsQbStylePanel.DEFAULT_KEY;
	}
	var stringValue = modelValue.getStringRepresentation();
	if (oFF.isNull(stringValue))
	{
		return oFF.AuGdsQbStylePanel.DEFAULT_KEY;
	}
	if (options.containsKey(stringValue))
	{
		return stringValue;
	}
	if (oFF.notNull(modelDefault) && oFF.XString.isEqual(stringValue, modelDefault.getStringRepresentation()))
	{
		return oFF.AuGdsQbStylePanel.DEFAULT_KEY;
	}
	return stringValue;
};
oFF.AuGdsQbStylePanel.prototype.saveState = function()
{
	var jsonModel = this.m_form.getJsonModel();
	var measureDimension = this.getMeasureDimension();
	var memberName = jsonModel.getStringByKey(oFF.AuGdsQbStylePanel.MEMBER);
	if (oFF.XString.isEqual(memberName, oFF.AuGdsQbStylePanel.ALL_KEY))
	{
		var allMembers = measureDimension.getAllStructureMembers();
		for (var i = 0; i < allMembers.size(); i++)
		{
			this.saveMemberState(jsonModel, allMembers.get(i));
		}
	}
	else
	{
		this.saveMemberState(jsonModel, measureDimension.getStructureMember(memberName));
	}
	this.notifyEditAction();
};
oFF.AuGdsQbStylePanel.prototype.saveMemberState = function(jsonModel, member)
{
	var numericShift = jsonModel.getStringByKey(oFF.AuGdsQbStylePanel.SHIFT);
	var numericScale = jsonModel.getStringByKey(oFF.AuGdsQbStylePanel.SCALE);
	if (oFF.XString.isEqual(numericShift, oFF.AuGdsQbStylePanel.DEFAULT_KEY))
	{
		member.resetToDefaultNumericShift();
	}
	else if (!oFF.XString.isEqual(numericShift, oFF.AuGdsQbStylePanel.MIXED_KEY))
	{
		member.setNumericShift(oFF.XInteger.convertFromString(numericShift));
	}
	if (oFF.XString.isEqual(numericScale, oFF.AuGdsQbStylePanel.DEFAULT_KEY))
	{
		member.resetToDefaultNumericScale();
	}
	else if (!oFF.XString.isEqual(numericScale, oFF.AuGdsQbStylePanel.MIXED_KEY))
	{
		member.setNumericScale(oFF.XInteger.convertFromString(numericScale));
	}
};
