oFF.FilterDialogTestProgram.prototype.evalArguments = function()
{
	var argumentStructure = this.getArgumentStructure();
	if (argumentStructure.getIntegerByKeyExt(oFF.DfProgram.PARAM_XVERSION, -1) === -1)
	{
		argumentStructure.putInteger(oFF.DfProgram.PARAM_XVERSION, oFF.XVersion.V140_REPOSITORY_PERSIST_PAGING);
	}
	oFF.DfUiProgram.prototype.evalArguments.call( this );
	this.m_system = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_SYSTEM);
	this.m_datasource = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_DATASOURCE);
	this.m_dataType = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_DATA_TYPE);
	this.m_dimension = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_DIMENSION);
	this.m_variable = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_VARIABLE);
	this.m_measure = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_MEASURE);
	this.m_hierarchy = this.getParameterValue(oFF.FilterDialogTestProgram.PARAM_HIERARCHY);
	if (oFF.XStringUtils.isNullOrEmpty(this.m_system) || oFF.XStringUtils.isNullOrEmpty(this.m_datasource))
	{
		this.m_system = "KIW";
		this.m_datasource = "query:[0BOC_TEST_DATATYPES_1]";
		this.m_dataType = oFF.FilterDialogTestProgram.DATA_TYPE_DIM;
		this.m_dimension = "0BC_CUST";
		this.m_variable = null;
		this.m_hierarchy = null;
		this.m_measure = null;
	}
};
oFF.FilterDialogTestProgram.prototype.getParameterValue = function(name)
{
	var value = this.getSession().getEnvironment().getStringByKey(name);
	return oFF.XStringUtils.isNotNullAndNotEmpty(value) ? value : this.getArgumentStructure().getStringByKey(name);
};
