oFF.FilterDialogTestProgram.prototype.onFilterDialogOk = function(selection)
{
	var varMemberFilter = null;
	if (this.m_programLayout.getDataObjectVariableRadioBtn().isSelected() && this.getSelectedVariable() !== null)
	{
		varMemberFilter = this.getSelectedVariable().getMemberFilter();
		varMemberFilter.clear();
	}
	var selectedDisplayKeys = oFF.XStringBuffer.create();
	var outputText = "No elements selected";
	if (oFF.XCollectionUtils.hasElements(selection))
	{
		var output = oFF.XStringBuffer.create();
		for (var i = 0; i < selection.size(); i++)
		{
			if (i > 0)
			{
				selectedDisplayKeys.append(",");
				output.appendNewLine();
			}
			var item = selection.get(i);
			if (item.getType() === oFF.FdItemType.RANGE)
			{
				selectedDisplayKeys.append(oFF.XStringUtils.concatenate4(item.isExcluded() ? "![]" : "[]", item.getLow().getDisplayKey(), ":", item.getHigh().getDisplayKey()));
				output.append(oFF.XStringUtils.concatenate3(item.getLow().getDisplayKey(), "-", item.getHigh().getDisplayKey()));
			}
			if (item.getType() === oFF.FdItemType.DATE_RANGE_FIXED || item.getType() === oFF.FdItemType.DATE_RANGE_DYNAMIC)
			{
				output.append(item.toString());
			}
			else
			{
				if (item.getComparisonOperator() === oFF.FdComparisonOperator.NOT_EQUAL)
				{
					selectedDisplayKeys.append("!");
				}
				else if (item.getComparisonOperator() === oFF.FdComparisonOperator.GREATER_THAN)
				{
					selectedDisplayKeys.append(">");
				}
				else if (item.getComparisonOperator() === oFF.FdComparisonOperator.GREATER_EQUAL)
				{
					selectedDisplayKeys.append(">=");
				}
				else if (item.getComparisonOperator() === oFF.FdComparisonOperator.LESS_THAN)
				{
					selectedDisplayKeys.append("<");
				}
				else if (item.getComparisonOperator() === oFF.FdComparisonOperator.LESS_EQUAL)
				{
					selectedDisplayKeys.append("<=");
				}
				selectedDisplayKeys.append(item.getDisplayKey());
				if (oFF.XStringUtils.isNotNullAndNotEmpty(item.getHierarchyName()) && item.getType() !== oFF.FdItemType.HIERARCHY_CATALOG)
				{
					selectedDisplayKeys.append(oFF.FilterDialogTestProgram.SELECTION_HIERARCHY_SEPARATOR).append(item.getHierarchyName());
				}
				output.append(item.getDisplayKey());
			}
			var text = item.getText();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(text))
			{
				output.append(" - ");
				output.append(text);
			}
			if (item.isExcluded())
			{
				output.append(" (excluded)");
			}
			if (oFF.notNull(varMemberFilter))
			{
				varMemberFilter.addNewCartesianElement().getLow().setString(item.getKey());
			}
		}
		outputText = output.toString();
	}
	this.m_programLayout.getSelectionTextArea().setText(selectedDisplayKeys.toString());
	this.m_programLayout.getOutputTextArea().setText(outputText);
};
oFF.FilterDialogTestProgram.prototype.onMeasureBasedFilterOk = function(measureBasedFilter, memberName)
{
	this.m_programLayout.getSelectionTextArea().setText(measureBasedFilter.serializeToString(oFF.QModelFormat.INA_REPOSITORY));
	this.m_programLayout.getOutputTextArea().setText(oFF.XStringUtils.concatenate2("Structure member: ", memberName));
};
oFF.FilterDialogTestProgram.prototype.onLinkedMeasureBasedFilterOk = function()
{
	var linkedFilter = this.m_queryManager.getQueryModel().getFilter().getLinkedFilter(oFF.FilterDialogTestProgram.LINKED_FILTER_NAME);
	if (oFF.notNull(linkedFilter) && linkedFilter.getFilterRootElement().getOlapComponentType() === oFF.FilterComponentType.FILTER_MEASURE_BASED)
	{
		this.m_programLayout.getSelectionTextArea().setText(linkedFilter.serializeToString(oFF.QModelFormat.INA_REPOSITORY));
	}
	else
	{
		this.m_programLayout.getSelectionTextArea().setText(null);
		this.m_programLayout.getOutputTextArea().setText("No linked filter set");
	}
};
oFF.FilterDialogTestProgram.prototype.onFilterDialogCancel = function()
{
	this.m_programLayout.getOutputTextArea().setText("Selection canceled");
};
oFF.FilterDialogTestProgram.prototype.onOrcaFilterDialogOk = function(selection)
{
	var parsedResult = oFF.JsonParserFactory.createFromString(selection).asStructure();
	var prettyPrintedSelection = oFF.PrUtils.serialize(parsedResult, false, true, 2);
	this.m_programLayout.getSelectionTextArea().setText(selection);
	this.m_programLayout.getOutputTextArea().setText(oFF.XStringUtils.concatenate2("Selection changed:\n\n", prettyPrintedSelection));
	if (this.m_programLayout.getDataObjectVariableRadioBtn().isSelected() && this.getSelectedVariable() !== null)
	{
		var varMemberFilter = this.getSelectedVariable().getMemberFilter();
		varMemberFilter.clear();
		var selectedData = parsedResult.getListByKey(oFF.OrcaConstants.SELECTED_DATA);
		for (var i = 0; i < selectedData.size(); i++)
		{
			var selectedKey = selectedData.getStructureAt(i).getStringByKey(oFF.OrcaConstants.NAME);
			varMemberFilter.addNewCartesianElement().getLow().setString(selectedKey);
		}
	}
};
oFF.FilterDialogTestProgram.prototype.onOrcaFilterDialogCancel = function()
{
	this.m_programLayout.getOutputTextArea().setText("Selection canceled");
};
oFF.FilterDialogTestProgram.prototype.onFilterUpdated = function()
{
	var selectedDimension = this.m_programLayout.getDimensionDropdown().getSelectedItem();
	var dimension = oFF.notNull(selectedDimension) ? this.m_queryManager.getDimensionAccessor().getDimensionByName(selectedDimension.getText()) : null;
	var output = "Invalid dimension";
	if (oFF.notNull(dimension))
	{
		var filter;
		if (this.m_programLayout.getUseLinkedFilterRadioBtn().isSelected())
		{
			var linkedFilter = this.m_queryManager.getQueryModel().getFilter().getLinkedFilter(oFF.FilterDialogTestProgram.LINKED_FILTER_NAME);
			filter = oFF.notNull(linkedFilter) ? linkedFilter.getCartesianList(dimension) : null;
		}
		else
		{
			filter = dimension.getFilter();
		}
		if (oFF.notNull(filter))
		{
			output = filter.serializeToString(oFF.QModelFormat.INA_DATA);
			if (oFF.XStringUtils.isNullOrEmpty(output))
			{
				output = "Empty dimension filter added to dynamic filter!";
			}
		}
		else
		{
			output = "No filter set";
		}
	}
	this.m_programLayout.getOutputTextArea().setText(output);
};

