oFF.AuGalaxyDataStudio.prototype.doSetupProgramMetadata = function(metadata)
{
	oFF.DfUiProgram.prototype.doSetupProgramMetadata.call( this , metadata);
	metadata.addOption(oFF.DfProgram.PARAM_FILE, "Specify a gds file", "Relative URI", oFF.XValueType.STRING);
	metadata.addParameter(oFF.AuGdsConstants.PARAM_FILE_CONTENT, "The serialized content of a file");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_DOCUMENTS, "A list of documents which shold be opened. The list item needs to have at least a file or docType property.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_DOC_TYPE, "The document type to open.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_TOOL_NAME, "When set then the custom tool name will be used instead of the document name.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_HIDE_MENU_BAR, "Whether the menu bar should be hidden.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_HIDE_STATUS_BAR, "Whether the status bar should be hidden.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_HIDE_TOOLBAR, "Whether the toolbar should be hidden.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_MULTI_DOCUMENTS, "Whether multiple documents can be opened simultaneously.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_INTEGRATION, "The name of the integration the program should be run in.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_CONFIGURATION, "A stringified json containing the program configuration data.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_CONFIG_FILE, "A file path (including directory+file name) pointing to a config file.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_MODE, "A mode that controls the standard configs to be loaded.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_DEBUG, "Enable program debugging features.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_ADVANCED_FEATURES, "Enable advanced program features.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_BLEEDING_EDGE, "Enable experimental features.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_FILE_SYSTEM, "Specify a file system to be used.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_SYSTEM, "The system to connect to.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_DATASOURCE, "The datasource to be used.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_QUERY_MANAGER, "An external query manager to be used.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_AUTO_OPEN_DATA_SOURCE_PICKER, "Whether to automatically open the data source picker when an empty query builder document is opened.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_MULTI_VIEWS, "Whether multiple views are enabled for the query builder.");
	metadata.addParameter(oFF.AuGdsConstants.PARAM_IMPLICIT_VARIABLE_HANDLING, "Whether GDS should take care of all variable values and state.");
};
