oFF.AuGalaxyDataStudio.prototype.loadPluginMenuConfiguration = function(name, pluginConfig)
{
	var success = false;
	var menuManager = this.getMenuManager();
	var menuGenerator = oFF.isNull(menuManager) ? null : menuManager.getMenuGenerator();
	if (oFF.notNull(menuGenerator))
	{
		menuGenerator.loadPluginConfiguration(name, pluginConfig);
		success = true;
	}
	return success;
};
