oFF.AuGalaxyDataStudio.prototype.activateFileSystemIfNeeded = function()
{
	var custFileSystem = this.getArgumentsManager().getCustomFileSystem();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(custFileSystem))
	{
		var process = this.getProcess();
		if (oFF.notNull(process))
		{
			var fileSystemManager = process.getFileSystemManager();
			var targetFsUri = oFF.XUri.createFromUrl(custFileSystem);
			fileSystemManager.processFetchFileSystemExt(oFF.SyncType.BLOCKING, null, null, targetFsUri, true);
		}
	}
};
oFF.AuGalaxyDataStudio.prototype.handleStartup = function()
{
	if (this.getArgumentsManager().hasFileContentArgument())
	{
		this.handleDocumentLoadByFileContent(this.getArgumentsManager().getFileContentArgument());
	}
	else if (this.getArgumentsManager().hasValidDocumentArguments())
	{
		this.processProgramArguments();
	}
	else
	{
		this.showHomeView();
	}
};
oFF.AuGalaxyDataStudio.prototype.showHomeView = function()
{
	this.getArgumentsManager().clearAllArguments();
	this.getToolbarManager().showToolbarIfPossible();
	this.getStatusBarManager().hideNetworkActivityIndicator();
	this.resetMenuBar();
	this.resetToolbar();
	this.setTitle("Galaxy Data Studio");
	this.m_menuBarDocumentBtn.setEnabled(false);
	if (oFF.notNull(this.m_toolbarSaveAsBtn))
	{
		this.m_toolbarSaveAsBtn.setEnabled(false);
	}
	if (oFF.notNull(this.m_toolbarCloseDocBtn))
	{
		this.m_toolbarCloseDocBtn.setEnabled(false);
	}
	if (oFF.notNull(this.m_toolbarUndoBtn))
	{
		this.m_toolbarUndoBtn.setEnabled(false);
	}
	if (oFF.notNull(this.m_toolbarRedoBtn))
	{
		this.m_toolbarRedoBtn.setEnabled(false);
	}
	this.getStatusBarManager().setStatusInfo("No document open!");
	this.m_contentLayout.clearItems();
	if (oFF.isNull(this.m_homeView))
	{
		this.m_homeView = oFF.AuGdsHomeView.create(this, this);
	}
	else
	{
		this.m_homeView.reloadRecentFilesList();
	}
	this.m_contentLayout.addItem(this.m_homeView.getView());
};
oFF.AuGalaxyDataStudio.prototype.processProgramArguments = function()
{
	this.getArgumentsManager().processDocumentsArgument( function(docArgs, docFile, docType){
		var tmpArgs = docArgs;
		var tmpFile = docFile;
		var tmpDocType = docType;
		if (oFF.notNull(tmpDocType))
		{
			this.openDocument(tmpDocType, docFile, null, tmpArgs);
		}
		else if (oFF.notNull(tmpFile))
		{
			this.setContentBusy(true);
			this.tempLoadDocument(tmpArgs, tmpFile);
		}
		else
		{
			this.getGenesis().showWarningToast("Cannot process arguments! Unknown document type! Please specify the 'docType' argument!");
		}
	}.bind(this));
};
oFF.AuGalaxyDataStudio.prototype.tempLoadDocument = function(tmpArgs, tmpFile)
{
	this.getFileManager().loadDocument(tmpFile,  function(docType2, file, jsonObj){
		this.handleDocumentLoad(docType2, file, jsonObj, tmpArgs);
	}.bind(this));
};
oFF.AuGalaxyDataStudio.prototype.openDocument = function(docType, docFile, docJson, argJson)
{
	if (this.getFeatureManager().areMultipleDocumentsEnabled())
	{
		var newDocument = oFF.AuGdsDocumentFactory.create(this, docType, docFile, docJson, argJson);
		if (oFF.notNull(newDocument))
		{
			this.addDocumentTab(newDocument);
		}
	}
	else
	{
		this.closeActiveDocument();
		var newDocument2 = oFF.AuGdsDocumentFactory.create(this, docType, docFile, docJson, argJson);
		if (oFF.notNull(newDocument2))
		{
			this.showSingleDocument(newDocument2);
		}
	}
};
oFF.AuGalaxyDataStudio.prototype.openNewEmptyDocumentByType = function(docType)
{
	this.openDocument(docType, null, null, null);
};
oFF.AuGalaxyDataStudio.prototype.showSingleDocument = function(document)
{
	this.m_contentLayout.clearItems();
	this.m_contentLayout.addItem(document.getView());
	this.documentOpened(document);
};
oFF.AuGalaxyDataStudio.prototype.addDocumentTab = function(document)
{
	if (oFF.isNull(this.m_documentTabBar))
	{
		this.m_contentLayout.clearItems();
		this.m_documentTabBar = this.m_contentLayout.addNewItemOfType(oFF.UiType.TAB_BAR);
		this.m_documentTabBar.setTag(oFF.AuGalaxyDataStudio.MAIN_TAB_BAR_TAG);
		this.m_documentTabBar.useMaxSpace();
		this.m_documentTabBar.registerOnItemSelect(this);
		this.m_documentTabBar.registerOnItemClose(this);
		this.m_documentTabBar.registerOnButtonPress(this);
	}
	if (this.m_documentTabBar.getParent() === null)
	{
		this.m_contentLayout.clearItems();
		this.m_contentLayout.addItem(this.m_documentTabBar);
	}
	this.m_documentTabBar.addItem(document.getTabItem());
	this.m_documentTabBar.setSelectedItem(document.getTabItem());
	this.documentOpened(document);
};
oFF.AuGalaxyDataStudio.prototype.closeDocument = function(document)
{
	if (oFF.notNull(document))
	{
		if (this.getFeatureManager().areMultipleDocumentsEnabled())
		{
			this.closeDocumentMulti(document);
		}
		else
		{
			this.closeDocumentSingle(document);
		}
	}
};
oFF.AuGalaxyDataStudio.prototype.closeDocumentMulti = function(document)
{
	if (oFF.notNull(document))
	{
		var closedIndex = this.m_documentTabBar.getIndexOfItem(document.getTabItem());
		this.m_documentTabBar.removeItem(document.getTabItem());
		var closedDocument = this.m_openDocuments.remove(document.getUuid());
		var newActiveIndex = closedIndex === 0 ? closedIndex : closedIndex - 1;
		if (this.m_openDocuments.hasElements())
		{
			var newSelectedDocument = this.m_documentTabBar.getItem(newActiveIndex).getCustomObject();
			if (oFF.notNull(newSelectedDocument) && this.m_openDocuments.contains(newSelectedDocument))
			{
				this.m_documentTabBar.setSelectedItem(newSelectedDocument.getTabItem());
				this.activeDocumentChanged(newSelectedDocument);
			}
		}
		else
		{
			this.showHomeView();
			this.m_activeDocument = null;
		}
		this.notifyAndCleanupDocumentClose(closedDocument);
	}
};
oFF.AuGalaxyDataStudio.prototype.closeDocumentSingle = function(document)
{
	if (oFF.notNull(document))
	{
		var closedDocument = this.m_openDocuments.remove(document.getUuid());
		this.showHomeView();
		this.m_activeDocument = null;
		this.notifyAndCleanupDocumentClose(closedDocument);
	}
};
oFF.AuGalaxyDataStudio.prototype.notifyAndCleanupDocumentClose = function(document)
{
	if (oFF.notNull(document))
	{
		document.notifyBeforeClose();
		oFF.XObjectExt.release(document);
	}
};
oFF.AuGalaxyDataStudio.prototype.closeDocumentSafe = function(document)
{
	if (oFF.notNull(document))
	{
		if (this.m_activeDocument.isDirty())
		{
			this.presentDocumentUnsavedChangesPopup(document);
		}
		else
		{
			this.closeDocument(document);
		}
	}
};
oFF.AuGalaxyDataStudio.prototype.closeActiveDocument = function()
{
	if (oFF.notNull(this.m_activeDocument))
	{
		this.closeDocument(this.m_activeDocument);
	}
};
oFF.AuGalaxyDataStudio.prototype.closeActiveDocumentSafe = function()
{
	if (oFF.notNull(this.m_activeDocument))
	{
		if (this.m_activeDocument.isDirty())
		{
			this.presentDocumentUnsavedChangesPopup(this.m_activeDocument);
		}
		else
		{
			this.closeActiveDocument();
		}
	}
};
oFF.AuGalaxyDataStudio.prototype.closeAllDocuments = function()
{
	var openDocumentsKeys = this.m_openDocuments.getKeysAsIteratorOfString();
	while (openDocumentsKeys.hasNext())
	{
		var tmpDocKey = openDocumentsKeys.next();
		var tmpDocument = this.m_openDocuments.getByKey(tmpDocKey);
		this.closeDocument(tmpDocument);
	}
};
oFF.AuGalaxyDataStudio.prototype.documentOpened = function(document)
{
	this.m_openDocuments.put(document.getUuid(), document);
	this.activeDocumentChanged(document);
	if (oFF.notNull(this.m_toolbarCloseDocBtn))
	{
		this.m_toolbarCloseDocBtn.setEnabled(true);
	}
	this.m_menuBarDocumentBtn.setEnabled(true);
	oFF.AuGdsExternalConfiguration.getInstance().fireDocumentOpenedCallback(document);
};
oFF.AuGalaxyDataStudio.prototype.activeDocumentChanged = function(document)
{
	if (oFF.notNull(document) && this.m_activeDocument !== document)
	{
		this.setTitle(document.getTitle());
		this.resetMenuBar();
		var menuButtonIterator = document.getMenuButtons().getIterator();
		while (menuButtonIterator.hasNext())
		{
			var tmpMenuBtn = menuButtonIterator.next();
			this.getMenuBar().addItem(tmpMenuBtn);
		}
		this.resetToolbar();
		oFF.XCollectionUtils.forEach(document.getToolbarGroups(),  function(toolbarGroup){
			this.getToolbarManager().addToolbarGroup(toolbarGroup);
		}.bind(this));
		oFF.XCollectionUtils.forEach(document.getToolbarFixedSectonItems(),  function(control){
			this.getToolbarManager().addFixedSectionControl(control);
		}.bind(this));
		if (oFF.notNull(this.m_toolbarUndoBtn))
		{
			this.m_toolbarUndoBtn.setEnabled(document.hasUndoSteps());
		}
		if (oFF.notNull(this.m_toolbarRedoBtn))
		{
			this.m_toolbarRedoBtn.setEnabled(document.hasRedoSteps());
		}
		if (oFF.notNull(this.m_toolbarSaveAsBtn))
		{
			this.m_toolbarSaveAsBtn.setEnabled(document.hasSaveData());
		}
		this.getStatusBarManager().setStatus(document.getStatusMessage(), document.getStatusMessageType());
		if (oFF.notNull(this.m_activeDocument))
		{
			this.m_activeDocument.notifyBecameHidden();
		}
		this.m_activeDocument = document;
		document.notifyBecameVisible();
	}
};
oFF.AuGalaxyDataStudio.prototype.cleanControlList = function(itemContainer)
{
	while (itemContainer.hasItems())
	{
		var lastIndex = itemContainer.getItemCount() - 1;
		var lastControl = itemContainer.getItem(lastIndex);
		if (oFF.notNull(lastControl) && oFF.XString.isEqual(lastControl.getTag(), oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG))
		{
			break;
		}
		itemContainer.removeItem(lastControl);
	}
};
oFF.AuGalaxyDataStudio.prototype.resetMenuBar = function()
{
	this.cleanControlList(this.getMenuBar());
};
oFF.AuGalaxyDataStudio.prototype.resetToolbar = function()
{
	this.getToolbarManager().clearNonPersistentToolbarItems();
};
oFF.AuGalaxyDataStudio.prototype.presentDocumentUnsavedChangesPopup = function(document)
{
	var unsavedPopup = oFF.UiConfirmPopup.create(this.getGenesis(), "Unsaved changes!", "The document which you are trying to close has unsaved changes. Are you sure you want to close it?");
	unsavedPopup.setConfirmButtonText("Close without saving");
	unsavedPopup.setConfirmButtonIcon("delete");
	unsavedPopup.setConfirmButtonType(oFF.UiButtonType.DESTRUCTIVE);
	unsavedPopup.setConfirmProcedure( function(){
		this.closeDocument(document);
	}.bind(this));
	unsavedPopup.open();
};
oFF.AuGalaxyDataStudio.prototype.setContentBusy = function(busy)
{
	this.m_contentLayout.setBusy(busy);
};
oFF.AuGalaxyDataStudio.prototype.loadDocumentFileByPath = function(path)
{
	try
	{
		this.setContentBusy(true);
		this.getFileManager().loadDocumentByPath(path,  function(docType, file, jsonObj){
			this.handleDocumentLoad(docType, file, jsonObj, null);
		}.bind(this));
	}
	catch (e)
	{
		this.setContentBusy(false);
		var errorMsg = oFF.XException.getMessage(e);
		errorMsg = oFF.XStringUtils.concatenate4("Could not load file with path: ", path, ". Reason: ", errorMsg);
		this.getMessageCenter().showErrorToast(errorMsg);
	}
};
oFF.AuGalaxyDataStudio.prototype.handleDocumentLoad = function(docType, file, gdfJson, argJson)
{
	this.setContentBusy(false);
	if (oFF.isNull(docType))
	{
		this.getMessageCenter().showErrorToast("Unknown document type!");
	}
	else if (oFF.notNull(file) && oFF.isNull(gdfJson))
	{
		this.getMessageCenter().showErrorToast(oFF.XStringUtils.concatenate3("Error while processing the file ", file.getUri().getFileName(), "!"));
	}
	else if (oFF.isNull(file) && oFF.isNull(gdfJson))
	{
		this.getMessageCenter().showErrorToast("Error while fetching the specified file!");
	}
	else
	{
		this.openDocument(docType, file, gdfJson, argJson);
		this.getSettingsManager().addRecentFileEntry(file);
	}
};
oFF.AuGalaxyDataStudio.prototype.handleDocumentSave = function(extResult)
{
	if (extResult.hasErrors())
	{
		this.getGenesis().showErrorToast(extResult.getSummary());
	}
	else
	{
		this.handleAfterDocumentSaved(extResult.getData());
	}
};
oFF.AuGalaxyDataStudio.prototype.handleAfterDocumentSaved = function(file)
{
	this.getSettingsManager().addRecentFileEntry(file);
	var fileName = oFF.SuResourceWrapper.create(file).getDisplayName();
	var msg = this.getGlobalLocalization().getTextWithPlaceholder(oFF.AuGalaxyDataStudioI18n.SAVE_RESOURCE_SUCCESS, fileName);
	this.getMessageCenter().showSuccessToast(msg);
};
oFF.AuGalaxyDataStudio.prototype.handleDocumentLoadByFileContent = function(fileContent)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(fileContent))
	{
		this.setContentBusy(true);
		var parser = oFF.JsonParserFactory.newInstance();
		var tmpElement = parser.parse(fileContent);
		var jsonObj = null;
		if (oFF.notNull(tmpElement) && tmpElement.isStructure())
		{
			jsonObj = tmpElement;
		}
		parser = oFF.XObjectExt.release(parser);
		var docType = this.getFileManager().determineDocumentType(jsonObj, null);
		this.handleDocumentLoad(docType, null, jsonObj, null);
	}
};
oFF.AuGalaxyDataStudio.prototype.handleFileDrop = function(event)
{
	var fileContent = event.getParameters().getStringByKeyExt(oFF.UiControlEvent.PARAM_FILE_CONTENT, null);
	this.handleDocumentLoadByFileContent(fileContent);
};
oFF.AuGalaxyDataStudio.prototype.hasUnsavedChanges = function()
{
	if (oFF.notNull(this.m_openDocuments))
	{
		var openDocumentsKeys = this.m_openDocuments.getKeysAsIteratorOfString();
		while (openDocumentsKeys.hasNext())
		{
			var tmpDocKey = openDocumentsKeys.next();
			var tmpDocument = this.m_openDocuments.getByKey(tmpDocKey);
			if (tmpDocument.isDirty())
			{
				return true;
			}
		}
	}
	return false;
};
oFF.AuGalaxyDataStudio.prototype.saveActiveDocumentInternal = function()
{
	var saveActiveDocPromise = oFF.XPromise.create( function(resolve, reject){
		if (oFF.notNull(this.m_activeDocument))
		{
			this.m_activeDocument.executeSave( function(extResult){
				this.handleDocumentSave(extResult);
				if (oFF.notNull(extResult) && extResult.isValid())
				{
					resolve(this.m_activeDocument);
				}
				else if (oFF.notNull(extResult) && extResult.hasErrors())
				{
					reject(extResult.getFirstError().getText());
				}
				else
				{
					reject("Failed to save active document. Unknown error!");
				}
			}.bind(this));
		}
		else
		{
			reject("No active document!");
		}
	}.bind(this));
	return saveActiveDocPromise;
};
