oFF.AuGalaxyDataStudio.prototype.openPressed = function()
{
	var didPresentDocumentDialog = false;
	if (oFF.notNull(this.m_activeDocument))
	{
		didPresentDocumentDialog = this.m_activeDocument.presentOpenDialog();
	}
	if (!didPresentDocumentDialog)
	{
		var title = this.getLocalization().getText(oFF.AuGalaxyDataStudioI18n.RESOURCE_EXPLORER_TITLE_OPEN_DOCUMENT);
		var resExplorerOpenRunner = oFF.AuGdsResourceExplorerProgramFactory.createResourceExplorerGdsDocumentOpen(this.getProcess(), title, this.getConfiguration(), oFF.SuResourceExplorerListener.createOK( function(resourceInfo, dialog){
			this.handleResourceExplorerFileSelected(resourceInfo);
			dialog.close();
		}.bind(this)));
		resExplorerOpenRunner.runProgram();
	}
};
