oFF.AuGdsProfilerPanel.prototype.buildTree = function(container)
{
	var treeLayout = container.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	treeLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	treeLayout.setPadding(oFF.UiCssBoxEdges.create("6px"));
	treeLayout.setFlex("1");
	if (oFF.notNull(this.m_treeTable))
	{
		this.m_treeTable = oFF.XObjectExt.release(this.m_treeTable);
	}
	this.m_treeTable = treeLayout.addNewItemOfType(oFF.UiType.TREE_TABLE);
	this.m_treeTable.setSelectionMode(oFF.UiSelectionMode.NONE);
	this.m_treeTable.setFlex("12");
	this.m_treeTable.addNewColumn().setTitle("Step");
	this.m_treeTable.addNewColumn().setTitle("Time in ms");
	this.m_treeTable.addTreeTableRow(this.getTreeItem(this.m_queryManager.getRootProfileNode(), this.m_treeTable));
	this.m_treeTable.addTreeTableRow(this.getTreeItem(this.m_queryManager.getActiveResultSetContainer().getRootProfileNode(), this.m_treeTable));
};
oFF.AuGdsProfilerPanel.prototype.getTreeItem = function(profileNode, parent)
{
	var nodeItem = parent.newItemOfType(oFF.UiType.TREE_TABLE_ROW);
	nodeItem.addNewCell().setText(profileNode.getProfileNodeText());
	nodeItem.addNewCell().setText(oFF.XLong.convertToString(profileNode.getDuration()));
	if (profileNode.getProfileSteps() !== null)
	{
		for (var i = 0; i < profileNode.getProfileSteps().size(); i++)
		{
			nodeItem.addTreeTableRow(this.getTreeItem(profileNode.getProfileSteps().get(i), nodeItem));
		}
	}
	return nodeItem;
};
oFF.AuGdsProfilerPanel.prototype.buildAscii = function(container)
{
	var treeLayout = container.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	treeLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	treeLayout.setPadding(oFF.UiCssBoxEdges.create("6px"));
	treeLayout.setFlex("1");
	var label = treeLayout.addNewItemOfType(oFF.UiType.LABEL);
	label.setText("ASCII:");
	label.setFontWeight(oFF.UiFontWeight.BOLD);
	label.setPadding(oFF.UiCssBoxEdges.create("4px"));
	label.setFlex("1");
	var asciiTable = treeLayout.addNewItemOfType(oFF.UiType.TEXT_AREA);
	asciiTable.setEditable(false);
	asciiTable.setFlex("12");
	var asciiTableText = oFF.XStringBuffer.create();
	asciiTableText.append(this.getAsciiItem(this.m_queryManager.getRootProfileNode(), 0, 0));
	asciiTableText.append("\n");
	asciiTableText.append(this.getAsciiItem(this.m_queryManager.getActiveResultSetContainer().getRootProfileNode(), 0, 0));
	asciiTable.setText(asciiTableText.toString());
};
oFF.AuGdsProfilerPanel.prototype.getAsciiItem = function(profileNode, level, count)
{
	var asciiTableText = oFF.XStringBuffer.create();
	if (level > 0)
	{
		for (var i = 0; i < level; i++)
		{
			asciiTableText.append("  ");
		}
		if (count === 0)
		{
			asciiTableText.append("+");
		}
		else
		{
			asciiTableText.append("|");
		}
		asciiTableText.append("--");
	}
	asciiTableText.append(profileNode.getProfileNodeText()).append("\t").append(oFF.XLong.convertToString(profileNode.getDuration())).append("ms");
	asciiTableText.append("\n");
	if (profileNode.getProfileSteps() !== null)
	{
		for (var j = 0; j < profileNode.getProfileSteps().size(); j++)
		{
			asciiTableText.append(this.getAsciiItem(profileNode.getProfileSteps().get(j), level + 1, j));
		}
	}
	return asciiTableText.toString();
};
