oFF.AuGdsQbBuilderPanel.moveModel = function(model, event, currentOrder)
{
	var dropTarget = event.getControl();
	var insertIndex = oFF.AuGdsQbBuilderPanel.calcDropIndex(event);
	if (insertIndex >= 0 && insertIndex < dropTarget.getItemCount())
	{
		var currentIndex = currentOrder.getIndex(model);
		var payload = dropTarget.getItem(insertIndex).getCustomObject();
		var successor = payload.getModelComponent();
		insertIndex = currentOrder.getIndex(successor);
		if (currentIndex >= 0)
		{
			currentOrder.removeAt(currentIndex);
			if (currentIndex < insertIndex)
			{
				insertIndex--;
			}
		}
		currentOrder.insert(insertIndex, model);
	}
	else
	{
		currentOrder.removeElement(model);
		currentOrder.add(model);
	}
};
oFF.AuGdsQbBuilderPanel.calcDropIndex = function(event)
{
	var dropPosition = event.getRelativeDropPosition();
	var list = event.getControl();
	if (list.getUiType() !== oFF.UiType.LIST)
	{
		return -1;
	}
	var dropIndex = list.getIndexOfItem(event.getDroppedControl());
	dropIndex = dropPosition === oFF.UiRelativeDropPosition.BEFORE ? dropIndex : dropIndex + 1;
	return dropIndex;
};
