oFF.AuGdsQbBuilderPanel.prototype.updatePanelUi = function()
{
	this.resetPanel();
	if (oFF.isNull(this.m_queryManager))
	{
		return;
	}
	this.updateAxisView(this.m_rows, this.m_queryManager.getQueryModel().getRowsAxis());
	this.updateAxisView(this.m_cols, this.m_queryManager.getQueryModel().getColumnsAxis());
	this.updateLabels();
};
oFF.AuGdsQbBuilderPanel.prototype.resetPanel = function()
{
	var rowItems = this.m_rows.getList().getItems();
	var colItems = this.m_cols.getList().getItems();
	this.m_rows.getList().clearItems();
	this.m_cols.getList().clearItems();
	oFF.XCollectionUtils.releaseEntriesFromCollection(this.m_dimViews);
	oFF.XCollectionUtils.releaseEntriesFromCollection(rowItems);
	oFF.XCollectionUtils.releaseEntriesFromCollection(colItems);
	this.m_dimViews.clear();
	this.m_labels.clear();
};
oFF.AuGdsQbBuilderPanel.prototype.updateAxisView = function(view, axis)
{
	var list = view.getList();
	for (var i = 0; i < axis.size(); i++)
	{
		var dim = axis.get(i);
		if (oFF.AuGdsQbUtils.shouldDimensionBeShown(dim, this.m_supportsDimensionGrouping))
		{
			var dimView = this.buildDimItem(dim);
			list.addItem(dimView.getListItemRoot());
			this.m_dimViews.add(dimView);
		}
	}
	list.setVisible(list.hasItems());
	view.getRoot().setExpandable(list.hasItems());
	view.getRoot().setExpanded(this.m_panelExpansion.getBooleanByKeyExt(axis.getType().getName(), true));
	view.getHeaderLayout().setPadding(oFF.UiCssBoxEdges.create(list.hasItems() ? "0" : "0 0 0 1.75rem"));
	view.getHeaderBtn().registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create( function(evt){
		this.showAxisMenu(evt, axis);
	}.bind(this)));
};
oFF.AuGdsQbBuilderPanel.prototype.updateLabels = function()
{
	for (var i = 0; i < this.m_labels.size(); i++)
	{
		var displayLabel = this.m_labels.get(i);
		var customOmodelComponentject = displayLabel.getCustomObject();
		var text = this.getPresentationType().getDisplayValueByType(customOmodelComponentject);
		displayLabel.setText(text);
		displayLabel.setTooltip(text);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.buildMemberList = function(dim, listOfMembers, container)
{
	var views = oFF.XList.create();
	var posNegPair = oFF.AuGdsQbDesignerUtils.getVisibleByFilter(dim);
	for (var j = 0; j < listOfMembers.size(); j++)
	{
		var member = listOfMembers.get(j);
		if (oFF.AuGdsQbDesignerUtils.isVisibleByFilter(member, posNegPair))
		{
			var view = this.buildMemberItem(member);
			container.addItem(view.getRoot());
			views.add(view);
		}
	}
	if (dim.isMeasureStructure() && !container.hasItems())
	{
		this.addPlaceholderItem(container);
	}
	return views;
};
