oFF.AuGdsQbBuilderPanel.prototype.buildDimItem = function(dim)
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	var listItem = this.getGenesis().newControl(oFF.UiType.CUSTOM_LIST_ITEM);
	if (this.getParentDocument().getFeatureManager().areAdvancedFeaturesEnabled())
	{
		listItem.registerOnContextMenu(oFF.AuGdsLambdaListenerWithEvent.create( function(evt1){
			this.showDimMenu(evt1, dim);
		}.bind(this)));
	}
	listItem.setDraggable(true);
	listItem.setTag(oFF.AuGdsQbConstants.QD_UI_DRAG_ELEMENT);
	listItem.setCustomObject(oFF.AuGdsQbDragPayloadSimple.createWrapper(dim));
	listItem.registerOnDragStart(oFF.UiLambdaDragStartListener.create( function(startEvt){
		this.dragStartModelComponent(dim);
	}.bind(this)));
	listItem.registerOnDragEnd(oFF.UiLambdaDragEndListener.create( function(endEvt){
		this.dragEnd();
	}.bind(this)));
	var panel = listItem.setNewContent(oFF.UiType.PANEL);
	panel.addCssClass("ffGdsQbFoldable");
	panel.setMinHeight(oFF.UiCssLength.create("0"));
	panel.setBackgroundDesign(oFF.UiBackgroundDesign.TRANSPARENT);
	panel.registerOnCollapse(oFF.AuGdsLambdaListener.create( function(){
		this.m_panelExpansion.putBoolean(dim.getName(), false);
	}.bind(this)));
	panel.registerOnExpand(oFF.AuGdsLambdaListener.create( function(){
		this.m_panelExpansion.putBoolean(dim.getName(), true);
	}.bind(this)));
	var header = panel.setNewHeader(oFF.UiType.FLEX_LAYOUT);
	header.addCssClass("ffGdsQbBuilderPanelDimensionHeader");
	header.useMaxWidth();
	header.setDirection(oFF.UiFlexDirection.ROW);
	header.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	header.setJustifyContent(oFF.UiFlexJustifyContent.SPACE_BETWEEN);
	var nameLbl = header.addNewItemOfType(oFF.UiType.LABEL);
	this.configurePanelLabel(dim, listItem, nameLbl);
	var buttons = header.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	buttons.setDirection(oFF.UiFlexDirection.ROW);
	buttons.setFlex("0 0 auto");
	if (!dim.isStructure())
	{
		var moreIcon = buttons.addNewItemOfType(oFF.UiType.BUTTON);
		moreIcon.addCssClass("ffGdsQbBuilderPanelDimensionMoreBtn");
		moreIcon.setIcon("overflow");
		moreIcon.setButtonType(oFF.UiButtonType.TRANSPARENT);
		moreIcon.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_MORE));
		moreIcon.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create( function(evt2){
			moreIcon.addCssClass("ffGdsQbBuilderPanelDimensionMoreBtnForceVisible");
			this.showDimMenuWithAction(evt2, dim,  function(){
				moreIcon.removeCssClass("ffGdsQbBuilderPanelDimensionMoreBtnForceVisible");
			}.bind(this));
		}.bind(this)));
		var removeIcon = buttons.addNewItemOfType(oFF.UiType.BUTTON);
		removeIcon.setIcon("sys-cancel");
		removeIcon.setButtonType(oFF.UiButtonType.TRANSPARENT);
		removeIcon.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.BUILDER_REMOVE));
		removeIcon.registerOnPress(oFF.AuGdsLambdaListener.create( function(){
			this.handleDimensionRemoval(dim, listItem);
		}.bind(this)));
	}
	var childrenList = this.getGenesis().newControl(oFF.UiType.LIST);
	var children;
	if (oFF.AuGdsQbUtils.isStructureLike(dim))
	{
		var members;
		if (dim.getDimensionType() === oFF.DimensionType.ACCOUNT)
		{
			var parentDocument = this.getParentDocument();
			var accountMember = parentDocument.getMemberByType(oFF.DimensionType.ACCOUNT);
			members = oFF.XStream.of(accountMember).map( function(a){
				return a.getDimensionMember();
			}.bind(this)).collect(oFF.XStreamCollector.toList());
		}
		else
		{
			var structureMembers = oFF.AuGdsQbDesignerUtils.getMemberOrder(dim);
			members = oFF.XStream.of(structureMembers).map( function(m){
				return m.getDimensionMember();
			}.bind(this)).collect(oFF.XStreamCollector.toList());
		}
		children = this.buildMemberList(dim, members, childrenList);
	}
	else
	{
		children = this.buildAttributeList(dim, childrenList);
	}
	if (childrenList.hasItems())
	{
		panel.setContent(childrenList);
		panel.setExpandable(true);
		panel.setExpanded(this.m_panelExpansion.getBooleanByKeyExt(dim.getName(), dim.isMeasureStructure()));
		header.setPadding(oFF.UiCssBoxEdges.create("0"));
	}
	else
	{
		header.setPadding(oFF.UiCssBoxEdges.create("0 0 0 2.5rem"));
	}
	var dimView = oFF.AuGdsQbDimensionView.createForBuilderPanel(dim, children, childrenList);
	dimView.setListItemRoot(listItem);
	dimView.setHeader(header);
	return dimView;
};
oFF.AuGdsQbBuilderPanel.prototype.configurePanelLabel = function(dim, item, label)
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	if (dim.isMeasureStructure())
	{
		item.addCssClass("ffGdsQbBuilderPanelMeasure");
		label.setText(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_MEASURES));
		label.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_MEASURES));
	}
	else if (dim.isStructure())
	{
		item.addCssClass("ffGdsQbBuilderPanelSecondStructure");
		label.setText(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_STRUCTURE));
		label.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_STRUCTURE));
	}
	else if (dim.getDimensionType() === oFF.DimensionType.ACCOUNT)
	{
		item.addCssClass("ffGdsQbBuilderPanelAccount");
		label.setText(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_ACCOUNT));
		label.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.COMMON_ACCOUNT));
	}
	else
	{
		label.setCustomObject(dim);
		this.m_labels.add(label);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.configureDragDropAxis = function(model, view)
{
	var axisType = view.getAxisType();
	var header = view.getHeaderLayout();
	var list = view.getList();
	var dropZone = view.getDropZone();
	if (oFF.AuGdsQbUtils.isDimension(model))
	{
		var dim = model;
		this.setDropInfo(header, list, dropZone, oFF.UiLambdaDropListener.create( function(dimDrop){
			this.handleDimDrop(dimDrop, dim, axisType);
		}.bind(this)));
	}
	else if (oFF.AuGdsQbUtils.isMember(model) || oFF.AuGdsQbUtils.isAttribute(model))
	{
		var isMember = oFF.AuGdsQbUtils.isMember(model);
		var parentDim = model.getDimension();
		if (parentDim.getAxisType() !== axisType)
		{
			this.setDropInfo(header, list, dropZone, oFF.UiLambdaDropListener.create( function(headerDrop){
				if (isMember)
				{
					this.addMemberIfNotPresent(model);
				}
				else
				{
					this.addAttributeIfNotPresent(model);
				}
				this.handleDimDrop(headerDrop, parentDim, axisType);
			}.bind(this)));
		}
	}
};
oFF.AuGdsQbBuilderPanel.prototype.configureDropForDimension = function(model, view)
{
	var dim = view.getDimension();
	var header = view.getHeader();
	var list = view.getChildrenList();
	if (dim.isStructure())
	{
		if (!oFF.AuGdsQbUtils.isMember(model))
		{
			return;
		}
		var member = model;
		if (member.getDimension() === dim)
		{
			var structureMember = dim.getStructureMember(member.getName());
			this.setDropInfo(header, list, null, oFF.UiLambdaDropListener.create( function(headerDrop){
				this.handleMemberDrop(headerDrop, structureMember);
			}.bind(this)));
		}
	}
	else
	{
		if (!oFF.AuGdsQbUtils.isAttribute(model))
		{
			return;
		}
		var attribute = model;
		if (attribute.getDimension() === dim)
		{
			this.setDropInfo(header, list, null, oFF.UiLambdaDropListener.create( function(listDrop){
				this.handleAttributeDrop(listDrop, attribute);
			}.bind(this)));
		}
	}
};
oFF.AuGdsQbBuilderPanel.prototype.setDropInfo = function(header, list, dropZone, listener)
{
	header.setDropInfo(oFF.AuGdsQbBuilderPanel.getDefaultDropInfoHead());
	header.registerOnDrop(listener);
	list.setDropInfo(oFF.AuGdsQbBuilderPanel.getDefaultDropInfoList());
	list.registerOnDrop(listener);
	if (oFF.notNull(dropZone))
	{
		dropZone.setDropInfo(oFF.AuGdsQbBuilderPanel.getDefaultDropInfoHead());
		dropZone.registerOnDrop(listener);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.buildMemberItem = function(member)
{
	var dim = member.getDimension();
	var isStructureMember = dim.isStructure();
	var hierarchyActive = dim.isHierarchyActive();
	var supportsSort = oFF.AuGdsQbDesignerUtils.supportsMemberSort(dim);
	var allowDrag = supportsSort && isStructureMember && !hierarchyActive;
	var view = this.buildDragItem(member, allowDrag,  function(dragItem){
		this.removeMember(member, dragItem);
	}.bind(this));
	var item = view.getRoot();
	item.addCssClass("ffGdsQbBuilderPanelChildItem");
	item.addCssClass("ffGdsQbBuilderPanelMember");
	if (isStructureMember && this.getParentDocument().getFeatureManager().areAdvancedFeaturesEnabled())
	{
		item.registerOnContextMenu(oFF.AuGdsLambdaListenerWithEvent.create( function(evt){
			this.showMemberMenu(evt, member);
		}.bind(this)));
	}
	return view;
};
oFF.AuGdsQbBuilderPanel.prototype.buildAttributeList = function(dim, container)
{
	var resultSetAttributes = dim.getResultSetAttributes();
	var mainAttribute = dim.getMainAttribute();
	var views = oFF.XList.create();
	for (var i = 0; i < resultSetAttributes.size(); i++)
	{
		var attribute = resultSetAttributes.get(i);
		if (attribute === mainAttribute)
		{
			continue;
		}
		var view = this.buildAttributeItem(attribute);
		container.addItem(view.getRoot());
		views.add(view);
	}
	return views;
};
oFF.AuGdsQbBuilderPanel.prototype.buildAttributeItem = function(attribute)
{
	var view = this.buildDragItem(attribute, true,  function(dragItem){
		this.removeAttribute(attribute, dragItem);
	}.bind(this));
	view.getRoot().addCssClass("ffGdsQbBuilderPanelChildItem");
	view.getRoot().addCssClass("ffGdsQbBuilderPanelAttribute");
	var nameLbl = view.getLabel();
	nameLbl.addCssClass("ffGdsQbBuilderPanelAttributeLabel");
	nameLbl.setFontStyle(oFF.UiFontStyle.ITALIC);
	nameLbl.useMaxWidth();
	nameLbl.setCustomObject(attribute);
	this.m_labels.add(nameLbl);
	return view;
};
oFF.AuGdsQbBuilderPanel.prototype.buildDragItem = function(obj, allowDrag, removeAction)
{
	var i18n = this.getParentDocument().getLocalizationProvider();
	var dragItem = this.getGenesis().newControl(oFF.UiType.CUSTOM_LIST_ITEM);
	dragItem.setPadding(oFF.UiCssBoxEdges.create("0 0.25rem 0 2.5rem"));
	if (allowDrag)
	{
		dragItem.setDraggable(true);
		dragItem.setTag(oFF.AuGdsQbConstants.QD_UI_DRAG_ELEMENT);
		dragItem.setCustomObject(oFF.AuGdsQbDragPayloadSimple.createWrapper(obj));
		dragItem.registerOnDragStart(oFF.UiLambdaDragStartListener.create( function(dragEvt){
			this.dragStartModelComponent(obj);
		}.bind(this)));
		dragItem.registerOnDragEnd(oFF.UiLambdaDragEndListener.create( function(dragEndEvt){
			this.dragEnd();
		}.bind(this)));
	}
	var header = dragItem.setNewContent(oFF.UiType.FLEX_LAYOUT);
	header.useMaxWidth();
	header.setDirection(oFF.UiFlexDirection.ROW);
	header.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	header.setJustifyContent(oFF.UiFlexJustifyContent.SPACE_BETWEEN);
	header.setOverflow(oFF.UiOverflow.HIDDEN);
	var nameLbl = header.addNewItemOfType(oFF.UiType.LABEL);
	nameLbl.setCustomObject(obj);
	this.m_labels.add(nameLbl);
	var removeIcon = header.addNewItemOfType(oFF.UiType.BUTTON);
	removeIcon.setIcon("sys-cancel");
	removeIcon.addCssClass("ffGdsQbBuilderPanelRemoveButton");
	removeIcon.setTooltip(i18n.getText(oFF.AuGdsQueryBuilderI18n.BUILDER_REMOVE));
	removeIcon.setButtonType(oFF.UiButtonType.TRANSPARENT);
	removeIcon.registerOnPress(oFF.AuGdsLambdaListener.create( function(){
		removeAction(dragItem);
	}.bind(this)));
	var itemView = oFF.AuGdsQbListItemView.createForBuilderPanel(dragItem, nameLbl);
	itemView.setModelComponent(obj);
	return itemView;
};
oFF.AuGdsQbBuilderPanel.prototype.removeMember = function(member, item)
{
	if (item.getParent() === null)
	{
		return;
	}
	this.updateMemberFilter(member, false);
	item.getParent().removeItem(item);
	this.findAndRemoveLabelForObject(member);
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.handleDimensionRemoval = function(dim, item)
{
	if (item.getParent() === null || !dim.supportsAxis(oFF.AxisType.FREE))
	{
		return;
	}
	if (oFF.AuGdsQbDesignerUtils.canBeAggregated(dim))
	{
		this.removeDimension(dim);
		return;
	}
	var application = this.getParentDocument().getApplication();
	var title = this.getParentDocument().getLocalizationProvider().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.FILTER_DIALOG_TITLE, dim.getText());
	oFF.AuGdsQbDesignerUtils.openSingleMemberFilterDialog(application, title, dim,  function(){
		this.removeDimension(dim);
	}.bind(this));
};
oFF.AuGdsQbBuilderPanel.prototype.removeDimension = function(dim)
{
	var cmd = dim.getConvenienceCommands();
	oFF.FieldContainerPresentationHelper.removeDisplayAttributesFromDimension(dim);
	cmd.moveDimensionToFree(dim.getName());
	this.findAndRemoveLabelForObject(dim);
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.removeAttribute = function(attribute, item)
{
	if (item.getParent() === null)
	{
		return;
	}
	var dimName = attribute.getDimension().getName();
	attribute.getConvenienceCommands().removeAttributeFromResultSet(dimName, attribute.getName());
	item.getParent().removeItem(item);
	this.findAndRemoveLabelForObject(attribute);
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.findAndRemoveLabelForObject = function(obj)
{
	for (var i = this.m_labels.size() - 1; i >= 0; i--)
	{
		var label = this.m_labels.get(i);
		if (label.getCustomObject() === obj)
		{
			this.m_labels.removeAt(i);
		}
	}
};
oFF.AuGdsQbBuilderPanel.prototype.onMenuAction = function()
{
	this.updatePanelUi();
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.onMoreButtonPressed = function(panel, clickedButton)
{
	oFF.XTimeout.timeout(100,  function(){
		this.openMenuAt(oFF.AuGdsQbBuilderPanel.BUILDER_PANEL_MORE_MENU, clickedButton);
	}.bind(this));
};
oFF.AuGdsQbBuilderPanel.prototype.handleDimDrop = function(event, dim, targetAxis)
{
	var draggedControl = event.getDraggedControl();
	if (event.getDroppedControl() === draggedControl)
	{
		return;
	}
	var axis = this.m_queryManager.getQueryModel().getAxis(targetAxis);
	oFF.AuGdsQbBuilderPanel.moveModel(dim, event, axis);
	this.expandDimension(dim.getName());
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.handleMemberDrop = function(event, member)
{
	var draggedControl = event.getDraggedControl();
	if (event.getDroppedControl() === draggedControl)
	{
		return;
	}
	var dim = member.getDimension();
	var layout = oFF.AuGdsQbDesignerUtils.getMemberOrder(dim);
	oFF.AuGdsQbBuilderPanel.moveModel(member, event, layout);
	oFF.AuGdsQbDesignerUtils.setMemberOrder(dim, layout);
	this.updateMemberFilter(member, true);
	this.expandDimension(dim.getName());
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.handleAttributeDrop = function(event, attribute)
{
	var draggedControl = event.getDraggedControl();
	if (event.getDroppedControl() === draggedControl)
	{
		return;
	}
	var attributes = attribute.getDimension().getResultSetAttributes();
	oFF.AuGdsQbBuilderPanel.moveModel(attribute, event, attributes);
	this.expandDimension(attribute.getDimension().getName());
	this.notifyEditActionListeners();
};
oFF.AuGdsQbBuilderPanel.prototype.addMemberIfNotPresent = function(member)
{
	var dim = member.getDimension();
	var currentLayout = oFF.AuGdsQbDesignerUtils.getMemberOrder(dim);
	currentLayout.removeElement(member);
	currentLayout.add(member);
	oFF.AuGdsQbDesignerUtils.setMemberOrder(dim, currentLayout);
	var posNegPair = oFF.AuGdsQbDesignerUtils.getVisibleByFilter(dim);
	if (!oFF.AuGdsQbDesignerUtils.isVisibleByFilter(member, posNegPair))
	{
		this.updateMemberFilter(member, true);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.addAttributeIfNotPresent = function(attribute)
{
	var attributes = attribute.getDimension().getResultSetAttributes();
	if (!attributes.contains(attribute))
	{
		attributes.add(attribute);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.updateMemberFilter = function(member, include)
{
	var dim = member.getDimension();
	var allMembers = this.getMembersByDimension(dim);
	var includedMembers = this.getCurrentlyIncludedMembers(dim);
	if (!include)
	{
		includedMembers.removeElement(member);
	}
	else if (!includedMembers.contains(member))
	{
		includedMembers.add(member);
	}
	oFF.AuGdsQbDesignerUtils.setFilterForDimension(dim, allMembers, includedMembers);
};
oFF.AuGdsQbBuilderPanel.prototype.getMembersByDimension = function(dim)
{
	var parentDocument = this.getParentDocument();
	return parentDocument.getMemberByType(dim.getDimensionType());
};
oFF.AuGdsQbBuilderPanel.prototype.getCurrentlyIncludedMembers = function(dim)
{
	var dimView = this.m_dimViews.getByKey(dim.getName());
	var memberViews = dimView.getAllChildren();
	return oFF.XStream.of(memberViews).map( function(mv2){
		return mv2.getModelComponent();
	}.bind(this)).collect(oFF.XStreamCollector.toList());
};
oFF.AuGdsQbBuilderPanel.prototype.dragStartModelComponent = function(model)
{
	this.configureDragDropAxis(model, this.m_rows);
	this.configureDragDropAxis(model, this.m_cols);
	for (var i = 0; i < this.m_dimViews.size(); i++)
	{
		this.configureDropForDimension(model, this.m_dimViews.get(i));
	}
};
oFF.AuGdsQbBuilderPanel.prototype.dragEnd = function()
{
	this.m_rows.getHeaderLayout().setDropInfo(null);
	this.m_rows.getList().setDropInfo(null);
	this.m_cols.getHeaderLayout().setDropInfo(null);
	this.m_cols.getList().setDropInfo(null);
	for (var i = 0; i < this.m_dimViews.size(); i++)
	{
		var dimView = this.m_dimViews.get(i);
		dimView.getHeader().setDropInfo(null);
		dimView.getChildrenList().setDropInfo(null);
	}
};
oFF.AuGdsQbBuilderPanel.prototype.expandDimension = function(name)
{
	this.m_panelExpansion.putBoolean(name, true);
};
oFF.AuGdsQbBuilderPanel.prototype.notifyEditActionListeners = function()
{
	for (var i = 0; i < this.m_editActionListeners.size(); i++)
	{
		this.m_editActionListeners.get(i).notifyEditAction();
	}
};
oFF.AuGdsQbBuilderPanel.prototype.clearEditActionListeners = function()
{
	this.m_editActionListeners.clear();
};
oFF.AuGdsQbBuilderPanel.prototype.addEditActionListener = function(editActionListener)
{
	this.m_editActionListeners.add(editActionListener);
};
oFF.AuGdsQbBuilderPanel.prototype.removeEditActionListener = function(editActionListener)
{
	this.m_editActionListeners.removeElement(editActionListener);
};

