	listLayout.setFlex("1 1 50%");
	var label = listLayout.addNewItemOfType(oFF.UiType.LABEL);
	label.setText(text);
	label.setFontWeight(oFF.UiFontWeight.BOLD);
	label.setFontSize(oFF.UiCssLength.create("1rem"));
