oFF.AuGdsQbChartSettingsPanel.prototype.handleDimDrop = function(event, targetAxis)
{
	if (event.getDroppedControl() === event.getDraggedControl())
	{
		return;
	}
	var draggedControl = event.getDraggedControl();
	var customObject = draggedControl.getCustomObject();
	var memberSelection = null;
	if (customObject.getOlapComponentType().isTypeOf(oFF.OlapComponentType.VISUALIZATION_AXIS_MEMBER_SELECTION))
	{
		memberSelection = customObject;
	}
	if (oFF.notNull(memberSelection))
	{
		var moveItem = this.buildDimItem(memberSelection);
		var list = event.getControl();
		var dropIndex = this.calcDropIndex(event);
		this.moveItem(list, moveItem, dropIndex);
		this.notifyEditActionListeners();
	}
};
oFF.AuGdsQbChartSettingsPanel.prototype.handleValueDrop = function(event, valueType)
{
	if (event.getDroppedControl() === event.getDraggedControl())
	{
		return;
	}
	var draggedControl = event.getDraggedControl();
	var customObject = draggedControl.getCustomObject();
	var valueSelection = null;
	if (customObject.getOlapComponentType().isTypeOf(oFF.OlapComponentType.VISUALIZATION_VALUE))
	{
		valueSelection = customObject;
	}
	else if (customObject.getOlapComponentType().isTypeOf(oFF.MemberType.ABSTRACT_MEMBER))
	{
		valueSelection = oFF.QKeyFigureSelection.create(this.m_visualizationDefinition.getContext(), customObject, this.m_visualizationDefinition, valueType);
	}
	if (oFF.notNull(valueSelection))
	{
		var moveItem = this.buildValueItem(valueSelection);
		var list = event.getControl();
		var dropIndex = this.calcDropIndex(event);
		this.moveItem(list, moveItem, dropIndex);
		this.notifyEditActionListeners();
	}
};
oFF.AuGdsQbChartSettingsPanel.prototype.calcDropIndex = function(event)
{
	var dropPosition = event.getRelativeDropPosition();
	var list = event.getControl();
	var dropIndex = list.getIndexOfItem(event.getDroppedControl());
	dropIndex = dropPosition === oFF.UiRelativeDropPosition.BEFORE ? dropIndex : dropIndex + 1;
	var oldIndex = list.getIndexOfItem(event.getDraggedControl());
	if (oldIndex !== -1 && oldIndex < dropIndex)
	{
		dropIndex--;
	}
	return dropIndex;
};
oFF.AuGdsQbChartSettingsPanel.prototype.moveItem = function(list, listItem, insertIndex)
{
	if (listItem.getParent() !== null)
	{
		listItem.getParent().removeItem(listItem);
	}
	if (insertIndex >= list.getItemCount())
	{
		list.addItem(listItem);
	}
	else
	{
		list.insertItem(listItem, insertIndex);
	}
};
