oFF.ContentFinderProgram = function() {};
oFF.ContentFinderProgram.prototype = new oFF.DfShellProgramWithApplication();
oFF.ContentFinderProgram.prototype._ff_c = "ContentFinderProgram";

oFF.ContentFinderProgram.SYSTEM_NAME = "system";
oFF.ContentFinderProgram.ONLY_NEED_ONE = false;
oFF.ContentFinderProgram.DEFAULT_PROGRAM_NAME = "cfinder";
oFF.ContentFinderProgram.PAGE_SIZE = 10;
oFF.ContentFinderProgram.prototype.predicate = function(qm)
{
	var variables = qm.getInputEnabledAndNonTechnicalVariables();
	for (var j = 0; j < variables.size(); j++)
	{
		var variable = variables.get(j);
		if (variable.getVariableType() === oFF.VariableType.DIMENSION_MEMBER_VARIABLE)
		{
			var dimVar = variable;
			return dimVar.hasMemberFilter();
		}
	}
	return false;
};
oFF.ContentFinderProgram.prototype.m_systemName = null;
oFF.ContentFinderProgram.prototype.m_catalogManager = null;
oFF.ContentFinderProgram.prototype.m_currentPage = 0;
oFF.ContentFinderProgram.prototype.m_processingBatch = false;
oFF.ContentFinderProgram.prototype.m_requestCounter = 0;
oFF.ContentFinderProgram.prototype.m_responseCounter = 0;
oFF.ContentFinderProgram.prototype.newProgram = function()
{
	var finder = new oFF.ContentFinderProgram();
	finder.setup();
	return finder;
};
oFF.ContentFinderProgram.prototype.getProgramName = function()
{
	return oFF.ContentFinderProgram.DEFAULT_PROGRAM_NAME;
};
oFF.ContentFinderProgram.prototype.doSetupProgramMetadata = function(metadata)
{
	oFF.DfShellProgramWithApplication.prototype.doSetupProgramMetadata.call( this , metadata);
	metadata.addOption(oFF.ContentFinderProgram.SYSTEM_NAME, "The system name", "", oFF.XValueType.STRING);
};
oFF.ContentFinderProgram.prototype.evalArguments = function()
{
	this.m_systemName = this.getArgumentStructure().getStringByKey(oFF.ContentFinderProgram.SYSTEM_NAME);
	if (oFF.XStringUtils.isNullOrEmpty(this.m_systemName))
	{
		this.m_systemName = "gipsy";
	}
};
oFF.ContentFinderProgram.prototype.runProcess = function()
{
	var serviceConfig = oFF.OlapCatalogApiModule.SERVICE_TYPE_OLAP_CATALOG.createServiceConfig(this.getApplication());
	serviceConfig.setSystemName(this.m_systemName);
	serviceConfig.processOlapCatalogManagerCreation(oFF.SyncType.NON_BLOCKING, this, null);
	return true;
};
oFF.ContentFinderProgram.prototype.onOlapCatalogManagerCreated = function(extResult, olapCatalogManager, customIdentifier)
{
	if (extResult.hasErrors())
	{
		this.println("==> error during catalog creation");
		this.exitNow(-1);
		return;
	}
	this.m_catalogManager = olapCatalogManager;
	this.m_catalogManager.setSelectedType(this.getMetaObjectType());
	this.m_catalogManager.setResultMaxSize(oFF.ContentFinderProgram.PAGE_SIZE);
	this.processNextPage();
};
oFF.ContentFinderProgram.prototype.getMetaObjectType = function()
{
	var systemType = this.getApplication().getSystemConnect(this.m_systemName).getSystemType();
	if (systemType.isTypeOf(oFF.SystemType.ABAP))
	{
		return oFF.MetaObjectType.QUERY;
	}
	if (systemType.isTypeOf(oFF.SystemType.HANA))
	{
		if (systemType.isTypeOf(oFF.SystemType.ABAP_MDS))
		{
			return oFF.MetaObjectType.QUERY;
		}
		return oFF.MetaObjectType.DBVIEW;
	}
	if (systemType.isTypeOf(oFF.SystemType.VIRTUAL_INA))
	{
		return oFF.MetaObjectType.DBVIEW;
	}
	if (systemType.isTypeOf(oFF.SystemType.UNV))
	{
		return oFF.MetaObjectType.UNX;
	}
	throw oFF.XException.createIllegalArgumentException(oFF.XStringUtils.concatenate2("no meta object type for system ", this.m_systemName));
};
oFF.ContentFinderProgram.prototype.processNextPage = function()
{
	this.m_catalogManager.setResultOffset(this.m_currentPage * oFF.ContentFinderProgram.PAGE_SIZE);
	this.m_currentPage++;
	this.m_catalogManager.processGetResult(oFF.SyncType.NON_BLOCKING, this, null);
};
oFF.ContentFinderProgram.prototype.onOlapCatalogResult = function(extResult, result, customIdentifier)
{
	if (extResult.hasErrors())
	{
		this.println("==> error during catalog result");
		this.exitNow(-1);
		return;
	}
	var results = extResult.getData().getObjectsList();
	if (!oFF.XCollectionUtils.hasElements(results))
	{
		this.finish();
		return;
	}
	this.m_processingBatch = true;
	for (var i = 0; i < results.size(); i++)
	{
		var catalogItem = results.get(i);
		var dataSource = oFF.QFactory.createDataSource();
		dataSource.setSystemName(this.m_systemName);
		dataSource.setType(catalogItem.getType());
		dataSource.setEnvironmentName(catalogItem.getEnvironmentName());
		dataSource.setSchemaName(catalogItem.getSchemaName());
		dataSource.setPackageName(catalogItem.getPackageName());
		dataSource.setObjectName(catalogItem.getObjectName());
		var serviceConfig = oFF.QueryServiceConfig.createWithDataSource(this.getApplication(), this.m_systemName, dataSource);
		serviceConfig.processQueryManagerCreation(oFF.SyncType.NON_BLOCKING, this, null);
		this.m_requestCounter++;
	}
	this.m_processingBatch = false;
	this.checkIfDone();
};
oFF.ContentFinderProgram.prototype.onQueryManagerCreated = function(extResult, queryManager, customIdentifier)
{
	this.m_responseCounter++;
	if (extResult.hasErrors())
	{
		this.checkIfDone();
		return;
	}
	if (this.predicate(queryManager))
	{
		this.println(queryManager.getDataSource().getFullQualifiedName());
	}
	oFF.XObjectExt.release(queryManager);
	this.checkIfDone();
};
oFF.ContentFinderProgram.prototype.checkIfDone = function()
{
	if (!this.m_processingBatch && this.m_responseCounter >= this.m_requestCounter)
	{
		this.m_requestCounter = 0;
		this.m_responseCounter = 0;
		this.processNextPage();
	}
};
oFF.ContentFinderProgram.prototype.finish = function()
{
	oFF.XObjectExt.release(this.m_catalogManager);
	this.println("===> done");
	this.exitNow(0);
};

